_home.phtml?&gid=1512898&sessionid=e66ecc705d36da315264120f02e5a0d6','http://hphotos-snc3.fbcdn.net/hs507.snc3/26634_611979152088_37704954_35305144_4773585_n.jpg','','7329 W. 63rd St., Summit, IL 60501'),(151,'Atwood-Hammond ','Marching Rajahs','Atwood','Joe and Sherrie Wolfe','Black and Gold','','','<b>Illini Marching Band Festival Class C/D Champions:</b> 2002, 2003, 2004, 2005.\r\n<br>\r\nThe 2013-2014 school year marks the final year of a band program at Atwood-Hammond High School.  Atwood-Hammond students will enroll at Arthur-Lovington High School in the fall of 2014.\r\n','222 W. Magnolia, Atwood, IL 61913'),(169,'Batavia ','Marching Bulldogs','Batavia','Chris Owen and Brian VanKley','Crimson and Gold','http://www.bataviamusic.org/marching-band.html','http://209.85.48.14/1504/55/0/f5009158/MarchingBulldogs.jpg','','1201 Main Street, Batavia, IL 60564'),(84,'Belleville East ','Marching Lancers','Belleville','Mark A. Tessereau and Timothy Hassall','Columbia Blue/Navy Blue','http://www.lancerbands.org/','http://i145.photobucket.com/albums/r227/dbalash/belleville.jpg','One of the largest student organizations on the campus of Belleville East High School is the Belleville East Marching Lancers.\r\n\r\nThe Marching Lancers march parades throughout the year, starting at the beginning of the summer and finishing in late November. At the beginning of August, the band goes through two weeks of band camp, when they learn their marching show for the fall season. They perform the show during halftime at home football games and at major competitions in the Metro East area.\r\n\r\nEvery two years, the band attends a bowl game. In 2002, the Marching Lancers went to the Peach Bowl in Atlanta, Georgia where they won top honors including Grand Champion. In 2004, they marched at the Liberty Bowl in Memphis, Tennessee, also winning the Grand Champion trophy. In 2006 the Marching Lancers performed in the Outback Bowl in Tampa, FL where they were grand champions of Jazz and Concert Band and placed 2nd in the parade and 3rd in the field show. The next trip is in the works.\r\n','2555 W. Blvd, Belleville, IL 62221'),(2,'Belleville West ','Marching Maroons','Belleville','Dr. Tom Birkner','Maroon and White','http://bths201.org/index.php/bwclubaactleftmen/179-westcat/bw-clubs-a-activities/772-bw-marching-maroons','','<b>State of Illinois Invitational Marching Band Finalists:</b> 1987, 1988, 1990.','4063 Frank Scott Parkway West, Belleville, IL 62223'),(170,'Bement ','Marching Bulldogs','Bement','Julie Reynolds','Purple and White','http://bementbands.weebly.com/','http://bementbands.weebly.com/uploads/5/9/9/5/5995239/8372385_orig.jpg','','201 S. Champaign St, Bement, IL 61813'),(167,'Bismarck-Henning ','Marching Blue Devils','Bismarck','David Schroeder','Blue and White','http://www.bismarck.k12.il.us/vnews/display.v/SEC/High%20School|Clubs%20%26%20Activities%3E%3EBand','http://www.bismarck.k12.il.us/pages/uploaded_images/Marching%20Band%5B1%5D.jpg','','17268 East 2750 North Road, Bismarck, IL 61814'),(92,'Bloomington ','Marching Raiders','Bloomington','Max Chernick and Pamela Kelly','Purple and Gold','http://wordpress.district87.org/band/','','<b>State of Illinois Invitational Marching Band Finalists:</b> 2009, 2013, 2014.<br>\r\n<b>Illinois Marching Band Championships Class 4A Champions:</b> 2010, 2012, 2014.','1202 E. Locust St., Bloomington, IL 61701'),(51,'Blue Ridge ','Marching Knights','Farmer City','Christopher Mitchell','Royal Blue and Silver','http://www.blueridge18.org/index.php?option=com_content&task=blogcategory&id=139&Itemid=304','http://i145.photobucket.com/albums/r227/dbalash/ISU/100_0166.jpg','<b>Illini Marching Band Festival Class C/D Champions:</b> 2007.','411 N. John St., Farmer City, IL 61842'),(184,'Bolingbrook ','Marching Raiders','Bolingbrook','Robert Hanerhoff and Scott Weber','Red, Black, and White','http://bhsmusicboosters.squarespace.com/','','','365 Raider Way, Bolingbrook, IL 60440'),(105,'Bremen ','Marching Braves','Midlothian','Ben Salgado','Red and Gray','http://bhsd228.schoolwires.net//Domain/53','http://i145.photobucket.com/albums/r227/dbalash/DSC_8398.jpg','','15203 S. Pulaski Road, Midlothian, IL 60445'),(87,'Brother Rice/Mother McAuley','Marching Band','Chicago','Daniel Briggs','Maroon/Burnt Orange','http://www.brotherrice.org/activities/band','','The Brother Rice/Mother McAuley Marching Band is made up of students from the Brother Rice/Mother McAuley Bands.  It is an all-volunteer, co-educational performing ensemble.  The bands come together for jazz and marching to create the final product.  They are non-competitive as of 2011.','10001 S. Pulaski Road, Chicago, IL 60655'),(176,'Cambridge ','Marching Vikings','Cambridge','Chris Allen','Maroon and White','http://cambridge.il.schoolwebpages.com/education/components/teacher/default.php?sectionid=389&','http://cambridge.il.schoolwebpages.com/images/pageitems/3145/p436636577_3938.jpg?sc_id=1252086308','','300 S. West St. Cambridge, IL 61238'),(76,'Canton ','Little Giants','Canton','Kristin Schrag','Purple and Gold','http://www.cantonhighband.com/','http://www.cantonhighband.com/page8/page5/files/marching-band.jpg','<b>State of Illinois Invitational Marching Band Finalists:</b> 1977, 1987.','1001 N. Main St. Canton, IL 61520'),(85,'Carbondale ','Marching Terriers','Carbondale','Gregory Townsend','Black and White','http://www.marchingterriers.com/','http://www.marchingterriers.com/images/motion/07/ussba42-800.jpg','','1301 E. Walnut St., Carbondale, IL 62901'),(114,'Carl Sandburg ','Marching Eagles','Orland Park','Stewart Bailey and Brian Hillhouse','Royal Blue and Gold','http://www.sandburgmusic.org/','','','13300 South LaGrange Road, Orland Park, IL 60462'),(156,'Carlyle ','Marching Indians','Carlyle','Jamie Zettler','Purple and Gold','http://www.carlyle.k12.il.us/education/staff/staff.php?sectionid=4225','','','1461 Twelfth St. Carlyle, IL 62231'),(116,'Carrollton ','Hawks Pride Band','Carrollton','Margaret Bear','Kelly Green and White','','','The band hasn\'t actively marched in several years, 2009 was their first year back into marching band, doing primarily parades, but one field show as a confidence builder.<br>  \r\n\r\nThe band has been inactive in competitions since 2010.','950 S. Third St. Carrollton, IL 62016'),(157,'Carterville ','Pride of the Lions','Carterville','Nicholas Williams','Navy Blue and Orange','','','','816 S. Division St., Carterville, IL 62918'),(146,'Casey-Westfield ','Marching Warriors','Casey','Brent Ritter','Purple, Gold, and White','http://www.cw.k12.il.us/education/staff/staff.php?sectionid=147&','','','306 E. Edgar, Casey, IL 62420'),(4,'Centralia ','Marching Showcase','Centralia','Sean Cartner','Cardinal Red and White','http://www.centraliahsbands.org/','http://www.chsshowcase.org/images/lrg-3041-3e0y7726.jpg','','2100 E. Calumet, Centralia, IL 62801'),(3,'Champaign Centennial ','Charger Bands','Champaign','Mike Allen and Nick Schulze','Columbia Blue, Navy and White','http://www.chargerbands.com/','','','913 S. Crescent Dr., Champaign, IL 61821'),(155,'Champaign Central ','Marching Maroons','Champaign','John and Jennifer Currey','Maroon and White','http://maroons.org/','','Champaign Central is a volunteer marching band which runs concurrently with 3 concert bands, orchestra, beginning band, 3 jazz bands, and 3 jazz combos.  They start all of our groups in the fall with the exception of the basketball pep band.','610 W. University Av., Champaign, IL 61820'),(5,'Charleston ','Marching Trojans','Charleston','Laney Grimes','Scarlet Red and Gold','','','','1615 Lincoln Ave., Charleston, IL 61920'),(147,'Civic Memorial ','Marching Eagles','Bethalto','Lori Hoke','Purple and Gold','http://hokebands.weebly.com/','http://www.bethalto.org/images/pageitems/83704/p370580711_61813.jpg?sc_id=1247334061','','200 School St., Bethalto, IL 62010'),(247,'William Howard Taft','Marching Eagles','Chicago','Kevin Harriman','Silver and Blue','','','','6545 West Hurlbut Avenue, Chicago, IL 60631'),(113,'Coal City ','Marching Coalers','Coal City','Tom Ruzinok','Dark Green, White, and Gold','http://www.coalcity.k12.il.us/teachpages/high/ruzinok/index.htm','','','655 W. Division St., Coal City, IL 60416'),(86,'Collinsville ','Marching Kahoks','Collinsville','Robert Wright and Ryan Stack','Purple and White','https://sites.google.com/a/cusd.kahoks.org/chs-band/Home/marching-kahoks','http://i145.photobucket.com/albums/r227/dbalash/BOA%20Illinois%20bands/100_0511.jpg','The Collinsville High School Band Program has a strong tradition of excellence in music performance.  On a yearly basis, the CHS bands represent Collinsville High School and the communities of Caseyville, Maryville, and Collinsville, through local, statewide, and national performances.  The CHS band students rehearse diligently throughout the school year and summer for these performances.  Nearly 90% of all band students are involved in more than one performing ensemble.  Each May, over half of each graduating class of band students remain involved in music and continue to perform locally or at the collegiate level.  Several band students each year decide to make music a career after high school.  Through involvement in the band program, students not only improve their musicianship and technique, but also learn life skills such as responsibility, dedication, cooperation, and leadership.  This is derived from their individual work towards the betterment of the group.  ','2201 S. Morrison Av., Collinsville, IL 62234'),(6,'Columbia ','Marching Eagles','Columbia','Craig Ryterski','Blue and White','','','','77 Veterans Parkway, Columbia, IL 62236'),(128,'Crystal Lake Central ','Marching Tigers','Crystal Lake','Keith Levin','Orange and Black','http://www.clcbands.org/','','','45 W. Franklin St., Crystal Lake, IL 60014'),(7,'Crystal Lake South ','Marching Gators','Crystal Lake','Chris Keyes','Green, Gold, and White','http://ww2.d155.org/cls/tdirectory/CKeyes/default.aspx','','','1200 S. McHenry Av., Crystal Lake, IL 60014'),(52,'Danville ','Band of Vikings','Danville','Kent Krause and Elizabeth Sachtleben','Maroon and White','http://www.bandofvikings.org','http://www.dhsimb.com/images/BOV_2007.jpg','<b>State of Illinois Invitational Marching Band Finalists:</b> 1984, 1985, 1986, 1987, 1989, 1990.','202 E. Fairchild, Danville, IL 61832'),(183,'DeKalb ','Marching Barbs','DeKalb','Steven Lundin','Orange and Black','http://www.dhsband.org/','','','501 W. Dresser, DeKalb, IL 60115'),(64,'Downers Grove North ','Marching Trojans','Downers Grove','Brayer Teague and William Miller','Purple and White','http://dgnbands.blogspot.com','','The \"TROJAN\" Marching Band averages 200 instrumentalists and color guard. Showcasing new uniforms purchased in 2006, the band performs at four or five home football games each year, the homecoming parade and assembly, the Band-O-Rama concert, home and away play-off games, and the Downers Grove Holiday and Memorial Day Parades.  In March of 1996 the band traveled to Orlando, Florida, where they performed at Walt Disney World (Main Street parade) and Universal Studios (Studio Lot parade).  In April of 1998 the Band was invited to Washington DC, to perform on the steps of the United States Capitol.  The band performed both the Canadian and United States National Anthems at Comiskey Park on Sunday, April 26, 1998.\r\n\r\nThe 1999-2000 Marching Band was invited to perform in the Dublin, Ireland St. Patrick\'s Day Parade as well as the Limerick, Ireland International Marching Band Festival in March of 2000.\r\n\r\nThe \"TROJAN\" Marching Band prides itself on it\'s high-energy approach to music, musicianship, sportsmanship, and teamwork. The Band performs original arrangements by their directors, commissions, and the finest published literature. The Pre-Game show consists of the Fast Entry, DGN Fanfare, North High School Song (with Block \"N\" Drill), the National Anthem, and special music for the kick-off. Half-time shows that change from week-to-week keep the \"TROJAN\" fans engaged and entertained. The Band plays many tunes in the stands to keep the crowd involved, and takes pride in the fact that they \"make some noise\" (vocally) ... enough so to distract the other team. Each home football game concludes with the playing and singing of the North High Alma Mater with the football team standing within the ranks of the band. \r\n\r\nDowners Grove North has not traditionally competed.','4436 Main St., Downers Grove, IL 60515'),(210,'Auburn','Marching Trojans','Auburn','Bekah Philbrick','Royal Blue and White','http://auburn.k12.il.us/vnews/display.v/SEC/Parent%20Information%7CMusic%20Boosters','','','511 North Seventh St., Auburn, IL 62615'),(8,'Downers Grove South ','Marching Mustangs','Downers Grove','Craig Roselieb, Greg Hensel','Navy Blue and Columbia Blue','http://dgsbandboosters.weebly.com/index.html','http://i145.photobucket.com/albums/r227/dbalash/ISU/100_0312.jpg','<b>State of Illinois Invitational Marching Band Finalists:</b> 1977, 1987, 2010, 2011, 2013.<br>\r\n<b>Illini Marching Band Festival Class 6A Champions:</b> 2011.<br>\r\n<br>\r\n\r\n<a href=\"http://www.mustangbandboosters.com/\">Booster\'s Site</a><br><a href=\"http://www.dgsmusicbowl.com\">Music Bowl Site</a><br><a href=\"http://www.mustangbandimages.com\">Media/Pictures Site</a><br>\r\n<br>\r\n<b>We are grateful for the fine videos Downers Grove South puts out for the Mustang Music Bowl year after year.  They have graciously allowed us to link to them on our video server.  These videos are taken and edited by volunteers yearly.</b>','1436 Norfolk, Downers Grove, IL 60516'),(9,'Dunlap ','Marching Eagles','Dunlap','Jill Potts and Jason Shea','Maroon and Gold','http://www.eaglemusic.net','http://sphotos.ak.fbcdn.net/hphotos-ak-snc3/hs507.snc3/26634_611979162068_37704954_35305146_6596702_n.jpg','<b>Illini Marching Band Festival Small Schools Governor\'s Trophy Champions:</b> 2000, 2001, 2002.<br>\r\n<b>Illini Marching Band Festival Class B Champions:</b> 2002.<br>\r\n<b>Illini Marching Band Festival Class 1A Champions:</b> 2008.<br>\r\n<br>\r\nThe Dunlap High School Music Program is one of the premier High School Music Programs in the State of Illinois. \r\n\r\nOver 300 + students strong, the program competes in many competitions and performs countless times throughout the year.   We invite you to come to one of our performances and share in our excitement!','5220 W. Legion Hall Road, Dunlap, IL 61525'),(203,'Dwight ','Marching Trojans','Dwight','Justin Gund','Kelly Green and White','https://sites.google.com/site/dthsbands/','','','801 S. Franklin, Dwight, IL 60420'),(10,'East Peoria ','Marching Raiders','East Peoria','Adam Schneblin and Kyle Newgard','Maroon and Gold','http://www.epchsband.org/','http://i145.photobucket.com/albums/r227/dbalash/EP.jpg','<b>State of Illinois Invitational Marching Band Finalists:</b> 1977, 1978.<br>\r\n<br>\r\nYou can visit the East Peoria YouTube page <a href=http://www.youtube.com/EPCHSMusic>here</a>.','1401 E. Washington St., East Peoria, IL 61611'),(70,'East Richland ','Marching Tigers','Olney','Ralph Petrella','Orange and Black','http://erhs.ercu1.net/staff_directory/teacher_pages/fine_arts/mr__petrella___band_and_music_/','http://www.ilmarching.com/bandpics/east_richland.jpg','','1100 E. Laurel, Olney, IL 62450'),(11,'Edwardsville ','Marching Tigers','Edwardsville','Marvin Battle and Lawrence Rogers','Orange and Black','http://www.edwardsvillebands.com/','','<b>State of Illinois Invitational Marching Band Finalists:</b> 2014.','6161 Center Grove Road, Edwardsville, IL 62025'),(12,'Effingham ','Red Regiment','Effingham','Jordan Black','Red and White and Forest Green','http://www.effingham.k12.il.us/studentactivities/finearts/band/effingham-hearts-red-regiment/','http://i145.photobucket.com/albums/r227/dbalash/ISU/100_0171.jpg','The Effingham High School band program has a history of success dating back more than 100 years.  In the past forty years the band has worked and performed with many well respected composers and conductors including Harry Begian and Vaclav Nelhybel.  In 2012, the marching band went to a volunteer, extra-curricular group.','1301 W. Grove, Effingham, IL 62401'),(191,'Eisenhower ','Marching Panthers','Decatur','Jennifer Morrow','Black and White','http://www.dps61.org/site/Default.aspx?PageID=7708','','','1200 S. 16th, Decatur, IL 62521'),(213,'Morris Community','Marching Maroon & White','Morris','Jeff Muraida','Maroon and White','http://sites.google.com/a/morrishs.org/mchsband/','','2012 marked the return to competition for the Morris Community High School Marching Band after many years.\r\n\r\n<br>\r\n\r\n2014 marks the creation of the Morris Community Marching Maroon & White.  This is an extra-curricular, competitive marching band.','1000 Union St., Morris, IL 60450'),(93,'El Paso-Gridley ','Marching Titans','El Paso','Christina Lohrberg','Purple and Black','http://sites.google.com/site/epgbands/','http://sites.google.com/site/epgbands/_/rsrc/1285852056871/home/high-school-band/greatshowatpontiac/Pontiac.jpg','','600 N. Elm St., El Paso, IL 61738'),(179,'Elgin ','Marching Maroons','Elgin','Jaimie Abney-Giraldo','Maroon and Cream','http://www.elginhighmusic.org/','','','1200 Maroon Dr., Elgin, IL 60120'),(120,'Elk Grove ','Marching Grenadiers','Elk Grove Village','Ron Fiorito Jr.','Forest Green and New Gold','http://www.eghsband.com/','http://sphotos.ak.fbcdn.net/hphotos-ak-snc3/hs507.snc3/26634_611979172048_37704954_35305147_3229446_n.jpg','<b>Illini Marching Band Championships Class 5A Champions:</b> 2013.<br>','500 W. Elk Grove Blvd., Elk Grove Villago, IL 60007'),(195,'Elmwood Park ','Marching Tigers','Elmwood Park','Kyle Rhoades','Black and Gold','https://sites.google.com/site/elmwoodparkband/','','','8201 W. Fullerton Ave., Elmwood Park, IL 60707'),(13,'Eureka ','Marching Hornets','Eureka','Todd Stalter and Denise Quitschau','Green and White','http://ehsband.yolasite.com','http://sphotos.ak.fbcdn.net/hphotos-ak-snc3/hs487.snc3/26634_611979177038_37704954_35305148_2415970_n.jpg','<b>State of Illinois Invitational Marching Band Finalists:</b> 2000, 2001, 2002, 2003, 2004, 2005, 2006, 2008, 2009, 2010.<br>\r\n<b>State of Illinois Invitational Marching Band Class 1A Champions:</b> 2000, 2001, 2002, 2003, 2004, 2005, 2006, 2008, 2009, 2010.<br>\r\n<b>Illini Marching Band Festival Small Schools Governors\' Trophy Champions:</b> 2008.\r\n<b>Illini Marching Band Festival Class B Champions:</b> 2008.<br>\r\n<b>Illini Marching Band Festival Class 2A Champions:</b> 2010.<br>\r\n','200 W. Cruger, Eureka, IL 61530'),(188,'Evanston ','Marching Wildkits','Evanston','Matthew Bufis and Michael Lehman','Orange and Blue','http://www.ethsbands.com/','http://i645.photobucket.com/albums/uu178/ilmarching/IMG_0403_2.jpg','The ETHS Wildkit Marching Band is in its sixth year of competition. \r\n\r\nETHS is a 2009 Grammy Signature School.','1600 Dodge Ave., Evanston, IL 60204'),(192,'Evergreen Park ','Marching Mustangs','Evergreen Park','Ken Kazin','Green and Gray','http://www.epchsbands.org/','','','9901 S. Kedzie, Evergreen Park, IL 60805'),(99,'Farmington ','Golden Wave','Farmington','Elizabeth Driscoll and Fred Herink','Purple and Gold','http://music.fccusd.schoolfusion.us/modules/groups/integrated_home.phtml?gid=1505041&sessionid=6cf7c66f4addc1d1322a0df913b95cc1','','<b>State of Illinois Invitational Marching Band Finalists:</b> 1983.','310 N. Lightfoot Road, Farmington, IL 61531'),(174,'Fieldcrest ','Marching Knights','Minonk','Rusty Russell','Navy and Silver','http://www.fieldcrest.k12.il.us/webpages/rrussell/','http://i145.photobucket.com/albums/r227/dbalash/IMG_1627.jpg','2012 marks the 4th season of competition for Fieldcrest after a 7 year absence.','1 Dornbush Dr., Minonk, IL 61760'),(14,'Fremd ','Viking Marching Band','Palatine','Matthew Moore, Dave Lang','Forest Green and Gold','http://www.fhs.d211.org/departments/music/mmoore/vikingmarchingband.htm','http://www.fhs.d211.org/departments/music/mmoore/Florida/47_small.JPG','The William Fremd HS Band program consists of 300 students enrolled in four bands that meet seperate class periods daily.  The Viking Marching Band is made up of students from all four bands and is a voluntary ensemble.  The focus of the band program is on our symhonic band literature, all marching band rehearsals occur outside of the school day.  Our marching band philosophy includes participation in marching band competitions for the experience and enjoyment of the performance/crowd.  Our music is intentionally chosen due to it\'s crowd appeal.  We do not stress the importance of scores, rankings, and competing against other schools.','1000 S. Quentin Road, Palatine, IL 60067'),(53,'Galesburg ','Marching Streaks','Galesburg','Brianne Hankes and Jacob Bisaillion','Silver and Gold','http://marchingstreaks.weebly.com/','http://www.ghsbandboosters.info/GHSBandPics0506/GHS%20BandBoosters%20Web%20Site-Images/99.jpg','<b>State of Illinois Invitational Marching Band Finalists:</b> 1978, 1979, 1993.<br>\r\n<br>\r\nThe Galesburg High School Band includes the marching band, pep band, Concert Band, Symphonic Band, Wind Symphony, Gold Jazz Ensemble, Silver Jazz Ensemble, Winter Guard, Winter Drum-line, and various chamber ensembles.  \r\n \r\nThe Marching Streaks perform at all home football games, the Labor Day, Homecoming, and Memorial Day Parade, and four parade and field competitions. \r\n\r\n\r\n','1135 W. Fremont St., Galesburg, IL 61401'),(54,'Geneseo ','Maple Leaf Marching Band','Geneseo','Steve Scherer and Tony Hernandez','Kelly Green and White','http://www.gcsdstaff.org/Scherer/','http://sphotos.ak.fbcdn.net/hphotos-ak-snc3/hs487.snc3/26634_611979182028_37704954_35305149_7679582_n.jpg','','700 N. State St., Geneseo, IL 61254'),(181,'Genoa-Kingston ','Marching Cogs','Genoa','Tom Rucker','Orange and Blue','http://sites.google.com/site/gkhsband/marching-band','http://lh4.ggpht.com/_kl_OdQHYRWw/SsEuLbjxeaI/AAAAAAAACno/6Xoc43MGFlA/s640/PhantomReg-092609%20006.jpg','The Genoa-Kingston High School Marching Band consists of 58 brass, woodwind, and percussion members.  The Marching Band performs at all home football games as well as community parades and events.  In September 2007 the G-K Marching Band made their first ever appearance at Northern Illinois University Band Day and performed a halftime show with over 2,000 other high school musicians at the football game. The fall marching season of 2008 showed off the first ever front percussion ensemble during a halftime show.  The front ensemble played more traditional \"indoor\" concert percussion such as the xylophone, bells, and timpani. \r\n\r\nThe GKMB continually strives to achieve excellence on the field.  Increasing difficulty in both the music selection and drill design, the GKMB is raising the standard for Marching Band in the Genoa-Kingston School District.  ','980 Park Ave., Genoa, IL 60135'),(78,'Georgetown-Ridge Farm ','Thunderin\' Buffs','Georgetown','Sara McGovern and Leslie Thompson','Purple and Gold','http://sites.google.com/site/grhsbands/','http://sites.google.com/site/grhsbands/_/rsrc/1254014510089/pics-and-vids/DSCN0253.JPG?height=240&width=320','','500 W. Mulberry St., Georgetown, IL 61846'),(15,'Glenbard West ','Marching Hilltoppers','Glen Ellyn','Jonathan Walsh and William Ortega','Forest Green and White','http://glenbardwesths.org/teachers/westmusic/Marching%20Band','http://i145.photobucket.com/albums/r227/dbalash/FBCompetitions037.jpg','Under the direction of Jonathan Walsh, Marching Band is a first semester elective for members of Concert Band I and Symphonic Band.  This group performs at all home football games, three or four contests, and at other community events.','670 Crescent Blvd., Glen Ellyn, IL 60137'),(135,'Glenbrook North ','The Spartan Marching Band','Northbrook','Mark Running and Rich Chapman','Dark Green and Gold','http://www.glenbrook225.org/gbn/Academics/Fine-Arts/Music/Bands