us','','The band started marching competitively in the 2009 school year.','206 E. Diller Ave., Broadlands, IL 61816'),(55,'Herscher ','Marching Tigers','Herscher','Will Brocker','Gold and Black','http://herscher.il.schoolwebpages.com/education/club/club.php?sectionid=1580&','http://hphotos-snc3.fbcdn.net/hs507.snc3/26634_611979192008_37704954_35305151_7686011_n.jpg','<b>State of Illinois Invitational Marching Band Class B-C/D Champions:</b> 1980, 1981, 1982. <br>\r\n<b>State of Illinois Invitational Marching Band Finalists:</b> 1978, 1986, 1997, 2000, 2001, 2012. <br>\r\n<b>State of Illinois Invitational Marching Band Class 2A Champions:</b> 2000, 2001.<br>\r\n<b>State of Illinois Invitational Marching Band Class 1A Champions:</b> 2012. <br>\r\n<br>\r\n<b>Marching Bands of America Grand National Finalist:</b> 1977, 1978.<br>\r\n<b>Bands of America Indianapolis Regional Champions:</b> 1982.<br>\r\n<br>\r\nThe Herscher High School music department contains three main areas: band, choir, and orchestra. Herscher has won the IHSA class B State Music Sweepstakes consistently since 1976. This includes consecutively winning the title since 1986.  Herscher is a 3 time Illinois State University Invitational Marching Band Championship winner, having won the title from 1980-1982.  They are only one of four winners of the title. The department also sends students to the IMEA district and all-state festivals every year possible!\r\n\r\nThough the department has won many awards and accolades, it is the mindset of the instructors that the music learned and the process concerning that learning must be of the highest educational caliber possible. It is the process that is important. Goals come when strict adherence to ideals in rehearsals are achieved.<br>\r\n','501 N. Main St., Herscher, IL 60941'),(17,'Highland ','Marching Bulldogs','Highland','Christopher Wilson and Trent Mason','Red and Black','','','Highland is a community that sits just outside the Metro East area of St Louis along Interstate 70. Highland High School has 987 students in the high school. The band program has had a tradition of excellence that extends for many years including an invitation to perform at the Superstate Band Festival in 2002 on the campus of the University of Illinois, placing first in our class at the 2010 ISU Concert Band Festival, and most recently placing third in our class the 2011 University of Illinois Marching Festival. Currently there are about 110 members in the HHS band program. Components of the band program include: Marching Band, Concert and Symphonic Band, Jazz Band, and Pep Band.','400 Broadway, Highland, IL 62249'),(225,'Freeburg Community','Mighty Midget Marching Band','Freeburg','Danielle McKenzie','Royal Blue and White','http://fchsmusic.webstarts.com/?r=20121002094855','','','401 S. Monroe St., Freeburg, IL 62243'),(142,'Hinsdale Central ','Red Devil Marching Band','Hinsdale','Matt Kurinsky and Matthew Goeke','Red and White','http://www.hcbands.org/','','','5500 South Grant St, Hinsdale, IL 60521'),(172,'Hinsdale South ','Marching Hornets','Darien','Patrick Maag','Black and Gold','http://www.hinsdalesouthband.com/','','','7401 Clarendon Hills Road, Darien, IL 60561'),(166,'Hoopeston Area ','Marching Cornjerkers','Hoopeston','Patrick Brooks','Blue and White','http://www.hoopeston.k12.il.us/buildings/highschool/clubsandgroups/marchingband/index.html','','','615 E. Orange, Hoopeston, IL 60942'),(91,'Huntley ','Marching Red Raiders','Huntley','Nick Konwerski','Red, White, and Black','https://district158.haikulearning.com/nkonwerski/index/cms_page/view','http://sphotos.ak.fbcdn.net/hphotos-ak-snc3/hs507.snc3/26634_611979196998_37704954_35305152_5728900_n.jpg','The Huntley High School Marching Band includes students of the Concert Band, Wind Symphony and Percussion Ensemble.  Sectionals are held on alternate Tuesday nights through the summer, and the full band comes together for three rehearsal \"camps,\" each lasting 3 or 4 days, for five hours each day. \r\n\r\nThrough the first quarter, each class spends 3 or 4 days each week rehearsing marching band material, and begins working on concert band music during the remaining days.  The full band rehearses Monday and Wednesday evenings for two hours.  The color guard is entirely extra-curricular.\r\n\r\nThe Marching Red Raiders perform at all home football games, various local parades and events, and participate in 3 or 4 band competitions each fall.','13719 Harmony Road, Huntley, IL 60142'),(199,'Illini West ','Marching Chargers','Carthage','Linda Hartweg','Navy Blue, Orange and White','http://illiniwest.org/vnews/display.v/SEC/Classroom%20Sites|Hartweg%2C%20L.%20-%20Music','','','600 Miller St., Carthage, IL 62321'),(18,'Illinois Valley Central ','Marching Grey Ghosts','Chillicothe','Matt Chapman, Kim Tegg and Timm Higus','Maroon and Grey','http://www.ivcbands.com','http://hphotos-snc3.fbcdn.net/hs507.snc3/26634_611979201988_37704954_35305153_1540879_n.jpg','<b>State of Illinois Invitational Marching Band Finalists:</b> 1982, 1986, 1989, 1990, 1993, 1998, 1999, 2002, 2003, 2004, 2007, 2011, 2013, 2014.<br>\r\n<b>State of Illinois Invitational Marching Band Class 2A Champions:</b> 1998, 1999, 2002, 2003, 2004.<br>\r\n<b>State of Illinois Invitational Marching Band Class 1A Champions:</b> 2007, 2011, 2013, 2014.<br>\r\n<b>Illini Marching Band Festival Small Schools Governors\' Trophy Champions:</b> 2003.\r\n','1300 W. Sycamore St., Chillicothe, IL 61523'),(196,'Jacksonville ','Marching Crimsons','Jacksonville','Matt Johnson','Scarlet and White','http://jhs.jsd117.org/?PageName=TeacherPage&Page=15&StaffID=202105&iSection=Teachers&CorrespondingID=202105','','','1211 N. Diamond, Jacksonville, IL 62650'),(106,'John Hersey ','Marching Huskies','Arlington Heights','Scott Casagrande and Mark Hengesh','Orange and Black','http://www.herseyband.com/','http://sphotos.ak.fbcdn.net/hphotos-ak-snc3/hs487.snc3/26634_611979206978_37704954_35305154_4986872_n.jpg','<b>Illini Marching Band Festival Large Schools Governors\' Trophy Champions:</b> 2009.<br>\r\n<b>Illini Marching Band Festival Class 2A Champions:</b> 2006.\r\n<b>State of Illinois Invitational Marching Band Finalists:</b> 2013.','1900 E. Thomas St., Arlington Heights, IL 60004'),(132,'Johnsburg ','Marching Skyhawks','Johnsburg','Anthony Graffeo','Royal Blue and Light Gold','https://sites.google.com/a/johnsburg12.org/jhs-bands/references/home','','','2002 W. Ringwood Road, Johnsburg, IL 60050'),(101,'Johnston City ','Marching Indians','Johnston City','Nicole Lindsey (Hodges)','Red and Black','http://www.jcindians.org/education/staff/staff.php?sectionid=38','http://hphotos-snc3.fbcdn.net/hs487.snc3/26634_611979211968_37704954_35305155_3301796_n.jpg','When the Seniors of Johnston City High School were Freshmen the Johnston City High School Marching Indians didn\'t know what competitive marching was. They didn\'t have a show, and they definitely didn\'t know you could march backwards or sideways. With luck in their hands, 2 years ago, the Johnston City High School Music Program was grateful to receive a brand new band director, Ms. Nicole Hodges, they learned their first show ever in 2006 and performed it at their home football games. Last year she put them in competitions and they did very well for their first time out with TWO 1st place trophies. They raised $10,000 for uniforms that year and are now out in-style. The new Director, Nicole Hodges, a former Drum Corps International Phantom Regiment member, writes their music and drill on her own, and tells the band that though they may be a band of 20 they have the talent to sound like a band of a million. The Marching Indians are becoming very successful and plan to keep up their competitive marching victories! ','1500 Jefferson St., Johnston City, IL 62951'),(110,'Joliet West ','Marching Tigers','Joliet','Eric Wellman','Black and Gold','http://www.jolietwestbands.org/','http://hphotos-snc3.fbcdn.net/hs487.snc3/26634_611979216