e marching band is made up of approximately 130 students and performs in competitions throughout the region as well as at home football games. The band program includes Concert Band, Symphonic Winds, Jazz Band, Pep Band, Brass Ensemble, and Music Theory. Several students from these groups are also chosen to participate as members of the All-District and All-State Bands. Morton represented Illinois in the 2009 Inaugural Parade for President Barack Obama. Morton was a 2010 Bands of America Grand National Semifinalist, their first time ever, placing 3rd in Class AA. <br>\r\n\r\n','350 N. Illinois St., Morton, IL 61550'),(190,'Mt. Carmel ','Marching Aces','Mt. Carmel','Kim Mandrell','Gold and Maroon','http://www.mchs.wabash.k12.il.us/Departments/Music/MusicDepartment.html','','','201 N. Pear St., Mt. Carmel, IL 62863'),(153,'Mt. Vernon ','Marching Rams','Mt. Vernon','Nick Loafman','Orange and Black','http://www.mvths.org/vnews/display.v/SEC/Organizations/Activities%7CBand','','','320 S. Seventh St., Mt. Vernon, IL 62864'),(72,'Mt. Zion ','Marching Braves','Mt. Zion','Brianna Bjerke','Red and White','http://mtzion.il.schoolwebpages.com/education/club/club.php?sectionid=10581','http://www.mtzionbands.com/gallery/Fgallery1-8.jpg','','315 S. Henderson, Mt. Zion, IL 62549'),(27,'Murphysboro ','Crimson Express','Murphysboro','Michael Moreland','Crimson Red and Corn Yellow','http://www.crimsonexpress.org/','http://www.crimsonexpress.com/galleries/gsl09/content/bin/images/large/217.jpg','<b>BOA St. Louis, MO Class A Regional Champions:</b> 2010.<br>','50 Blackwood Dr., Murphysboro, IL 62966'),(28,'Naperville Central ','Marching Redhawks','Naperville','D.J. Alstadt and Brandon Estes','Red and White','http://www.nchsbands.info/','http://i145.photobucket.com/albums/r227/dbalash/ISU/100_0319.jpg','<b>State of Illinois Invitational Marching Band Finalists:</b> 2004, 2007.<br>','440 W. Aurora Ave., Naperville, IL 60540'),(29,'Naperville North ','Marching Huskies','Naperville','Dan Mo