988. <br>\r\n<b>BOA St. Louis, MO Regional Finalists:</b> 1997, 1999. <br>\r\n<b>BOA St. Louis, MO Class AA Regional Champions:</b> 1997. <br>','3900 East Raab Road., Normal, IL 61761'),(88,'Normal West ','Marching Wildcats','Normal','Lisa Preston and Ryan Budzinski','Black and Orange','http://www.nwbands.org/','http://sphotos.ak.fbcdn.net/hphotos-ak-snc3/hs507.snc3/26634_611979301788_37704954_35305172_338500_n.jpg','<b>State of Illinois Invitational Marching Band Finalists:</b> 1998, 1999, 2000, 2008, 2011, 2013, 2014.<br>\r\n<b>State of Illinois Invitational Marching Band Class 4A Champions:</b> 2008. <br>\r\n<b>BOA Grand National Semifinalists</b>: 1997.<br>\r\n<b>BOA St. Louis Regional Finalists:</b> 1997, 1999. <br>\r\n<b>BOA Indianapolis, IN Class AA Regional Champions:</b> 1999. <br>\r\n<br>\r\nThe focus of the Normal West Band program is to enhance each student\'s musical experience. The program begins each year with the placement of students in one of four concert bands. However, in and effort to expose students to a wide variety of experiences, the Normal West program encourages participation in extra performing groups, such as: Marching Band, Jazz Band, Percussion Ensemble, Indoor Drumline, Pep Band, Orchestra Winds, Musical Pit Orchestra, Brass Choir, Flute Choir, and Clarinet Choir. All of these extra performing groups meet outside of the regular school day.<br>\r\n<br>\r\nThe marching band is an extracurricular activity at Normal West.\r\nThe marching band has performed at: Home football games, The Labor Day parade, The Normal West Homecoming parade, Numerous Chicago locations, Cincinnati, Ohio, Toledo, Ohio, Louisville, Kentucky, The RCA Dome and Lucas Oil Stadium in Indianapolis, and the Edward Jones Dome in St. Louis.\r\n\r\n','501 N. Parkside Rd., Normal, IL 61761'),(165,'Notre Dame/Resurrection ','Marching Band','Niles/Chicago','Michael Wallace','','https://sites.google.com/site/notredameresurrectionband/','','','7655 Dempster St., Niles, IL 60714