DROP TABLE IF EXISTS `Festivals`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `Festivals` (
  `FestivalID` int(11) NOT NULL AUTO_INCREMENT,
  `Name` varchar(255) NOT NULL,
  `Date` date NOT NULL,
  `FestivalYear` year(4) NOT NULL,
  `Location` varchar(255) NOT NULL,
  `Contact` varchar(255) NOT NULL,
  `WebsiteURL` varchar(255) NOT NULL,
  `Details` longtext NOT NULL,
  `Judges` mediumtext,
  `GrandChampionID` int(10) DEFAULT NULL,
  `GrandChampionBandName` varchar(255) DEFAULT NULL,
  `RainedOut` int(11) NOT NULL DEFAULT '0',
  `ScoreNotes` mediumtext,
  `Address` varchar(255) NOT NULL,
  `hasFinals` int(11) NOT NULL DEFAULT '0',
  `LastUpdated` date NOT NULL DEFAULT '1970-01-01',
  `UpdatedBy` varchar(100) NOT NULL,
  PRIMARY KEY (`FestivalID`),
  KEY `Fest_ind1` (`Name`,`FestivalYear`),
  KEY `fest_indx2` (`FestivalYear`)
) ENGINE=MyISAM AUTO_INCREMENT=726 DEFAULT CHARSET=latin1;
