INSERT INTO `Festivals` VALUES (1,'Morton Marching Invitational','2008-09-13',2008,'Morton, IL','Jeff Neavor','http://www.mortonbands.org/marching/pumpkinfest.php','The field show competition, hosted by Morton High School, is held during the City of Morton Pumpkin Festival.','',88,NULL,0,'Only Music Indv, Music Ens., and Music GE were scored. Scores were out of a possible 60.0 points.\r\n\r\nGrand Champion DM - Bloomington\r\nGrand Champion Aux - Lincoln-Way North\r\nGrand Champion Perc - Bloomington\r\nGrand Champion Winds - Downers Grove South','',0,'2014-01-14','dbalash'),(2,'Illinois State University Invitational Marching Championships','2007-10-20',2007,'Normal, IL','ISU','http://isubands.org/contest.html','ISU hosts the annual State of Illinois Marching Band Invitational, which pits some of the best bands in Illinois in a prelims/finals format.',NULL,22,NULL,0,'','',1,'1970-01-01',''),(3,'Lake Park Lancer Joust','2008-09-13',2008,'Roselle, IL','Mike Chiodo','http://lancerjoust.com/','The Annual Lancer Joust will feature bands from Indiana, Iowa, Wisconsin and Illinois. The competition is an afternnon/evening event in preliminary and final competition format. Preliminary competition is in Class by band size.',NULL,NULL,'Show cancelled due to inclement weather.',1,'','',0,'1970-01-01',''),(4,'Illinois State University Invitational Marching Championships','2008-10-11',2008,'Normal, IL','ISU','http://isubands.org/contest.html','ISU hosts the annual State of Illinois Marching Band Invitational, which pits some of the best bands in Illinois in a prelims/finals format.',NULL,22,NULL,0,'','',1,'1970-01-01',''),(5,'Metro East Marching Classic','2008-09-13',2008,'O\'Fallon, IL','Melissa Gustafson-Hinds','http://www.othsband.com/index.php?pagekey=metroeast','The Metro East Marching Classic (MEMC!) presented by the OFallon Township High School Band Boosters is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by school size and compete for awards in Outstanding Winds, Percussion, and Auxiliary, along with the crowning of a Grand Champion.',NULL,NULL,'Oakville, MO',0,'','',0,'1970-01-01',''),(6,'McHenry High School Marching Festival','2008-09-06',2008,'McHenry, IL','Brian Weidner','http://www.dist156.org/Staff/music%20website/home.htm','The McHenry High School Marching festival is a non-competitive festival focused on advancing student understanding of marching technique and providing early season feedback from university and top high school directors to apply for improving future performances. In addition to participating in a field show, each ensemble will also receive a 20 - 25 minute clinic with one of the members of our judging team.',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(7,'Belleville East Marching Invitational','2008-09-13',2008,'Belleville, IL','Mark Tessereau','http://www.lancerbands.org/marching_invitational','The Belleville East High School Marching Lancers invite you to attend the annual Belleville East Marching Invitational. Awards include Outstanding Winds, Visual, Percussion, Auxiliary, People\'s Choice, & Grand Champion.  Bands are classified by instrumentation size',NULL,NULL,'Oakville, MO',0,'','',0,'1970-01-01',''),(8,'Chicagoland Marching Band Festival','2008-09-20',2008,'Wheeling, IL','Brian Logan','http://wheelingbands.org/','The Chicagoland Marching Band Festival (CMBF) hosted by Wheeling High School is Chicago\'s longest running marching band festival and is now celebrating its 41st year',NULL,36,NULL,0,'','',0,'1970-01-01',''),(9,'Danville Viking Invitational','2008-09-20',2008,'Danville, IL','Bradley Leeb','http://www.dhsimb.com/invitational%20main.htm','This is an afternoon/evening contest that divides bands by band size.  Bands compete for awards in each division for placement, and captions (Winds, Percussion, Auxiliary, and Drum Major).  A Grand Champion for the event is also awarded.',NULL,96,NULL,0,'','',0,'1970-01-01',''),(10,'Mt. Zion Marching Music Games','2008-09-20',2008,'Mt. Zion, IL','Tim Page','http://www.mtzionbands.com/marchinggames.htm/','The Danville High School Band of Vikings will be presenting the 35th Annual Viking Invitational Marching Band Competition on Saturday, September 20th, 2008.  The event will be held on Danville High Schools Ned Whitesell Field, located at 202 East Fairchild Street, Danville.',NULL,3,NULL,0,'','',0,'1970-01-01',''),(11,'Pekin Dragon Classic','2008-09-20',2008,'Pekin, IL','Karli Skelton','http://www.pekinhigh.net/band/index.html','This is the 25th annual Pekin Dragon Classic.  Class awards will be awarded as well as a Grand Champion.',NULL,26,NULL,0,'','',0,'1970-01-01',''),(12,'Red & Black Fall Classic','2008-09-20',2008,'Machesney Park, IL','Rick Valenzuela','http://www.regiment.org/bandfest/','The sixth annual Phantom Regiment Fall Marching Band Festival attracts some of the finest marching bands in Illinois, Wisconsin and Iowa. Sponsored by King Ultimate Series Marching Brass and held in partnership with the Harlem High School Marching Band, this festival is designed to give high school students a positive place to perform, compete and be rewarded for their efforts. Along with different classes based on band size, there is a non-competitive festival class. Even if your band does not march a field show, there\\\'s still a place for you to perform here! We want to give every school and their ensemble a chance to perform. Following their performance, a band will attend an instant feedback session with commentary from a major DCI show designer.  Bands will get tips and comments while watching a replay on the big screen.','',43,NULL,0,'','',0,'2012-03-12','dbalash'),(13,'Pontiac Indian Showdown','2008-09-20',2008,'Pontiac, IL','Scot Schickel','http://www.pontiac.k12.il.us/academics/music/IndianShowdown2008.htm','For the 5th  Annual Indian Showdown, 16 Bands compete in this evening show starting around 5:00 PM. In the afternoon, bands meet with non-judge clinicians. Bands are divided by band size.',NULL,45,NULL,0,'','',0,'1970-01-01',''),(14,'Tiger Ambush Classic','2008-09-20',2008,'Edwardsville, IL','Marvin Battle','http://www.ecusd7.org/ehs/ehsstaff/mbattle/TAC_index.htm','The Tiger Ambush Classic is an afternoon/evening contest open to any band that applies.  Bands are divided into three classes by band size and compete for awards in Outstanding Winds, Percussion, Auxiliary, Drum Major, and Grand Champion.  Judging is based on sheets designed by the Mid-America Marching Consortium.',NULL,84,NULL,0,'Crowd Appeal: Salem','',0,'1970-01-01',''),(15,'Super City Sounds','2008-09-20',2008,'Metropolis, IL','Chris Hayden','http://www.mchs1.massac.k12.il.us/','Massac County High School hosts the 3rd annual Super City Sounds marching band contest. Unlike other band competitions, this one pays you to compete! All participating bands will receive $200 and the Grand Champion band will receive $1,000. ',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(16,'Wheaton North Falcon Marching Band Festival','2008-09-20',2008,'Wheaton, IL','Jon Noworyta','http://www.wnband.org/news/Festival.php',' The Awards Ceremony will begin at approximately 9:00 PM. Trophies will be presented for first, second, and third place in Classes A, AA, and AAA.\r\n\r\nOverall caption awards presented for the event will include:\r\n\r\n    * Outstanding Visual Performance\r\n    * Outstanding Musical Performance\r\n    * Outstanding General Effect\r\n    * Outstanding Percussion.\r\n',NULL,29,NULL,0,'','',0,'1970-01-01',''),(17,'A.A. Stagg Jamboree','2008-10-25',2008,'Palos Hills, IL','Jeffery Daeschler','www.staggmusic.org','The Stagg Marching Band Jamboree is proud to celebrate its 30th year. Bands are classified in three class sizes, A, AA, and AAA, based on the number of playing musicians. Bands of America scoring sheets are utilized by a panel of 10 caption judges. 1st, 2nd, and 3rd place awards are given to each class and an overall Grand Champion is also awarded to the highest scoring band. Individual awards are given for outstanding percussion, auxiliary, visual effect, and music. ',NULL,22,NULL,0,'','',0,'1970-01-01',''),(18,'Geneseo Maple Leaf Classic','2008-09-27',2008,'Geneseo, IL','Steve Scherer','http://www.dist228.org/index.php?page=hs/student_activities/index.html#Band','Educational format. Each band will receive a one hour clinic from an expert adjudicator with cross-caption expertise. After the clinics, the individual sections of the participating bands will receive master classes administered by the complete sections of our guest band, The Western Illinois University Marching Leathernecks. The competition is in the evening under the lights.',NULL,53,NULL,0,'','',0,'1970-01-01',''),(19,'Lincoln-Way Invitational ','2008-09-27',2008,'New Lenox, IL','Eric Wellman','http://www.lw210.org/StaffPages/ewellman/index.html','This year\\\'s event will be held at Lincoln-Way Central High School. Schools will be classified according to band size with awards in each class consisting of Outstanding Musical Performance, Outstanding Visual Performance, Outstanding General Effect, Outstanding Percussion and Outstanding Auxiliary.','',26,NULL,0,'','',0,'2013-01-29','dbalash'),(20,'Sparta Rotary Homefest','2008-09-27',2008,'Sparta, IL','Neil Schoeneberg','none available','Sparta Rotary Homefest is a co-sponsored event with the Sparta Marching Bulldogs.  This is an afternoon parade that starts and ends at the Turf Contest Field.  Bands are divided into three classes by school size and compete for awards in both the parade and field components.  Awards include 3 placements in captions for, Music, Marching Auxiliary, Percussion, Music Effect, Visual Effect.\r\n\r\nWe also offer on field critique by each caption judge following the band performance on the contest field.  This has been a positive reinforcement for the students.  Combined score from parade and contest to determine Grand Champion, Special Award given for outstanding soloist regardless of class.  Jr. High class for parade bands judged in same above captions with awards for each. ',NULL,11,NULL,0,'','',0,'1970-01-01',''),(21,'WIU Marching Band Classic','2008-09-27',2008,'Macomb, IL','Douglas Phillips','http://www.wiu.edu/bands/events/athletic/classic/index.jsp','The 27th annual Western Illinois University Marching Band Classic will feature 11 of the finest west-central and central Illinois high school bands in field competition on the WIU-Macomb campus.  The classic kicks off with the National Anthem at 4 PM on Hanson Field; the awards ceremony is scheduled for 8:10 PM.  In between there will be field competition in a two division championship format:  small school (Classes 1A, 2A) and large school (Classes 3A, 4A).  Overall champion trophies will be awarded in each division and to the top three bands in each class.  The best drum major(s), percussion, winds and auxiliaries in each division also will receive trophies.',NULL,60,NULL,0,'Small Division Grand Champion: Macomb','',0,'1970-01-01',''),(659,'Bands of America Regional Championships: Indianapolis, IN','2008-11-08',2008,'Indianapolis, IN','Bands of America','http://www.musicforall.org','A Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\n','',NULL,'Lawrence Central, IN',0,'','500 South Capitol Avenue, Indianapolis, IN 46225',0,'2014-11-29','clarinetdude124'),(24,'St. Rita Mustang Stampede','2008-09-28',2008,'Chicago, IL','Cindy Gradek','http://stritahs.com/band-mustangstampede.htm','The Mustang Stampede is a marching band competition that is sponsored by the St. Rita High School Band and its Boosters.  Over the years this competition has grown in size to accommodate over 20 of the areas finest bands.',NULL,66,NULL,0,'','',0,'1970-01-01',''),(25,'Marching Maroon Marching Festival','2008-10-04',2008,'Robinson, IL','Joe Smith','http://www.rhsmarchingmaroons.com/','Robinson hosts the Marching Maroon Festival.  Awards given for excellence in class, plus Grand Champion.',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(26,'McKendree Preview of Champions','2008-10-04',2008,'Lebanon, IL','Lester McQuaid','http://www.mckendree.edu/Department_of_Music/Preview_of_Champions.aspx/','Bands will compete on a lighted, Game Day turf field, in classes based on number of instrumentalists.  Awards are given for 1st, 2nd, and 3rd place in each class and a Grand Champion Award. Caption awards for Outstanding Percussion, Color Guard, Music, and Visual are also given in each class. After each bands performance there will be a video review and clinician comments.',NULL,84,NULL,0,'This was a United States Scholastic Band Association Show (USSBA).\r\n\r\nEspirit de Corps: Belleville East','',0,'1970-01-01',''),(27,'Naperville Central Marching Classic','2008-10-04',2008,'Lisle, IL','David Alstadt','http://www.nchsbands.info/specialEvents/marchingClassic08.html','Shows are scored on a modified system, with class placements, and a grand champion named.',NULL,25,NULL,0,'','',0,'1970-01-01',''),(28,'Prospect Knight of Champions','2008-10-04',2008,'Mt. Prospect, IL','Chris Barnum','http://www.prospectband.com/koc.html','The Prospect High School Band Boosters will be sponsoring the Knight of Champions marching band competition on Saturday, October 4, 2008 at Prospect High School, 801 W. Kensington, Mount Prospect, IL. Bands will compete in three classes: A (up to 64 members), AA (65 to 96 members), and AAA (97 or more members).  Awards presented will include first, second, and third place in Class A, AA, and AAA.  Additional awards for Outstanding Percussion, Outstanding Auxiliary, Outstanding Music, Outstanding Visual and outstanding General Effect will be given to each class.  Participation awards will be presented to all bands that perform.  There will be caption-specific commentary and scoring, and an overall Grand Champion Traveling trophy.  We will be utilizing a scoring system similar to Bands of America.',NULL,22,NULL,0,'','',0,'1970-01-01',''),(29,'Sage City Invitational','2008-10-04',2008,'Monticello, IL','Jim Holmes','none available','The 7th Annual Sage City Invitational is an early afternoon contest and is organized by school size.  There are four classes C/D 1-350, B 351-700, A 701-1000, AA 1001 +.  1st, 2nd, 3rd place trophies are awarded in each class with caption trophies for drum major, percussion, color guard, and best winds captions.',NULL,23,NULL,0,'','',0,'1970-01-01',''),(30,'Washington Marching Panther Invitational','2008-10-04',2008,'Washington, IL','Jim Tallman','http://www.wchsband.org/id122.html','The 2008 Marching Panther Invitational (our 22nd Anniversary!!!) is a high school parade and field marching competition.  Bands will be grouped into classes based on band size and school size. This will be an afternoon / evening event!<br />\r\n <br />\r\nTrophies and plaques will be given for outstanding Drum Majors, Color Guard, Drumlines and Bands in each class for the Parade and Field Competitions','',35,NULL,0,'Overall Percussion 1A/2A: Eureka\r\nOverall Percussion 3A/4A: Normal Community','',0,'2012-03-28','dbalash'),(31,'Atwood-Hammond Rajah Invitational','2008-10-11',2008,'Atwood, IL','Shana Gatewood','http://home.mchsi.com/~kgarrett89/Atwoodbandcontest.html','The Atwood-Hammond Marching Rajahs host this afternoon/evening field and parade competition. This is the premier event to raise funds for the music programs at Atwood-Hammond.',NULL,23,NULL,0,'','',0,'1970-01-01',''),(32,'Metamora Band Invitational','2008-10-11',2008,'Metamora, IL','Wally Parks','none available','The 28th annual running of this contest features a great stadium for marching bands, and excellent well-rounded panel of adjudicators, and wonderful festival atmosphere throughout the day. The competition is one of the largest and oldest, continuous running, high school-sponsored competition in the state of Illinois. Attendees are usually drawn from Illinois, eastern Iowa, and western Indiana. Gary Smith, the former University of Illinois marching director will provide a complete overview of each band\'s performance. Bands receive a DVD of their performance along with adjudicator tapes. The parade begins about 2:00 PM followed by the field show at 3:30 PM with awards at around 10:00 PM. Judging sheets are similar to BOA.','',59,NULL,0,'','',0,'2014-01-26','dbalash'),(33,'Effingham Marching Hearts Invitational','2008-10-18',2008,'Effingham, IL','Brad Wallace','http://www.effingham.k12.il.us/ehs/ACADEMIC/finearts/band/Pages/main.htm','The Effingham Marching Hearts Invitational is an afternoon competition set to begin at 2:00pm, allowing bands to also attend the Newton Marching Eagles Band Classis which is a morning competition.',NULL,84,NULL,0,'','',0,'1970-01-01',''),(34,'Mahomet-Seymour Marching Bulldog Festival','2008-10-18',2008,'Mahomet, IL','Michael Stevens','http://www.ms.k12.il.us/mshs/music/index.html','Mahomet-Seymour hosts this annual festival.  Awards given for class and grand champion.',NULL,9,NULL,0,'','',0,'1970-01-01',''),(35,'Downers Grove South Marching Mustang Music Bowl','2008-10-18',2008,'Downers Grove, IL','Ron Hornish','http://www.dgsmusicbowl.com/','2008 marks the 7th annual DGS Marching Mustang Music Bowl.  Bands compete in three categories (A, AA, AAA) based on band size and the YIM (Youth In Music) scoring system will be utilized. The scoring is 40% Music, 40% Visual, 10% Percussion, 10% Guard. First, second and third place awards will be presented in each class.  In addition, the following caption awards will be presented in each class: Outstanding Music Performance, Outstanding Visual Performance, Outstanding Percussion, Outstanding Auxiliary, Outstanding Drum Major.  In addition, a Grand Champion Trophy will be presented to the highest scoring band, regardless of class.',NULL,19,NULL,0,'','',0,'1970-01-01',''),(36,'Newton Marching Eagles Band Classic','2008-10-18',2008,'Newton, IL','Deb Albertus','none available','The Newton Marching Eagle Band Boosters, along with Director Deb Alburtus and Assistant Director Brian Ridlen invite you to participate at our 2008 Marching Eagles Band Classic.\r\n\r\nThe morning of Saturday, October 18th will begin our competition.  The Effingham Marching Hearts Invitational is set to begin at 2:00pm that same day. Effingham is approximately 30 miles west of Newton. What a great way to get two shows in, in one day!!! Please mark your calendars now to join us!! Bands will be classified based on school size. We will accommodate your schedule so that your band can compete at both shows.',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(37,'Quincy Octoberfest Parade and Field Show','2008-10-18',2008,'Quincy, IL','Kathleen Dooley','none available','Celebrating its 13th year, this contest features a parade and field show competition with the parade competition beginning at 2 p.m. and the field show competition at 5:15. The competition is open to all bands from any class or status from any state. Bands will be divided into three classes by school size. Awards will be given for placement as well as various captions including percussion, drum major, auxiliaries, etc. ',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(38,'Rich Central\'s Marching Band and Drumline Festival','2008-10-18',2008,'Olympia Fields, IL','Philip Crews','none available','Please join us for our 4th annual Marching Band and Drumline Festival. Rich Central proudly presents the best field show competition in the south suburbs. We feature both show bands and corps-style marching. Classes are based upon band size. Awards will be given in all captions along with Grand Champion trophies for overall and each marching style. Our drumline competition has no rivals. The fun begins at 4:00pm and ends at 9:00pm. The awards are given at 9:15pm.',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(656,'Bands of America Regional Championships: Centerville, OH','2008-09-20',2008,'Centerville, OH','Bands of America','http://www.musicforall.org','A Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','',NULL,'Centerville, OH',0,'','500 E Franklin St, Dayton, OH 45459',0,'2014-11-26','clarinetdude124'),(40,'Illinois Marching Band Championships Large Schools','2008-10-25',2008,'Champaign, IL','Dr. Peter Griffin','http://www.music.uiuc.edu/outreach/imbf/imbf.html','The annual Illini Marching Band Festival pits some of the best Illinois band in a parade and field competition.','',36,NULL,0,'','',0,'2014-10-07','dbalash'),(41,'Illinois Marching Band Championships Small Schools','2008-10-25',2008,'Champaign, IL','Dr. Peter Griffin','http://www.music.uiuc.edu/outreach/imbf/imbf.html','The annual Illini Marching Band Festival pits some of the best Illinois marching bands in a parade and field format.','',13,NULL,0,'','',0,'2014-10-07','dbalash'),(42,'Oblong Spooktacular','2008-10-25',2008,'Oblong, IL','Karen Davis','www.oblongmusicboosters.com','In 2008, the festival will be celebrating its 14th anniversary. It features both a field show and a parade competition. A drumline showcase is held prior to the evening parade and the parade also includes a Junior High division. ',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(43,'Pinckneyville Mardi Gras Field Show and Parade','2008-10-25',2008,'Pinckneyville, IL','Stephen Cannedy','http://web.mac.com/scannedy1/iWeb/scannedy1/Mardi%20Gras.html','The field show contest begins around 1:30 or 2:00 in the afternoon at the High School Football field.  Our average number of bands runs around 10-12 and we use 2 or 3 classes depending on how many bands we have. The cost for entering the field show is $100.00. The parade is at night beginning at 7:00 pm.  It is a huge crowd of people and with the event being close to Halloween, there are many dressed up people throughout the parade.  Awards are held after the parade at the fairgrounds.  We have a $500 grand champion award to the band with the highest combined score of parade and field.  In addition all parade bands get a check for $100 and we also have a $150 prize for the best parade band regardless of class.  $100 for 2nd and $50 additional for 3rd.',NULL,NULL,NULL,0,NULL,'',0,'2011-01-26','dbalash'),(44,'Greater St. Louis Marching Band Festival','2008-10-25',2008,'St. Louis, MO','GSLMBF','http://www.gslmbf.com/','The 37th Annual Greater St. Louis Marching Band Festival provides an opportunity for evaluation of outstanding high school marching bands in a first-class professional venue, the Edward Jones Dome which includes comfortable stadium seating, exhibits and indoor warm-up rooms. Classes are divided by band size. 48 bands maximum (there is a wait list).',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(45,'Youth in Music Marching Band Championship','2008-10-25',2008,'Minneapolis, MN','Brent Turner','http://www.youthinmusic.org/','Youth in Music would like to invite you to participate in the 2nd Annual Marching Band Championship at the Hubert H. Humphrey Metrodome. This championship event will be adjudicated by a national level juding panal, and is open to any high school marching band. Grouped can participate in one of four classes: A, AA, AAA and Exhibition.\r\n\r\nOur goal is to provide your students with a first-rate performance experience! All bands will receive critique from a qualified panel of national level judges and educators, as well as a videocassette of their performance.',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(657,'Bands of America Regional Championships: Massillon, OH','2008-09-27',2008,'Massillon, OH','Bands of America','www.musicforall.org','','',NULL,'Harrison, GA',0,'','1 Paul E Brown Dr SE, Massillon, OH 44646',0,'2014-11-26','clarinetdude124'),(658,'Bands of America Super Regional Championships: St. Louis, MO','2008-10-17',2008,'St. Louis, MO','Bands of America','http://www.musicforall.org','A 2 day Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','',NULL,'Broken Arrow, OK',0,'','701 Convention Plaza, St. Louis, MO 63101',0,'2014-11-29','clarinetdude124'),(48,'Mozingo Marching Percussion Competition','2008-09-06',2008,'St. Charles, MO','Jeremy Miller','http://mozingomusic.com/content/view/116/135/',' 	\r\nMozingo Drumline Festival \r\nSaint Charles, Missouri\r\nSeptember 6, 2008\r\n\r\nThis is the 19th Annual Marching Percussion Competition.  It will be held at Francis Howell High School in St. Louis. This show features ensemble and solo competition for percussionists. Full drumlines compete in divisions (defined by line experience) for placement and caption awards. Soloists compete for placement awards for each type of percussion instrument.',NULL,31,NULL,0,'Cymbals-- Rockwood Summit, MO\r\nFront Ensemble-- Francis Howell North, MO\r\nBass line-- Marquette, MO\r\nTenors-- O\'fallon\r\nSnares-- O\'fallon','',0,'1970-01-01',''),(49,'Hoopeston Cornjerker Invitational','2008-09-13',2008,'Hoopeston, IL','Wendy Ronna','none available','The Hoopeston Cornjerker Invitational is an early season small event that is bound to be exciting and fun for all.',NULL,96,NULL,0,'','',0,'1970-01-01',''),(50,'Morton Marching Invitational','2007-09-15',2007,'Morton, IL','Jeff Neavor','http://www.mortonbands.org/marching/pumpkinfest.php','This 2nd Annual parade and field festival held during the City of Morton Pumpkin Festival is divided into classes by band size and judged using Bands of America sheets.','',8,NULL,0,'Caption Grand Champions:\r\n\r\nDrum Majors: Thornwood\r\nAuxiliary: Bloomington \r\n