ated at 202 East Fairchild Street, Danville.',NULL,81,NULL,0,'','',0,'1970-01-01',''),(70,'Prospect Knight of Champions','2007-10-06',2007,'Mt. Prospect, IL','Chris Barnum','www.prospectband.com/koc.html','Bands will compete in three classes: A (up to 56 members), AA (up to 96 members), and AAA (over 96 members). Awards presented will include first, second, and third place in Class A, AA, and AAA.  Additional awards for Outstanding Percussion, Outstanding Auxiliary, Outstanding Drum Majors, Outstanding Music, and Outstanding Movement will be given to each class.  Participation awards will be presented to all bands that perform.  There will be caption-specific commentary and scoring, and an overall Grand Champion Traveling trophy.  We will be utilizing a scoring system similar to Bands of America. ',NULL,22,NULL,0,'','',0,'1970-01-01',''),(73,'Marengo Settlers Days','2007-10-07',2007,'Marengo, IL','Marengo HS','www.ilmarching.com','This parade and field show at Marengo HS was host to some of the better bands in Illinois.',NULL,66,NULL,0,'','',0,'2011-01-23','dbalash'),(74,'Illinois Marching Band Championships Large Schools','2007-10-13',2007,'Champaign, IL','Peter Griffin','http://www.music.uiuc.edu/outreach/imbf.html','The annual Illini Marching Band Festival pits some of the best Illinois band in a parade and field competition.','',36,NULL,0,'Grand Champion Field: Prospect\r\n\r\nGrand Champion Parade: Prospect\r\n\r\nOverall Percussion: Prospect','',0,'2014-10-07','dbalash'),(75,'Illinois Marching Band Championships Small Schools','2007-10-13',2007,'Champaign, IL','Peter Griffin','http://www.music.uiuc.edu/outreach/imbf.html','The annual Illini Marching Band Festival pits some of the best Illinois band in a parade and field competition.','',57,NULL,0,'Grand Champion Parade: Macomb\r\n\r\nGrand Champion Field: Macomb\r\n\r\nOverall Percussion: Mater Dei','',0,'2014-10-07','dbalash'),(76,'Lincoln-Way Invitational','2007-10-13',2007,'Frankfort, IL','Bert Johnson','ht