ac.com/scannedy1/','The Pinckneyville \\\"Mardi Gras\\\" is a homecoming type town celebration. We have a full day of activities in Pinckneyville.  There is a flea market uptown all morning with many events.  The field show contest begins around 1:30 or 2:00 in the afternoon at the High School Football field.  Our average number of bands runs around 10-12 and we use 2 or 3 classes depending on how many bands we have. The cost for entering the field show is $100.00. The parade is at night beginning at 7:00 pm.  It is a huge crowd of people and with the event being close to Halloween, there are many dressed up people throughout the parade.  Awards are held after the parade at the fairgrounds.  We have a $500 grand champion award to the band with the highest combined score of parade and field.  In addition all parade bands get a check for $100 and we also have a $150 prize for the best parade band regardless of class.  $100 for 2nd and $50 additional for 3rd.',NULL,2,NULL,0,'','',0,'1970-01-01',''),(82,'Metro East Marching Classic','2007-09-15',2007,'O\'Fallon, IL','Terry Martinez','http://www.othsband.com/','The Metro East Marching Classic is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by school size and compete for awards in Outstanding Winds, Percussion, and Auxiliary, along the crowning of a Grand Champion. Judging is based on sheets designed by the Mid-America Marching Consortium. Attendees of the Belleville East Marching Invitational would be able to attend this contest as well.',NULL,NULL,'Jefferson City, MO',0,'','',0,'1970-01-01',''),(83,'Sandwich Musicfest','2007-10-13',2007,'Sandwich, IL','ILmarching','www.ilmarching.com','This show had a field and parade format, and it pitted some good bands against one another.','',38,NULL,0,'','',0,'2013-02-05','dbalash'),(84,'Belleville East Marching Invitational','2006-09-16',2006,'Belleville, IL','Mark Tessereau','www.lancerbands.org','The Belleville East High School