ro, IL','Michael Moreland','www.crimsonexpress.com','Originally begun as a Drum and Bugle Corps show, the Murphysboro Drums at Appletime competition is a premier competition hosting bands from Illinois, Missouri, Indiana, Kentucky, and Iowa consistently drawing around 5,000 spectators. In an effort to be responsive to the needs of bands early in the season the show features a critique and review session for band directors and their staff with the judges immediately following the competition. A Grand Champion is crowned combining the parade and field show scores.',NULL,119,NULL,0,'Parade scores not available.','',0,'2010-08-19','moverholt'),(644,'Bands of America Grand National Championships','2005-11-10',2005,'Indianapolis, IN','Bands of America','http://www.musicforall.org','This is the premier marching band event of the season. 90 of the nation\'s best marching bands compete in Indianapolis at the Lucas Oil Stadium in a prelims/semifinals/finals event. Bands are arranged by school size in prelims and semifinals, and class champions are awarded in A, AA, AAA, and AAAA. The 12 top bands move on to finals, and they compete head to head for the prestigious Grand Nationals trophy.','',NULL,'Carmel, IN',0,'','500 South Capitol Avenue, Indianapolis, IN 46225',0,'2014-11-03','clarinetdude124'),(113,'Illinois State University Invitational Marching Championships','2009-10-24',2009,'Normal, IL','ISU Bands','http://www.bands.ilstu.edu/events/marching_band.shtml','ISU hosts the annual State of Illinois Marching Band Invitational, which pits some of the best bands in Illinois in a prelims/finals format.','',25,NULL,0,'','',1,'2012-10-21','moverholt'),(114,'Lake Park Lancer Joust','2009-09-12',2009,'Roselle, IL','Mike Chiodo','http://lancerjoust.com/','The Annual Lancer Joust will feature bands from Indiana, Iowa, Wisconsin and Illinois. The competition is an afternnon/evening event in preliminary and final competition format. Preliminary competition is in Class by band size.',NULL,22,NULL,0,'','',1,'1970-01-01',''),(115,'Murphysboro Drums at Appletime','2009-09-19',2009,'Murphysboro, IL','Michael Moreland','http://www.crimsonexpress.com/drums_at_appletime_09/index.html','Originally begun as a Drum and Bugle Corps show, the Murphysboro Drums at Appletime competition is a premier competition hosting bands from Illinois, Missouri, Indiana, Kentucky, and Iowa consistently drawing around 5,000 spectators. In an effort to be responsive to the needs of bands early in the season the show features a critique and review session for band directors and their staff with the judges immediately following the competition. A Grand Champion is crowned combining the parade and field show scores.',NULL,119,NULL,0,'','',0,'1970-01-01',''),(116,'Metro East Marching Classic','2009-09-12',2009,'O\'Fallon, IL','Melissa Gustafson-Hinds','http://www.othsband.com/index.php?pagekey=metroeast','The Metro East Marching Classic (MEMC!) presented by the OFallon Township High School Band Boosters is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by school size and compete for awards in Outstanding Winds, Percussion, and Auxiliary, along with the crowning of a Grand Champion.',NULL,84,NULL,0,'','',0,'1970-01-01',''),(117,'Tiger Ambush Classic','2009-09-19',2009,'Edwardsville, IL','Marvin Battle','http://www.ecusd7.org/ehs/ehsstaff/mbattle/TAC_index.htm','The Tiger Ambush Classic is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by band size and compete for awards in Outstanding Winds, Percussion, Auxiliary, Drum Major, and Grand Champion. Judging is based on sheets designed by the Mid-America Marching Consortium.',NULL,NULL,'Blue Springs, MO',0,'','',0,'1970-01-01',''),(118,'Chicagoland Marching Band Festival','2009-09-26',2009,'Wheeling, IL','Brian Logan','http://wheelingbands.org/','The Chicagoland Marching Band Festival (CMBF) hosted by Wheeling High School is Chicago\'s longest running marching band festival and is now celebrating its 42nd year.',NULL,29,NULL,0,'','',0,'1970-01-01',''),(119,'Wheaton North Falcon Marching Band Festival','2009-09-26',2009,'Wheaton, IL','Jon Noworyta','http://www.wnband.org/news/Festival.php','Trophies will be presented for first, second, and third place in Classes A, AA, and AAA. Overall caption awards presented for the event will include: * Outstanding Visual Performance * Outstanding Musical Performance * Outstanding General Effect * Outstanding Percussion. ',NULL,25,NULL,0,'','',0,'1970-01-01',''),(120,'Downers Grove South Marching Mustang Music Bowl','2009-10-17',2009,'Downers Grove, IL','Craig Roselieb','http://www.dgsmusicbowl.com/','2009 marks the 8th annual DGS Marching Mustang Music Bowl. Bands compete in three categories (A, AA, AAA) based on band size and the YIM (Youth In Music) scoring system will be utilized. The scoring is 40% Music, 40% Visual, 10% Percussion, 10% Guard. First, second and third place awards will be presented in each class. In addition, the following caption awards will be presented in each class: Outstanding Music Performance, Outstanding Visual Performance, Outstanding Percussion, Outstanding Auxiliary, Outstanding Drum Major. In addition, a Grand Champion Trophy will be presented to the highest scoring band, regardless of class.',NULL,19,NULL,0,'Standstill performances inside the gym.','',0,'1970-01-01',''),(121,'Mt. Zion Marching Music Games','2009-09-19',2009,'Mt. Zion, IL','Tim Page','http://www.mtzionbands.com/marchinggames.htm/','Mt. Zion Marching Braves presents the 6th Annual Marching Music Games. Highlights of the contest include excellent judges and critique, an afternoon parade and evening field competition under the lights, conveniently located warm-up fields, hospitality rooms and free meals for directors and staff, great concessions and competition based on band size. 1st, 2nd, 3rd place trophies in each class in parade and field show. Best in class trophies in each class in parade and field show (Best Drum Major, Best Drum Line, Best Auxiliary), Grand Champion regardless of class.',NULL,81,NULL,0,'','',0,'1970-01-01',''),(122,'Lincoln-Way Invitational','2009-10-10',2009,'Frankfort, IL','Clifton Smith','http://www.lwemusic.org','This year\\\'s event will be held at Lincoln-Way East High School. Schools will be classified according to band size with awards in each class consisting of Outstanding Musical Performance, Outstanding Visual Performance, Outstanding General Effect, Outstanding Percussion and Outstanding Auxiliary.','',25,'',0,'','',0,'2013-01-29','dbalash'),(123,'Effingham Marching Hearts Invitational','2009-10-10',2009,'Effingham, IL','Brad Wallace','http://www.effinghamband.org','The Effingham Marching Hearts Invitational is an afternoon competition set to begin at 2:00pm, allowing bands to also attend the Newton Marching Eagles Band Classic which is a morning competition.  For more information, email Brad Wallace at wallaceb@effingham.k12.il.us',NULL,11,NULL,0,'','',0,'1970-01-01',''),(124,'Prospect Knight of Champions','2009-10-03',2009,'Mt. Prospect, IL','Chris Barnum','http://www.prospectband.com/koc.html','The Prospect High School Band Boosters will be sponsoring the Knight of Champions marching band competition on Saturday, October 3, 2009 at Prospect High School. Bands will compete in three classes: A (up to 64 members), AA (65 to 96 members), and AAA (97 or more members). Awards presented will include first, second, and third place in Class A, AA, and AAA. Additional awards for Outstanding Percussion, Outstanding Auxiliary, Outstanding Music, Outstanding Visual and outstanding General Effect will be given to each class. Participation awards will be presented to all bands that perform. There will be caption-specific commentary and scoring, and an overall Grand Champion Traveling trophy. We will be utilizing a scoring system similar to Bands of America.',NULL,NULL,'N/A',0,'Class A/AA were field performances and scored out of 100 points, and Class AAA was indoors standstill, and scored out of 60.','',0,'1970-01-01',''),(125,'Pontiac Indian Showdown','2009-09-26',2009,'Pontiac, IL','Scott Schickel','http://www.pontiac.k12.il.us/academics/music/IndianShowdown2008.htm','Fifteen bands will be competing in the 7th Annual Indian Showdown. Clinics begin at 1:00pm and the competition at 5:00pm.',NULL,45,NULL,0,'','',0,'1970-01-01',''),(126,'St. Rita Mustang Stampede','2009-09-27',2009,'Chicago, IL','Cindy Gradek','http://stritahs.com/band/index.html','The Mustang Stampede is a marching band competition that is sponsored by the St. Rita High School Band and its Boosters. Over the years this competition has grown in size to accommodate over 20 of the areas finest bands.',NULL,136,NULL,0,'','',0,'1970-01-01',''),(127,'Morton Marching Invitational','2009-09-19',2009,'Morton, IL','Jeff Neavor','http://www.mortonbands.org/marching/pumpkinfest.php','The field show competition, hosted by Morton High School, is held during the City of Morton Pumpkin Festival.','',21,NULL,0,'Grand Champion Winds: Lincoln-Way Central\r\nGrand Champion Percussion: United Township/Lincoln-Way Central (TIE)\r\nGrand Champion Auxiliary: Lincoln-Way North\r\nGrand Champion Drum Majors: United Township','350 N. Illinois St., Morton, IL 61550',0,'2014-01-14','dbalash'),(128,'McKendree Preview of Champions','2009-10-03',2009,'Lebanon, IL','Lester McQuaid','http://www.mckendree.edu/Department_of_Music/Preview_of_Champions.aspx/','Bands will compete on a lighted, Game Day turf field, in classes based on number of instrumentalists. Awards are given for 1st, 2nd, and 3rd place in each class and a Grand Champion Award. Caption awards for Outstanding Percussion, Color Guard, Music, and Visual are also given in each class. After each bands performance there will be a video review and clinician comments.',NULL,27,NULL,0,'','',0,'1970-01-01',''),(129,'Illinois Marching Band Championships Large Schools','2009-10-17',2009,'Champaign, IL','Dr. Peter Griffin','http://www.music.uiuc.edu/outreach/imbf/imbf.html','The annual Illini Marching Band Festival pits some of the best Illinois band in a parade and field competition.','',106,NULL,0,'<b>Governor\'s Trophy</b>\r\n363 John Hersey\r\n355.4999 Prospect\r\n325.3001 Mahomet Seymour\r\n322.7499 Limestone\r\n311.4999 Bloomington\r\n304.3499 Washington\r\n300.0001 Dunlap\r\n290.7501 Galesburg\r\n267.2999 Streator\r\n261.0001 Alan B. Shepard\r\n254.4999 Champaign Centennial\r\n227.9999 Carl Sandburg\r\n215.0001 Elk Grove\r\n195.4999 Mattoon','',0,'2014-10-07','dbalash'),(130,'Illinois Marching Band Championships Small Schools','2009-10-17',2009,'Champaign, IL','Dr. Peter Griffin','http://www.music.uiuc.edu/outreach/imbf/imbf.html','The annual Illini Marching Band Festival pits some of the best Illinois band in a parade and field competition.','',57,NULL,0,'<b>Governor\'s Trophy</b>\r\n364.95 Macomb\r\n319.70 IVC\r\n318.2501 ROWVA\r\n317.25 Monticello\r\n306.9999 Prairie Central\r\n306.9001 Tri-Valley\r\n287.7499 Newton\r\n278.9999 Pickneyville\r\n255.9999 Paris ','',0,'2014-10-07','dbalash'),(131,'Naperville Central Marching Classic','2009-10-17',2009,'Lisle, IL','David Alstadt','http://www.nchsbands.info/specialEvents/marchingClassic09.html','Shows are scored on a modified system, with class placements, and a grand champion named.',NULL,40,NULL,0,'','',0,'1970-01-01',''),(132,'Pinckneyville Mardi Gras Field Show and Parade','2009-10-31',2009,'Pinckneyville, IL','Stephen Cannedy','http://web.mac.com/scannedy1/iWeb/scannedy1/Mardi%20Gras.html','The Pinckneyville \\\"Mardi Gras\\\" is a homecoming type town celebration. We have a full day of activities in Pinckneyville.  There is a flea market uptown all morning with many events.  The field show contest begins around 1:30 or 2:00 in the afternoon at the High School Football field.  Our average number of bands runs around 10-12 and we use 2 or 3 classes depending on how many bands we have. The cost for entering the field show is $100.00. The parade is at night beginning at 7:00 pm.  It is a huge crowd of people and with the event being close to Halloween, there are many dressed up people throughout the parade.  Awards are held after the parade at the fairgrounds.  We have a $500 grand champion award to the band with the highest combined score of parade and field.  In addition all parade bands get a check for $100 and we also have a $150 prize for the best parade band regardless of class.  $100 for 2nd and $50 additional for 3rd.',NULL,2,NULL,0,'','',0,'1970-01-01',''),(133,'Bands of America Grand National Championships','2009-11-12',2009,'Indianapolis, IN','Bands of America','http://www.musicforall.org','This is the premier marching band event of the season. 90 of the nation\'s best marching bands compete in Indianapolis at the Lucas Oil Stadium in a prelims/semifinals/finals event. Bands are arranged by school size in prelims and semifinals, and class champions are awarded in A, AA, AAA. The 12 top bands move on to finals, and they compete head to head for the Grand Nationals trophy.',NULL,NULL,'Avon, IN',0,'In the event of a tie, rank is determined based on the highest GE score.','',0,'1970-01-01',''),(134,'Washington Marching Panther Invitational','2009-09-12',2009,'Washington, IL','Jim Tallman','http://www.wchsband.org/id133.html','The 2009 Marching Panther Invitational  is a high school parade and field marching competition. Bands will be grouped into classes based on band size and school size. This will be an afternoon / evening event! Trophies and plaques will be given for outstanding Drum Majors, Color Guard, Drumlines and Bands in each class for the Parade and Field Competitions','',35,NULL,0,'Overall Percussion:\r\nA/2A: Metamora\r\n3A/4A: Limestone','',0,'2012-03-28','dbalash'),(661,'Bands of America Regional Championships: Centerville, OH','2009-10-03',2009,'Centerville, OH','Bands of America','http://www.musicforall.org','A Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','',NULL,'Carmel, IN',0,'','500 E Franklin St, Dayton, OH 45459',0,'2014-11-29','clarinetdude124'),(662,'Bands of America Regional Championships: Ypsilanti, MI','2009-10-10',2009,'Ypsilanti, MI','Bands of America','www.musicforall.org','','',NULL,'Lawrence Central, IN',0,'','799 N Hewitt Rd, Ypsilanti, MI 48197',0,'2014-11-29','clarinetdude124'),(663,'Bands of America Super Regional Championships: St. Louis, MO','2009-10-16',2009,'St. Louis, MO','Bands of America','http://www.musicforall.org','A 2 day Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','',NULL,'Broken Arrow, OK',0,'','701 Convention Plaza, St. Louis, MO 63101',0,'2014-11-29','clarinetdude124'),(664,'Bands of America Regional Championships: Indianapolis, IN','2009-11-07',2009,'Indianapolis, IN','Bands of America','http://www.musicforall.org','A Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\n','',NULL,'Avon, IN',0,'','500 South Capitol Avenue, Indianapolis, IN 46225',0,'2014-11-29','clarinetdude124'),(660,'Bands of America Regional Championships: Louisville, KY','2009-09-26',2009,'Louisville, KY','Bands of America','http://www.musicforall.org','A Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','',NULL,'Carmel, IN',0,'Due to extreme weather conditions, the finals at Louisville, KY were canceled. Scores from prelims have been used to determine finals placement.','2800 S. Floyd St., Louisville, KY 40209',0,'2014-11-29','clarinetdude124'),(141,'Danville Viking Invitational','2009-09-19',2009,'Danville, IL','Brad Leeb','http://www.dhsimb.com/invitational%20main.htm','This is an afternoon/evening contest that divides bands by band size. Bands compete for awards in each division for placement, and captions (Winds, Percussion, Auxiliary, and Drum Major). A Grand Champion for the event is also awarded.',NULL,88,NULL,0,'','',0,'1970-01-01',''),(142,'Youth in Music Preview Cup','2009-09-26',2009,'Minneapolis, Minnesota','Brent Turner','http://www.youthinmusic.org/','Youth in Music would like to invite you to participate in the Youth in Music Preview Cup at the Hubert H. Humphrey Metrodome. This championship event will be adjudicated by a national level juding panal, and is open to any high school marching band. Grouped can participate in one of four classes: A, AA, AAA and Exhibition. Our goal is to provide your students with a first-rate performance experience! All bands will receive critique from a qualified panel of national level judges and educators, as well as a videocassette of their performance.',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(143,'A.A. Stagg Jamboree','2009-10-03',2009,'Palos Hills, IL','Robert Mecozzi','www.staggmusic.org','The Stagg Marching Band Jamboree is proud to celebrate its 30th year. Bands are classified in three class sizes, A, AA, and AAA, based on the number of playing musicians. Bands of America scoring sheets are utilized by a panel of 10 caption judges. 1st, 2nd, and 3rd place awards are given to each class and an overall Grand Champion is also awarded to the highest scoring band. Individual awards are given for outstanding percussion, auxiliary, visual effect, and music. ',NULL,39,NULL,0,'','',0,'1970-01-01',''),(144,'Newton Marching Eagles Band Classic','2009-10-10',2009,'Newton, IL','Deb Albertus','http://www.ilmarching.com','The Newton Marching Eagle Band Boosters, along with Director Deb Alburtus and Assistant Director Brian Ridlen invite you to participate at our 2009 Marching Eagles Band Classic. The morning of Saturday, October 10th will begin our competition. The Effingham Marching Hearts Invitational is set to begin at 2:00pm that same day. Effingham is approximately 30 miles west of Newton. What a great way to get two shows in, in one day!!! Please mark your calendars now to join us!! Bands will be classified based on school size. We will accommodate your schedule so that your band can compete at both shows.',NULL,11,NULL,0,'','',0,'1970-01-01',''),(145,'Greater St. Louis Marching Band Festival','2009-10-24',2009,'St. Louis, Missouri','GSLMBF','http://www.gslmbf.com/','The 38th Annual Greater St. Louis Marching Band Festival provides an opportunity for evaluation of outstanding high school marching bands in a first-class professional venue, the Edward Jones Dome which includes comfortable stadium seating, exhibits and indoor warm-up rooms.',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(146,'Mahomet-Seymour Marching Bulldog Festival','2009-10-24',2009,'Mahomet, IL','Michael Stevens','http://www.ilmarching.com','This show pits some of the best bands in Illinois in a class format, a winner for each class.',NULL,9,NULL,0,'Percussion Grand Champion: A.A. Stagg','',0,'1970-01-01',''),(147,'Belleville East Marching Invitational','2009-09-12',2009,'Belleville, IL','Mark Tessereau','http://www.lancerbands.org/marching_invitational','The Belleville East High School Marching Lancers invite you to attend the annual Belleville East Marching Invitational. Awards include Outstanding Winds, Visual, Percussion, Auxiliary, People\'s Choice, & Grand Champion. Bands are classified by instrumentation size',NULL,NULL,'Rockwood Summit, MO',0,'Leroy Kirsch Award-Granite City','',0,'1970-01-01',''),(148,'Metamora Band Invitational','2009-10-10',2009,'Metamora, IL','Wally Parks','www.ilmarching.com','The 29th annual running of this contest features a great stadium for marching bands, and excellent well-rounded panel of adjudicators, and wonderful festival atmosphere throughout the day. The competition is one of the largest and oldest, continuous running, high school-sponsored competition in the state of Illinois. Attendees are usually drawn from Illinois, eastern Iowa, and western Indiana. Bands receive a DVD of their performance along with adjudicator tapes. Judging sheets are similar to BOA.','',56,NULL,0,'Limestone - Overall Grand Champions\r\n\r\nGeneseo - 1A/2A Grand Champions ','',0,'2014-01-26','dbalash'),(149,'Atwood-Hammond Rajah Invitational','2009-10-31',2009,'Atwood, IL','Shana Gatewood','http://home.mchsi.com/~kgarrett89/Atwoodbandcontest.html','The Atwood-Hammond Marching Rajahs host this afternoon/evening field and parade competition. This is the premier event to raise funds for the music programs at Atwood-Hammond.',NULL,148,NULL,0,'Parade Grand Champion: Blue Ridge\r\nField Show Grand Champion: Shelbyville','',0,'1970-01-01',''),(150,'Panther Marching Band Festival','2009-09-26',2009,'Charleston, IL','Barry Houser','http://www.eiu.edu/~music/news_events_panther_marching.php','The 33rd Annual Panther Marching Band Festival is an afternoon/evening competition set to begin tentatively at 2:00pm in O\'Brien Stadium on the campus of Eastern Illinois University.',NULL,12,NULL,0,'','',0,'1970-01-01',''),(151,'Red & Black Fall Classic','2009-09-26',2009,'Machesney Park, IL','Rick Valenzuela','http://regiment.org/bandfest/','The seventh annual Phantom Regiment Fall Marching Band Festival attracts some of the finest marching bands in Illinois, Wisconsin and Iowa. Sponsored by King Ultimate Series Marching Brass and held in partnership with the Harlem High School Marching Band, this festival is designed to give high school students a positive place to perform, compete and be rewarded for their efforts. Along with different classes based on band size, there is a non-competitive festival class. Even if your band does not march a field show, there\\\'s still a place for you to perform here! We want to give every school and their ensemble a chance to perform. Following their performance, a band will attend an instant feedback session with commentary from a major DCI show designer. Bands will get tips and comments while watching a replay on the big screen.','',183,NULL,0,'','',0,'2012-03-12','dbalash'),(152,'McHenry High School Marching Festival ','2009-09-12',2009,'McHenry, IL','Brian Weidner','http://www.dist156.org/Staff/music%20website/home.htm','The McHenry High School Marching festival is a non-competitive festival focused on advancing student understanding of marching technique and providing early season feedback from university and top high school directors to apply for improving future performances. In addition to participating in a field show, each ensemble will also receive a 20 - 25 minute clinic with one of the members of our judging team.',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(153,'Echoes off the River','2009-09-19',2009,'Alton, IL','Matt Banks','http://www.abob.net/Echoes.html','The contest will begin at approximately 9:00 a.m.  Bands will be divided into three classes and will be classified according to band size.  A judging panel has not yet been determined, but will be announced as soon as possible  currently, the event organizers are in contact with the Judges Association of Mid-America (JAMA) and the Central States Judges Association (CSJA).<br />\r\n<br />\r\nLater in the day, Edwardsville High School will be hosting the 2nd Annual Tiger Ambush Classic.  We encourage you to also participate in the Tiger Ambush classic and benefit from the opportunity of two sets of adjudication.  Edwardsville is approximately 25 minutes south of Alton, and the Echoes contest will be scheduled to insure that bands will have plenty of time to participate in both events.',NULL,126,NULL,0,'Tom Lewis Espirit de Corp: Jacksonville','',0,'1970-01-01',''),(154,'Marching Maroons Band Festival','2009-10-03',2009,'Robinson, IL','Joe Smith','http://www.rhsmarchingmaroons.com/','The Robinson High School Band will be hosting the Marching Maroons Band Festival on October 3, 2009.  Judges from the Central State Judging Association will be utilized.  There is an optional afternoon Heath Harvest Parade free with no judging.<br />\r\n<br />\r\nThe festival starts at 4:30; awards are at 8:00.<br />\r\n<br />\r\nTicket prices:<br />\r\n$5 - Adults and Children age 10 and above<br />\r\n$2 - Children 5-9<br />\r\nFREE - Children under 5',NULL,193,NULL,0,'','',0,'1970-01-01',''),(155,'Quincy Octoberfest Marching Invitational','2009-10-17',2009,'Quincy, IL','Chris Beason','www.ilmarching.com','The Quincy Senior High Octoberfest Invitational Parade & Field Competition will be held on\r\nSaturday, October 17th.  The parade begins at 2:00 p.m. and the field competition begins at 5:15 p.m.',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(156,'Geneseo Maple Leaf Classic','2009-09-26',2009,'Geneseo, IL','Steve Scherer','http://www.gcsdblogs.org/HS_Band/index.html','Educational format. Each band will receive a one hour clinic from an expert adjudicator with cross-caption expertise. After the clinics, the bands will compete in class competition based on band size.  The competition is in the evening under the lights.  Clinicians and judges are provided by the Central States Judges Association.  The adjudication sheets are from the Florida Marching Band Coalition.',NULL,56,NULL,0,'','',0,'1970-01-01',''),(157,'Dwight Harvest Days Parade and Field Show','2009-09-20',2009,'Dwight, IL','Richard Benzik','http://dwightharvestdays.com/FieldShow.htm','This annual competition is held in conjunction with the Dwight Harvest Days.  There is a parade that begins at 1:00, and the field show begins at approximately 4:30.  Trophies are given out for 1st and 2nd place in each class as well as caption awards.  The overall Grand Champion will be the band with the highest combined field and parade scores.',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(158,'Unity Invitational Marching Band Contest','2009-09-26',2009,'Unity, IL','William Jean','http://www.unityrockets.com/unity/faculty/finearts/jean/invitational.html','Schools will be classified based on school size.  Trophies will be given out for placement in class, drum major, color guard, and percussion.  There will also be special trophies awarded for highest achievement in Drill Design, Creative Concept, and Demand.',NULL,NULL,NULL,0,NULL,'',0,'1970-01-01',''),(159,'Shelbyville Marching Festival','2009-10-24',2009,'Shelbyville','Anthony Gatewood','n/a','',NULL,151,NULL,0,'','',0,'1970-01-01',''),(160,'WIU Marching Band Classic','2009-10-10',2009,'Macomb, IL','Douglas Phillips','http://www.wiu.edu/bands/events/athletic/classic/schedule.jsp','The 28th annual Western Illinois University Marching Band Classic will feature 11 of the finest west-central and central Illinois high school bands in field competition on the WIU-Macomb campus. The classic kicks off with the National Anthem at 4 PM on Hanson Field; the awards ceremony is scheduled for 8:10 PM. In between there will be field competition in a two division championship format: small school (Classes 1A, 2A) and large school (Classes 3A, 4A). Overall champion trophies will be awarded in each division and to the top three bands in each class. The best drum major(s), percussion, winds and auxiliaries in each division also will receive trophies.',NULL,60,NULL,0,'Small School Grand Champion: Macomb','',0,'1970-01-01',''),(161,'Oblong Spooktacular','2009-10-31',2009,'Oblong, IL','Oblong Music Boosters','http://www.fairpoint.net/~kkart/band.html','In 2009, the festival will be celebrating its 15th anniversary. It features both a field show and a parade competition. A drumline showcase is held prior to the evening parade and the parade also includes a Junior High division.',NULL,67,NULL,0,'Class 1A Field Auxiliary: Pana\r\nClass 1A Field Percussion: Pana\r\n\r\nClass 1A Parade Auxiliary: Pana\r\nClass 1A Parade Percussion: Pana\r\n\r\nJr. High Class A Parade:\r\n1. Casey Westfield (DM, Percussion)\r\n\r\nJr. High Class AA Parade:\r\n1. Mattoon Middle School (DM, Auxiliary)\r\n2. Nuttall Middle School (Percussion)\r\n3. Mt. Carmel Jr. High\r\n\r\nCombined Class Parade: \r\n1. Ramsey\r\n2. Arcola (DM, Percussion)\r\n3. North Clay (Auxiliary)\r\n\r\nJr. High Grand Champion Parade: Mattoon\r\nGrand Champion Parade: Ramsey','',0,'1970-01-01',''),(162,'Olympia Marching Spartans Invitational ','2009-10-03',2009,'Stanford','None','None','',NULL,13,NULL,0,'Overall Auxillary: Eureka\r\nOverall DM: Mahomet-Seymour\r\nOverall Percussion: University','',0,'2011-02-11','dbalash'),(164,'Greater St. Louis Marching Band Festival','2010-10-23',2010,'St. Louis, Missouri','GSLMBF','http://www.gslmbf.com','The 39th Annual Greater St. Louis Marching Band Festival provides an opportunity for evaluation of outstanding high school marching bands in a first-class professional venue, the Edward Jones Dome which includes comfortable stadium seating, exhibits and indoor warm-up rooms.',NULL,31,NULL,0,'','701 Convention Plaza, St. Louis, MO 63101',0,'2010-11-03','dbalash'),(165,'Marengo Settlers Days','2009-10-11',2009,'Marengo, IL','Todd Stellmach','http://www.mchs154.org/mchs/depts/activities/org.php?org=32','This annual competition plays host to some of the better bands in Illinois.',NULL,66,NULL,0,'','',0,'2011-01-23','dbalash'),(166,'Sage City Invitational','2009-10-10',2009,'Monticello, IL','Jim Holmes','http://www.ilmarching.com','The 8th Annual Sage City Invitational is an early afternoon contest and is organized by school size.  There are four classes C/D 1-350, B 351-700, A 701-1000, AA 1001 +.  1st, 2nd, 3rd place trophies are awarded in each class with caption trophies for drum major(S), percussion, color guard, and best winds captions.	 <br />\r\n ',NULL,3,NULL,0,'Grand Champion Percussion: Champaign Centennial','',0,'1970-01-01',''),(167,'Naperville Central Marching Classic','2010-09-11',2010,'Lisle, IL','DJ Alstadt','http://www.nchsbands.info','Shows are scored on a modified system, with class placements, and a grand champion named.',NULL,40,NULL,0,'','5700 College Road, Lisle, IL 60532',0,'2010-09-10','dbalash'),(168,'Chicagoland Marching Band Festival','2010-09-25',2010,'Wheeling, IL','Brian Logan','http://www.wheelingbands.org','The Chicagoland Marching Band Festival (CMBF) hosted by Wheeling High School is Chicago\\\'s longest running marching band festival and is now celebrating its 43rd year.',NULL,36,NULL,0,'','900 S. Elmhurst Road, Wheeling, IL 60090',0,'2010-09-03','dbalash'),(170,'Bands of America Regional Championships: Pontiac, MI','2010-10-09',2010,'Pontiac, MI','Bands of America','http://www.musicforall.org','Celebrating their 35th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.',NULL,NULL,'William Mason, OH',0,'','1200 Featherstone Road, Pontiac, MI 48342',1,'2010-09-16','dbalash'),(171,'Prospect Knight of Champions','2010-10-02',2010,'Mt. Prospect, IL','Chris Barnum','http://www.prospectband.com/','The Prospect High School Band Boosters will be sponsoring the Knight of Champions marching band competition on Saturday, October 2, 2010 at Prospect High School. Bands will compete in three classes: A (up to 64 members), AA (65 to 96 members), and AAA (97 or more members). Awards presented will include first, second, and third place in Class A, AA, and AAA. Additional awards for Outstanding Percussion, Outstanding Auxiliary, Outstanding Music, Outstanding Visual and outstanding General Effect will be given to each class. Participation awards will be presented to all bands that perform. There will be caption-specific commentary and scoring, and an overall Grand Champion Traveling trophy. We will be utilizing a scoring system similar to Bands of America.',NULL,26,NULL,0,'','801 W. Kensington Road, Mt. Prospect, IL 60056',0,'2010-09-19','dbalash'),(172,'Murphysboro Drums at Appletime','2010-09-18',2010,'Murphysboro, IL','Nick Williams','http://www.crimsonexpress.com/','Originally begun as a Drum and Bugle Corps show, the Murphysboro Drums at Appletime competition is a premier competition hosting bands from Illinois, Missouri, Indiana, Kentucky, and Iowa consistently drawing around 5,000 spectators. In an effort to be responsive to the needs of bands early in the season the show features a critique and review session for band directors and their staff with the judges immediately following the competition. A Grand Champion is crowned combining the parade and field show scores.<br />\r\n<br />\r\nThe show will begin at 4:30 P.M.',NULL,119,NULL,0,'','50 Blackwood Dr., Murphysboro, IL 62966',0,'2010-09-07','dbalash'),(173,'Red & Black Fall Classic','2010-09-25',2010,'DeKalb, IL','Rick Valenzuela','http://www.regiment.org/bands','New in 2010, the Phantom Regiment Marching Band Festival will be held at Northern Illinois University in conjunction with the Huskie Marching Band.  Adjudicators and clinicians from across the country will be judging, including past and present BOA judges.<br />\r\n<br />\r\nThe competition will start at 1:30 P.M.  Tickets will cost $12 for adults, $7 for students, and $30 for a family pack.','',36,NULL,0,'','1201 North Stadium Drive, DeKalb, IL 60115',0,'2012-03-12','dbalash'),(174,'Shelbyville Marching Festival','2010-10-16',2010,'Shelbyville, IL','Emma Burrows','http://www.ilmarching.com','Billed as a \\\\\\\"cheap alternative to University of Illinois.\\\\\\\"  Parade/field format.<br />\r\n<br />\r\nFor more information, email Emma Burrows, director of bands at Shelbyville, at shsramband@gmail.com.',NULL,79,NULL,0,'','1001 W. North 6th St., Shelbyville, IL 62565',0,'2010-10-01','dbalash'),(379,'Youth in Music Championships','2010-10-23',2010,'Minneapolis, MN','Brent Turner','http://www.youthinmusic.org','Youth in Music would like to invite you to participate in the 2nd Annual Marching Band Championship at the Hubert H. Humphrey Metrodome. This championship event will be adjudicated by a national level juding panal, and is open to any high school marching band. Grouped can participate in one of four classes: A, AA, AAA and Exhibition. Our goal is to provide your students with a first-rate performance experience! All bands will receive critique from a qualified panel of national level judges and educators, as well as a videocassette of their performance.',NULL,NULL,NULL,0,NULL,'',0,'2010-10-18','dbalash'),(176,'Lake Park Lancer Joust','2010-09-11',2010,'Roselle, IL','Mike Chiodo','http://lakeparkband.com/','The Annual Lancer Joust will feature bands from Indiana, Iowa, Wisconsin and Illinois. The competition is an afternnon/evening event in preliminary and final competition format. Preliminary competition is in Class by band size.',NULL,36,'',0,'','500 W. Bryn Mawr, Roselle, IL 60172',1,'2010-09-09','dbalash'),(177,'Metro East Marching Classic','2010-09-11',2010,'O\'Fallon, IL','Melissa Gustafson-Hinds','http://othsbands.com/index.php?pagekey=metroeast10','The Metro East Marching Classic, presented by the O\\\\\\\'Fallon Township High School Band Boosters, is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by school size and compete for awards in Outstanding Winds, Percussion, and Auxiliary, along with the crowning of a Grand Champion.<br />\r\nBand directors can attend the Belleville East Marching Invitational in Belleville earlier in the day for a double competition experience.',NULL,84,NULL,0,'','600 S. Smiley St., O\'Fallon, IL 62269',0,'2010-09-03','dbalash'),(178,'Belleville East Marching Invitational','2010-09-11',2010,'Belleville, IL','Mark Tessereau','http://www.lancerbands.org/marching_invitational','The Belleville East High School Marching Lancers invite you to attend the annual Belleville East Marching Invitational. Awards include Outstanding Winds, Visual, Percussion, Auxiliary, People\\\'s Choice, &  Grand Champion. Bands are classified by instrumentation size.  Band directors can attend the Metro East Marching Classic in O\\\'Fallon later in the day for a double competition experience.',NULL,68,NULL,0,'Leroy Kirsch Award - Granite City','2555 W. Blvd., Belleville, IL 62221',0,'2010-09-02','dbalash'),(179,'Wheaton North Falcon Marching Band Festival','2010-09-18',2010,'Wheaton, IL','Jon Noworyta','http://www.wnband.org/news/Festival.php','Trophies will be presented for first, second, and third place in Classes A, AA, and AAA. Overall caption awards presented for the event will include: Outstanding Visual Performance, Outstanding Musical Performance, Outstanding General Effect, and Outstanding Percussion. ',NULL,25,NULL,0,'','1 Falcon Way, Wheaton, IL 60187',0,'2010-09-14','dbalash'),(180,'Tiger Ambush Classic','2010-09-18',2010,'Edwardsville, IL','Marvin Battle','http://www.ecusd7.org/ehs/EHSstaff/mbattle/TAC_index.htm','The Tiger Ambush Classic is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by band size and compete for awards in Outstanding Winds, Percussion, Auxiliary, Drum Major, and Grand Champion. Judging is based on sheets designed by the Mid-America Marching Consortium.',NULL,31,NULL,0,'','6161 Center Grove Rd, Edwardsville, IL 62025',0,'2010-11-03','dbalash'),(181,'Morton Marching Invitational','2010-09-18',2010,'Morton, IL','Jeff Neavor','http://www.mortonbands.org/marching/pumpkinfest.php','The field show competition, hosted by Morton High School, is held during the City of Morton Pumpkin Festival.','',8,NULL,0,'Grand Champion Percussion: Limestone\r\nGrand Champion Winds: Downers Grove South\r\nGrand Champion Auxiliary: Downers Grove South','350 N. Illinois St., Morton, IL 61550',0,'2014-01-14','dbalash'),(182,'Mt. Zion Marching Music Games','2010-09-25',2010,'Mt. Zion, IL','Brianna Bjerke','http://www.mtzionbands.com/marchinggames.htm/','Mt. Zion Marching Braves presents the 7th Annual Marching Music Games. Highlights of the contest include excellent judges and critique, an afternoon parade and evening field competition under the lights, conveniently located warm-up fields, hospitality rooms and free meals for directors and staff, great concessions and competition based on band size. 1st, 2nd, 3rd place trophies in each class in parade and field show. Best in class trophies in each class in parade and field show (Best Drum Major, Best Drum Line, Best Auxiliary), Grand Champion regardless of class.',NULL,NULL,'No GC Named',0,'Class 1A is out of 100 Points\r\nClass 2A and 3A were inside, and hence out of 60 points. \r\n\r\nNo Grand Champion was named due to some bands performing outside, and some performing inside. ','305 S. Henderson, Mt. Zion, IL 62549',0,'2010-09-09','dbalash'),(183,'Geneseo Maple Leaf Classic','2010-09-25',2010,'Geneseo, IL','Steve Scherer','http://www.gcsdblogs.org/HS_Band/index.html','Educational format. Each band will receive a one hour clinic from an expert adjudicator with cross-caption expertise. After the clinics, the bands will compete in class competition based on band size. The competition is in the evening under the lights. Clinicians and judges are provided by the Central States Judges Association. The adjudication sheets are from the Florida Marching Band Coalition.',NULL,NULL,NULL,1,NULL,'700 N. State St., Geneseo, IL 61254',0,'2010-09-20','dbalash'),(184,'Bands of America Regional Championships: Louisville, KY','2010-09-25',2010,'Louisville, KY','Bands of America','http://www.musicforall.org','Celebrating their 35th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.',NULL,NULL,'Carmel, IN',0,'Ties are broken by the General Effect scores.','2800 S. Floyd St., Louisville, KY 40209',1,'2010-09-20','dbalash'),(186,'McKendree Preview of Champions','2010-10-02',2010,'Lebanon, IL','Lester McQuaid','http://www.mckendree.edu/Department_of_Music/Preview_of_Champions.aspx/','Bands will compete on a lighted, Game Day turf field, in classes based on number of instrumentalists. Awards are given for 1st, 2nd, and 3rd place in each class and a Grand Champion Award. Caption awards for Outstanding Percussion, Color Guard, Music, and Visual are also given in each class. After each bands performance there will be a video review and clinician comments.',NULL,84,NULL,0,'','701 College Road, Lebanon, IL 62254',0,'2010-09-29','dbalash'),(187,'Marching Maroons Band Festival','2010-10-02',2010,'Robinson, IL','Joe Smith','http://www.rhsmarchingmaroons.com/','The Robinson High School Band will be hosting the Marching Maroons Band Festival on October 2, 2010. Judges from the Central State Judging Association will be utilized. <br />\r\n<br />\r\nGates open at 4pm, First Band Performs at 5:00.<br />\r\nAdmission: All Tickets $5, Children under 5 Free',NULL,82,NULL,0,'','2000 N. Cross, Robinson, IL 62454',0,'2010-09-21','moverholt'),(188,'Bands of America Regional Championships: Kettering, OH','2010-10-02',2010,'Kettering, OH','Bands of America','http://www.musicforall.org','Celebrating their 35th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.',NULL,NULL,'Carmel, IN',0,'','3301 Shroyer Road, Kettering, OH 45429',1,'2010-09-15','dbalash'),(190,'Panther Marching Band Festival','2010-10-09',2010,'Charleston, IL','Barry Houser','http://www.eiu.edu/~music/news_events_panther_marching.php','The 34th Annual Panther Marching Band Festival is an morning/afternoon/evening competition set to begin at 10:00 AM in O\\\\\\\'Brien Stadium on the campus of Eastern Illinois University.',NULL,88,NULL,0,'','600 Lincoln Ave., Charleston, IL 61920',0,'2010-10-04','dbalash'),(191,'Downers Grove South Marching Mustang Music Bowl','2010-10-09',2010,'Downers Grove, IL','Craig Roselieb','http://www.dgsmusicbowl.com/','2010 marks the 9th annual DGS Marching Mustang Music Bowl. Bands compete in three categories (A, AA, AAA) based on band size and the Bands of America scoring system will be utilized. The scoring is 20% Music, 20% Visual, 60% General Effect. First, second and third place awards will be presented in each class. In addition, the following caption awards will be presented in each class: Outstanding Music Performance, Outstanding Visual Performance, Outstanding Percussion, Outstanding Auxiliary, Outstanding Drum Major. In addition, a Grand Champion Trophy will be presented to the highest scoring band, regardless of class.','',21,NULL,0,'','1436 Norfolk, Downers Grove, IL 60516',0,'2012-10-21','moverholt'),(193,'Marengo Settlers Days','2010-10-10',2010,'Marengo, IL','Todd Stellmach','http://www.mchs154.org/mchs/depts/activities/org.php?org=32','This annual competition plays host to some of the better bands in Illinois.',NULL,91,NULL,0,'','110 Franks Road, Marengo, IL 60152',0,'2011-01-23','dbalash'),(194,'Illinois Marching Band Championships Large Schools','2010-10-16',2010,'Champaign, IL','Dr. Peter Griffin','http://www.bands.illinois.edu/content/illini-marching-band-championships','The University of Illinois Bands within the School of Music 