ips','2010-10-23',2010,'Normal, IL','ISU Bands','http://www.bands.ilstu.edu/events/marching_band.shtml','ISU hosts the annual State of Illinois Marching Band Invitational, which pits some of the best bands in Illinois in a prelims/finals format.','',25,'',0,'','702 West College Ave., Normal, IL 61790',1,'2012-10-21','moverholt'),(201,'Pinckneyville Mardi Gras Field Show and Parade','2010-10-30',2010,'Pinckneyville, IL','Stephen Cannedy','http://web.mac.com/scannedy1/iWeb/scannedy1/Mardi%20Gras.html','The Pinckneyville \\\"Mardi Gras\\\" is a homecoming type town celebration. We have a full day of activities in Pinckneyville. There is a flea market uptown all morning with many events. The field show contest begins around 1:30 or 2:00 in the afternoon at the High School Football field. Our average number of bands runs around 10-12 and we use 2 or 3 classes depending on how many bands we have. The cost for entering the field show is $100.00. The parade is at night beginning at 7:00 pm. It is a huge crowd of people and with the event being close to Halloween, there are many dressed up people throughout the parade. Awards are held after the parade at the fairgrounds. We have a $500 grand champion award to the band with the highest combined score of parade and field. In addition all parade bands get a check for $100 and we also have a $150 prize for the best parade band regardless of class. $100 for 2nd and $50 additional for 3rd.',NULL,2,NULL,0,'','600 E. Water St., Pinckneyville, IL 62274',0,'2010-10-25','dbalash'),(202,'Bands of America Super Regional Championships: Atlanta, GA','2010-10-30',2010,'Atlanta, GA','Bands of America','http://www.musicforall.org','Celebrating their 35th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.',NULL,NULL,'Tarpon Springs, FL',0,'','1 Georgia Dome Drive Northwest, Atlanta, GA 30313',1,'2010-10-18','dbalash'),(204,'Bands of America Regional Championships: Indianapolis, IN','2010-11-06',2010,'Indianapolis, IN','Bands of America','http://www.musicforall.org','Celebrating their 35th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.',NULL,NULL,'Avon, IN',0,'','500 South Capitol Avenue, Indianapolis, IN 46225',1,'2010-10-21','dbalash'),(205,'Bands of America Grand National Championships','2010-11-11',2010,'Indianapolis, IN','Bands of America','http://www.musicforall.org','This is the premier marching band event of the season. 90 of the nation\\\'s best marching bands compete in Indianapolis at the Lucas Oil Stadium in a prelims/semifinals/finals event. Bands are arranged by school size in prelims and semifinals, and class champions are awarded in A, AA, AAA, and AAAA. The 12 top bands move on to finals, and they compete head to head for the prestigious Grand Nationals trophy.<br />\r\n<br />\r\nAvon looks to 3-peat in 2010, being the first band since Marian Catholic (1987-1989) to do so.',NULL,NULL,'Avon, IN',0,'','500 South Capitol Avenue, Indianapolis, IN 46225',1,'2010-11-03','dbalash'),(206,'Effingham Marching Hearts Invitational','2010-09-25',2010,'Effingham, IL','Brad Wallace','http://effinghamband.org/','The Effingham Marching Hearts Invitational is an afternoon competition set to begin at 2:00pm, allowing bands to also attend the Newton Marching Eagles Band Classic which is a morning competition. For more information, email Brad Wallace at wallaceb@effingham.k12.il.us',NULL,11,NULL,0,'','1301 W. Grove, Effingham, IL 62401',0,'2010-09-02','dbalash'),(207,'Pontiac Indian Showdown','2010-09-25',2010,'Pontiac, IL','Keith Schmink','http://www.pontiac.k12.il.us/academics/music/IndianShowdown2008.htm','Bands will be competing in the 8th Annual Indian Showdown. Clinics begin at 1:00pm and the competition at 5:00pm.',NULL,13,NULL,0,'Scores out of 200','1100 Indiana Ave., Pontiac, IL 61764',0,'2010-09-09','dbalash'),(208,'St. Rita Mustang Stampede','2010-10-03',2010,'Chicago, IL','Jodi McLawhorn','http://stritahs.com/band/index.html','The Mustang Stampede is a marching band competition that is sponsored by the St. Rita High School Band and its Boosters. Over the years this competition has grown in size to accommodate over 20 of the areas finest bands.',NULL,25,NULL,0,'','7740 S. Western Ave., Chicago, IL 60620',0,'2010-09-27','dbalash'),(209,'A.A. Stagg Jamboree','2010-09-26',2010,'Tinley Park, IL','Robert Mecozzi/Mark Iwinski','www.staggmusic.org','The Stagg Marching Band Jamboree is proud to celebrate its 30th year. Bands are classified in three class sizes, A, AA, and AAA, based on the number of playing musicians. Bands of America scoring sheets are utilized by a panel of 10 caption judges. 1st, 2nd, and 3rd place awards are given to each class and an overall Grand Champion is also awarded to the highest scoring band. Individual awards are given for outstanding percussion, auxiliary, visual effect, and music. <br />\r\n<br />\r\n<b>Note: The 2010 A.A. Stagg Jamboree has moved to Victor J. Andrew in Tinley Park due to construction at Stagg.  Also, note the new day.</b>',NULL,1,NULL,0,'','9001 W. 171st St., Tinley Park, IL 60487',0,'2010-09-22','dbalash'),(210,'Newton Marching Eagles Band Classic','2010-09-25',2010,'Newton, IL','Newton Band Boosters','http://www.marchingeagles.info/','The Newton Marching Eagle Band Boosters, along with Director Brian Ridlen and Assistant Director Jeffrey Finley invite you to participate at our 2010 Marching Eagles Band Classic. The morning of Saturday, September 25th will begin our competition. The Effingham Marching Hearts Invitational is set to begin at 2:00pm that same day. Effingham is approximately 30 miles west of Newton. What a great way to compete in two shows in one day!Please mark your calendars now to join us!! Bands will be classified based on school size. We will accommodate your schedule so that your band can compete at both shows.<br />\r\n',NULL,11,NULL,0,'','201 W. End Ave. Newton, IL 62448',0,'2010-09-20','dbalash'),(211,'Mahomet-Seymour Marching Bulldog Festival','2010-10-23',2010,'Mahomet, IL','Michael Stevens','http://www.ilmarching.com','This show pits some of the best bands in Illinois in a class format, a winner for each class.',NULL,41,NULL,0,'','302 W. State St., Mahomet, IL 61853',0,'2010-10-15','dbalash'),(212,'Metamora Band Invitational','2010-10-09',2010,'Metamora, IL','Wally Parks','http://www.ilmarching.com','The 30th annual running of this contest features a great stadium for marching bands, and excellent well-rounded panel of adjudicators, and wonderful festival atmosphere throughout the day. The competition is one of the largest and oldest, continuous running, high school-sponsored competition in the state of Illinois. Attendees are usually drawn from Illinois, eastern Iowa, and western Indiana. Bands receive a DVD of their performance along with adjudicator tapes. Judging sheets are similar to BOA.','',45,NULL,0,'Grand Champaion 1A-2A: Rich Central','101 W. Madison St., Metamora, IL 61548',0,'2014-01-26','dbalash'),(213,'Washington Marching Panther Invitational','2010-09-11',2010,'Washington, IL','Jim Tallman','http://www.wchsband.org/id154.html','The 2010 Marching Panther Invitational is a high school parade and field marching competition. Bands will be grouped into classes based on band size and school size. This will be an afternoon / evening event! Trophies and plaques will be given for outstanding Drum Majors, Color Guard, Drumlines and Bands in each class for the Parade and Field Competitions','',35,'',0,'1A/2A Overall Percussion: Geneseo\r\n3A/4A Overall Percussion: Illinois Valley Central','115 Bondurant, Washington, IL 61571',0,'2012-03-28','dbalash'),(215,'WIU Marching Band Classic','2010-10-09',2010,'Macomb, IL','Shawn Vondran','http://www.wiu.edu/bands/events/athletic/classic/schedule.jsp','The 29th annual Western Illinois University Marching Band Classic will feature some of the finest west-central and central Illinois high school bands in field competition on the WIU-Macomb campus. The classic kicks off with the National Anthem at 4 PM on Hanson Field; the awards ceremony is scheduled for 8:10 PM. In between there will be field competition in a two division championship format: small school (Classes 1A, 2A) and large school (Classes 3A, 4A). Overall champion trophies will be awarded in each division and to the top three bands in each class. The best drum major(s), percussion, winds and auxiliaries in each division also will receive trophies.',NULL,57,NULL,0,'Grand Champion small schools: Illini West','1 University Circle, Macomb, IL 61455',0,'2010-10-04','dbalash'),(216,'Olympia Marching Spartans Invitational ','2010-10-02',2010,'Stanford, IL','Olympia Band Boosters','http://www.ilmarching.com','This show is held at Olympia HS, and is a parade and field show.',NULL,9,NULL,0,'GC Percussion: ROWVA','7832 North 100 East Road, Stanford, IL 61774',0,'2011-02-11','dbalash'),(217,'McHenry High School Marching Festival ','2010-09-11',2010,'McHenry, IL','Brian Weidner','http://www.dist156.org/Staff/music%20website/marching%20festival.htm','The McHenry High School Marching Band Festival is a non-competitive clinic for high school marching bands.  Our panel includes distinguished university, high school, and drum corps directors and creative members.  Each band performs a festival show on the main field receiving tapes and response sheets in open caption areas as well as percussion and auxiliary.  These performances are open the public.  Following the performance, bands move to an auxiliary field for a 25 minute clinic with a member of our adjudication panel.',NULL,NULL,NULL,0,NULL,'4724 W. Crystal Lake Rd., McHenry, IL 60050',0,'2010-09-03','dbalash'),(218,'Rock Island Marching Band Festival','2010-10-04',2010,'Rock Island, IL','Pete Carlin','http://rockislandschools.org/blogs/ribands/marching-band/','This is an annual non-competitive show held at the football stadium at Rock Island.   This year, it will be held Monday, October 4th.',NULL,NULL,NULL,0,NULL,'1400 25th Ave., Rock Island, IL 61201',0,'2010-08-21','dbalash'),(219,'Monmouth College Marching Band Invitational','2010-09-18',2010,'Monmouth, IL','Stephen Richter','http://department.monm.edu/music/','This is a new clinic. that will be held at Bobby Woll Field.  The event is designed to be a performance/clinic venue for high schools. Each school will perform at the April Zorn Memorial Field and then have time with clinicians.<br />\r\n ',NULL,NULL,NULL,0,NULL,'700 East Broadway, Monmouth, IL 61462',0,'2010-09-09','dbalash'),(222,'Sage City Invitational','2010-10-02',2010,'Monticello, IL','Jim Holmes','http://www.ilmarching.com','The 9th Annual Sage City Invitational is an early afternoon contest and is organized by school size. There are four classes C/D 1-350, B 351-700, A 701-1000, AA 1001 +. 1st, 2nd, 3rd place trophies are awarded in each class with caption trophies for drum major(S), percussion, color guard, and best winds captions.	',NULL,23,NULL,0,'','1 Sage Drive, Monticello, IL 61856',0,'2010-09-21','clarinetdude124'),(223,'Atwood-Hammond Rajah Invitational','2010-09-18',2010,'Atwood, IL','Atwood-Hammond Bands','http://www.ilmarching.com','The Atwood-Hammond Marching Rajahs host this afternoon/evening field and parade competition. This is the premier event to raise funds for the music programs at Atwood-Hammond.',NULL,96,NULL,0,'Parade Grand Champion: Mt. Zion','222 W. Magnolia, Atwood, IL 61913',0,'2010-09-17','clarinetdude124'),(224,'Oblong Spooktacular','2010-10-30',2010