009-09-26',2009,'Sparta, IL','','','',NULL,NULL,'DeSoto, MO',0,'','',0,'1970-01-01',''),(372,'Super City Sounds','2009-10-03',2009,'Metropolis, IL','','','',NULL,NULL,'Obion County, TN',0,'','',0,'1970-01-01',''),(373,'Sandwich Musicfest','2009-10-18',2009,'Sandwich, IL','','','','',38,NULL,0,'','',0,'2013-02-05','dbalash'),(374,'Sandwich Musicfest','2010-10-17',2010,'Sandwich, IL','Todd Schultz','http://www.sandwich430.org/schools/shs/Band.htm','This show has a field and parade format.','',38,NULL,0,'','',0,'2013-02-05','dbalash'),(376,'Concord Marching Invitational','2010-09-18',2010,'Elkhart, IN','Concord Music Boosters','http://www.concordmusic.info','After another successful Concord Invitational last season, we enter the 27th annual year for this wonderful event. The contest was first held in 1982 with twelve competing bands. For many years, as many as 35-40 bands from across the state competed at this yearly event. The contest is sponsored by the Concord Music Association and the Concord High School Marching Minutemen which will be performing in exhibition at the culmination of the evening. There is ample parking, and a full line of concessions is always available. A panel of independent judges will adjudicate this contest.',NULL,NULL,'Lake Central, IN',0,'','',0,'2010-09-13','dbalash'),(377,'Interscholastic Festival','2010-10-02',2010,'North Judson, IN','Matthew Hibbets','www.njsp.k12.in.us','The Interscholastic Festival is a festival style event that issues ratings [gold, silver, bronze] and achievement awards in music, visual, and auxiliary.  Achievement awards are issued if bands score 80% of the music and music ge, visual and visual ge, and auxiliary captions.  The only awards announced are ratings and achievement awards.',NULL,NULL,'No GC',0,'Note: no scores are given; only placings of Gold, Silver, and Bronze.\r\n\r\nMusic, Visual, and Auxiliary awards were also given to bands with exemplary performances in these categories. ','',0,'2010-09-20','dbalash'),(375,'Great Lakes Invitational','2010-10-02',2010,'Canton, MI','David Armbruster','http://pcmb.net/gli/index.html','This annual competition pits some of the best bands in Michigan up against each other.  This year, Lincoln-Way North joins in on the fun.<br />\r\nShow starts at 3:00 EST.',NULL,NULL,'Walled Lake Central, MI',0,'Scoring system is:\r\n-30% Music\r\n-25% Visual\r\n-45% GE','',0,'2010-09-27','dbalash'),(378,'Olympian Marching Band Festival','2010-10-16',2010,'Olympia Fields, IL','Phillip Crews','http://www.ilmarching.com','',NULL,NULL,NULL,0,NULL,'',0,'2010-10-11','dbalash'),(382,'Morton Marching Invitational','2011-09-17',2011,'Morton, IL','Jeff Neavor','http://www.mortonbands.org/marching/pumpkinfest.php','The field show competition, hosted by Morton High School, is held during the City of Morton Pumpkin Festival.','',92,NULL,0,'GC Aux: Limestone\r\nGC Perc: Limestone\r\nGC Winds: Limestone','350 N. Illinois St., Morton, IL 61550',0,'2014-01-14','dbalash'),(383,'Illinois State University Invitational Marching Championships','2011-10-29',2011,'Normal, IL','ISU Bands','http://www.bands.ilstu.edu/events/marching_band.shtml','ISU hosts the annual State of Illinois Marching Band Invitational, which pits some of the best bands in Illinois in a prelims/finals format.','',25,NULL,0,'','702 West College Ave., Normal, IL 61790',1,'2012-10-21','moverholt'),(384,'Belleville East Marching Invitational','2011-09-10',2011,'Belleville, IL','Mark Tessereau','http://www.lancerbands.org/marching_invitational','The Belleville East High School Marching Lancers invite you to attend the annual Belleville East Marching Invitational. Awards include Outstanding Winds, Visual, Percussion, Auxiliary, People\\\\\\\'s Choice, &  Grand Champion. Bands are classified by instrumentation size.  ',NULL,11,NULL,0,'','2555 W. Blvd., Belleville, IL 62221',0,'2011-09-02','dbalash'),(385,'Metro East Marching Classic','2011-09-10',2011,'O\'Fallon, IL','Melissa Gustafson-Hinds','http://othsbands.com/index.php?pagekey=metroeast10','The Metro East Marching Classic, presented by the O\\\\\\\\\\\\\\\'Fallon Township High School Band Boosters, is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by school size and compete for awards in Outstanding Winds, Percussion, and Auxiliary, along with the crowning of a Grand Champion.<br />\r\nBand directors can attend the Belleville East Marching Invitational later in the day for a double competition experience.',NULL,16,NULL,0,'Overall Percussion: Rockwood Summit','600 S. Smiley St., O\'Fallon, IL 62269',0,'2011-08-26','dbalash'),(386,'Lake Park Lancer Joust','2011-09-10',2011,'Roselle, IL','Mike Chiodo','http://lakeparkband.com/','The Annual Lancer Joust will feature bands from Indiana, Iowa, Wisconsin and Illinois. The competition is an afternoon/evening event in preliminary and final competition format. Preliminary competition is in Class by band size.',NULL,36,NULL,0,'','500 W. Bryn Mawr, Roselle, IL 60172',1,'2011-09-03','dbalash'),(392,'Murphysboro Drums at Appletime','2011-09-17',2011,'Murphysboro, IL','Nick Williams','http://www.crimsonexpress.com/','Originally begun as a Drum and Bugle Corps show, the Murphysboro Drums at Appletime competition is a premier competition hosting bands from Illinois, Missouri, Indiana, Kentucky, and Iowa consistently drawing around 5,000 spectators. In an effort to be responsive to the needs of bands early in the season the show features a critique and review session for band directors and their staff with the judges immediately following the competition. A Grand Champion is crowned combining the parade and field show scores.<br />\r\n<br />\r\nThe show will begin at 4:30 P.M.',NULL,119,NULL,0,'Field Show GC: Cape Central\r\n','50 Blackwood Dr., Murphysboro, IL 62966',0,'2011-09-03','dbalash'),(388,'McHenry High School Marching Festival','2011-09-10',2011,'McHenry, IL','Brian Weidner','http://www.dist156.org/Staff/music%20website/marching%20festival.htm','The McHenry High School Marching Band Festival is a non-competitive clinic for high school marching bands.  Our panel includes distinguished university, high school, and drum corps directors and creative members.  Each band performs a festival show on the main field receiving tapes and response sheets in open caption areas as well as percussion and auxiliary.  These performances are open the public.  Following the performance, bands move to an auxiliary field for a 25 minute clinic with a member of our adjudication panel.',NULL,NULL,NULL,0,NULL,'4724 W. Crystal Lake Rd., McHenry, IL 60050',0,'2011-08-02','dbalash'),(390,'A.A. Stagg Jamboree','2011-09-17',2011,'Palos Hills, IL','Robert Mecozzi','http://www.staggmusic.org/jamboree/','The Stagg Marching Band Jamboree is proud to celebrate its 32nd year. Bands are classified in three class sizes, A, AA, and AAA, based on the number of playing musicians. Bands of America scoring sheets are utilized by a panel of 10 caption judges. 1st, 2nd, and 3rd place awards are given to each class and an overall Grand Champion is also awarded to the highest scoring band. Individual awards are given for outstanding percussion, auxiliary, visual effect, and music. <br />\r\n<br />\r\n',NULL,25,NULL,0,'','8015 West 111th St., Palos Hills, IL 60465',0,'2011-09-04','dbalash'),(391,'Tiger Ambush Classic','2011-09-17',2011,'Edwardsville, IL','Marvin Battle','http://www.ecusd7.org/ehs/EHSstaff/mbattle/TAC_index.htm','The Tiger Ambush Classic is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by band size and compete for awards in Outstanding Winds, Percussion, Auxiliary, Drum Major, and Grand Champion. Judging is based on sheets designed by the Mid-America Marching Consortium.',NULL,31,NULL,0,'','6161 Center Grove Rd, Edwardsville, IL 62025',0,'2011-09-12','dbalash'),(393,'Watseka Marching Band Invitational','2011-09-17',2011,'Watseka, IL','Erik Parmenter','http://fs22.formsite.com/wchsband/form1/index.html','Watseka High School hosts their first annual marching band competition.  Bands will be judged based on band size with 1st, 2nd, and 3rd place in each class, as well as guard/percussion captions.  There will be an afternoon on-field clinic session for each band, with an evening field show.  Contact Mr. Parmenter at parmentere@watseka-u9.k12.il.us for more information.',NULL,169,NULL,0,'','138 S. Belmont Ave., Watseka, IL 60970 ',0,'2011-09-03','dbalash'),(394,'Wheaton North Falcon Marching Band Festival','2011-09-17',2011,'Wheaton, IL','Jon Noworyta','http://www.wnband.org/news/Festival.php','Trophies will be presented for first, second, and third place in Classes A, AA, and AAA. Overall caption awards presented for the event will include: Outstanding Visual Performance, Outstanding Musical Performance, Outstanding General Effect, and Outstanding Percussion. ','GE Visual: Chad Quamme<br />\r\nGE Music: Mark Ponzo, Todd Schultz<br />\r\nMusic Ensemble: Greg Clemmons<br />\r\nMusic Individual: John Apple<br />\r\nVisual Ensemble: Mike Marcantano<br />\r\nVisual Individual: Chris Owen<br />\r\nColor Guard: Chuck Cummings<br />\r\nPercussion: Dave Dombek<br />\r\nDrum Majors: Phil Rudd',1,NULL,0,'Outstanding Combined Color Guard: Lincoln-Way Central\r\nOutstanding Combined Drum Majors: Fremd','1 Falcon Way, Wheaton, IL 60187',0,'2011-09-12','dbalash'),(395,'Danville Viking Invitational','2011-09-24',2011,'Danville, IL','Brad Leeb','http://www.dhsimb.com/invitational%20main.htm','This is an afternoon/evening contest that divides bands by band size. Bands compete for awards in each division for placement, and captions (Winds, Percussion, Auxiliary, and Drum Major). A Grand Champion for the event is also awarded.',NULL,11,NULL,0,'','202 E. Fairchild, Danville, IL 61832 ',0,'2011-09-16','dbalash'),(396,'Mt. Zion Marching Music Games','2011-09-24',2011,'Mt. Zion, IL','Brianna Bjerke','http://www.mtzionbands.com/marchinggames.htm/','Mt. Zion Marching Braves presents the 7th Annual Marching Music Games. Highlights of the contest include excellent judges and critique, an afternoon parade and evening field competition under the lights, conveniently located warm-up fields, hospitality rooms and free meals for directors and staff, great concessions and competition based on band size. 1st, 2nd, 3rd place trophies in each class in parade and field show. Best in class trophies in each class in parade and field show (Best Drum Major, Best Drum Line, Best Auxiliary), Grand Champion regardless of class.',NULL,79,NULL,0,'','305 S. Henderson, Mt. Zion, IL 62549',0,'2011-09-16','dbalash'),(397,'Pontiac Indian Showdown','2011-09-24',2011,'Pontiac, IL','Keith Schmink','http://ww2.pontiac.k12.il.us/?page_id=1426','Bands will be competing in the 9th Annual Indian Showdown. Clinics begin at 1:00pm and the competition at 5:00pm.',NULL,89,NULL,0,'Scores out of 200 Points.','1100 Indiana Ave., Pontiac, IL 61764',0,'2011-09-12','dbalash'),(398,'Chicagoland Marching Band Festival','2011-09-24',2011,'Wheeling, IL','Brian Logan','http://www.wheelingbands.org','The Chicagoland Marching Band Festival (CMBF) hosted by Wheeling High School is Chicago\\\\\\\'s longest running marching band festival and is now celebrating its 44th year.',NULL,36,NULL,0,'','900 S. Elmhurst Road, Wheeling, IL 60090',0,'2011-09-10','dbalash'),(436,'Bands of America Regional Championships: Akron, OH','2011-10-15',2011,'Akron, OH','Bands of America','http://www.musicforall.org/what-we-do/marching/regionals/akron-oh-regional','Celebrating their 36th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\n<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.',NULL,NULL,'Fort Mill, SC',0,'','George Washington Boulevard & Triplett Avenue Akron, OH 44325',1,'2011-09-22','dbalash'),(401,'Naperville Central Marching Classic','2011-10-01',2011,'Lisle, IL','DJ Alstadt','http://www.nchsbands.info','Shows are scored on a modified system, with class placements, and a grand champion named.',NULL,19,NULL,0,'The 5A results were announced incorrectly at the competition due to a tabulation error.  The scores as posted above are correct.','5700 College Road, Lisle, IL 60532',0,'2011-09-17','moverholt'),(402,'Panther Marching Band Festival','2011-10-01',2011,'Charleston, IL','R. Alan Sullivan','http://www.eiu.edu/~marching_band/Panther%20Marching%20Band%20Festival.php','The 35th Annual Panther Marching Band Festival is an morning/afternoon/evening competition set to begin at 10:00 AM in O\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\'Brien Stadium on the campus of Eastern Illinois University.',NULL,23,NULL,0,'','600 Lincoln Ave., Charleston, IL 61920',0,'2011-09-26','dbalash'),(403,'St. Rita Mustang Stampede','2011-10-02',2011,'Chicago, IL','Cindy Gradek','http://stritahs.com/band/index.html','The Mustang Stampede is a marching band competition that is sponsored by the St. Rita High School Band and its Boosters. Over the years this competition has grown in size to accommodate over 20 of the areas finest bands.','',39,NULL,0,'','7740 S. Western Ave., Chicago, IL 60620',0,'2011-09-13','dbalash'),(404,'Prospect Knight of Champions','2011-10-08',2011,'Mt. Prospect, IL','Chris Barnum','http://www.prospectband.com/','The Prospect High School Band Boosters will be sponsoring the Knight of Champions marching band competition on Saturday, October 8, 2011 at Prospect High School. Bands will compete in three classes: A (up to 64 members), AA (65 to 96 members), and AAA (97 or more members). Awards presented will include first, second, and third place in Class A, AA, and AAA. Additional awards for Outstanding Percussion, Outstanding Auxiliary, Outstanding Music, Outstanding Visual and outstanding General Effect will be given to each class. Participation awards will be presented to all bands that perform. There will be caption-specific commentary and scoring, and an overall Grand Champion Traveling trophy. We will be utilizing a scoring system similar to Bands of America.','Dallas Niermeyer, Mark Ponzo, Pete Weber, Anthony Gnutek, Chuck Naffier, Chris Alexander, Rich Kemp, Kevin Lepper, Kirsten Young',22,NULL,0,'','801 W. Kensington Road, Mt. Prospect, IL 60056',0,'2011-09-13','dbalash'),(405,'Metamora Band Invitational','2011-10-08',2011,'Metamora, IL','Wally Parks','http://www.ilmarching.com','The 31th annual running of this contest features a great stadium for marching bands, and excellent well-rounded panel of adjudicators, and wonderful festival atmosphere throughout the day. The competition is one of the largest and oldest, continuous running, high school-sponsored competition in the state of Illinois. Attendees are usually drawn from Illinois, eastern Iowa, and western Indiana. Bands receive a DVD of their performance along with adjudicator tapes. Judging sheets are similar to BOA.','',92,NULL,0,'Note: We have not received the 4A-5A parade recap.  Therefore, we are assuming that Bloomington won the show.','101 W. Madison St., Metamora, IL 61548',0,'2014-01-26','dbalash'),(406,'McKendree Preview of Champions','2011-10-08',2011,'Lebanon, IL','Lester McQuaid','http://www.mckendree.edu/Department_of_Music/Preview_of_Champions.aspx/','Bands will compete on a lighted, Game Day turf field, in classes based on number of instrumentalists. Awards are given for 1st, 2nd, and 3rd place in each class and a Grand Champion Award. Caption awards for Outstanding Percussion, Color Guard, Music, and Visual are also given in each class. After each bands performance there will be a video review and clinician comments.',NULL,31,NULL,0,'','701 College Road, Lebanon, IL 62254',0,'2011-10-03','dbalash'),(407,'Marengo Settlers Days','2011-10-09',2011,'Marengo, IL','Todd Stellmach','http://www.mchs154.org/mchs/depts/activities/org.php?org=32','This annual competition plays host to some of the better bands in Illinois.',NULL,66,NULL,0,'','110 Franks Road, Marengo, IL 60152',0,'2011-10-03','dbalash'),(408,'Bands of America Super Regional Championships: St. Louis, MO','2011-10-15',2011,'St. Louis, MO','Bands of America','http://www.musicforall.org','Celebrating their 36th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','<b>Music:</b><br />\r\nGeorge Boulden<br />\r\nChip Crotts<br />\r\nMartin Griffin<br />\r\nJay Kennedy<br />\r\nChester Phillips<br />\r\nDavid Schaffer<br />\r\nW.L. Whaley<br />\r\nMarc Whitlock<br />\r\n<br />\r\n<b>Visual:</b><br />\r\nKen Giese<br />\r\nMichael Gray<br />\r\nNola Jones<br />\r\nKyle Miller<br />\r\nAdam Sage<br />\r\nBob Thomas<br />\r\n',NULL,'Broken Arrow, OK',0,'','701 Convention Plaza, St. Louis, MO 63101',1,'2011-09-28','dbalash'),(444,'Quincy Octoberfest Parade and Field Show','2011-10-15',2011,'Quincy, IL','Kathleen Dooley','http://www.ilmarching.com','The 16th annual Quincy Senior High Marching Band Parade & Field Competition will be held on Saturday,October 15, 2011 in Quincy, Illinois.  The competition features marching bands from Illinois, Iowa and Missouri.  The parade begins at 2:00 p.m. and the field competition<br />\r\nbegins at 5:15 p.m. at Flinn Stadium.  Bands will perform on the newly installed astroturf surface installed the 2011 summer in the stadium.  Bands may perform in either the parade or field competition individually or both.  Sweepstakes awards are presented by school size, musicianship levels and by state. More information is available at 217-224-3774.',NULL,NULL,'Mt. Pleasant, IA',0,'','3322 Maine St., Quincy, IL 62301',0,'2011-06-21','dbalash'),(410,'Effingham Marching Hearts Invitational','2011-10-15',2011,'Effingham, IL','Brad Wallace','http://effinghamband.org/','The Effingham Marching Hearts Invitational is an afternoon competition set to begin at 2:00pm, allowing bands to also attend the Newton Marching Eagles Band Classic which is a morning competition. For more information, email Brad Wallace at wallaceb@effingham.k12.il.us',NULL,23,NULL,0,'','1301 W. Grove, Effingham, IL 62401',0,'2011-10-13','dbalash'),(411,'Newton Marching Eagles Band Classic','2011-10-15',2011,'Newton, IL','Newton Band Boosters','http://www.marchingeagles.info/','The Newton Marching Eagle Band Boosters, along with Director Brian Ridlen and Assistant Director Jeffrey Finley invite you to participate at our 2011 Marching Eagles Band Classic. The morning of Saturday, October 15th will begin our competition. The Effingham Marching Hearts Invitational is set to begin at 2:00pm that same day. Effingham is approximately 30 miles west of Newton. What a great way to compete in two shows in one day!Please mark your calendars now to join us!! Bands will be classified based on school size. We will accommodate your schedule so that your band can compete at both shows.<br />\r\n','Color Guard: Sherri Wolfe<br />\r\nGeneral Effect: Carol Whitsitt<br />\r\nPercussion: Terrence Mayhue<br />\r\nMarching: Joe Wolfe<br />\r\nMusic: Doug Keiser',17,NULL,0,'','201 W. End Ave. Newton, IL 62448',0,'2011-10-06','dbalash'),(412,'Sandwich Musicfest','2011-10-16',2011,'Sandwich, IL','Justin Heinekamp','http://www.sandwich430.org/schools/shs/Band.htm','This show has a field and parade format.','',131,NULL,0,'','',0,'2013-02-05','dbalash'),(413,'Illinois Marching Band Championships Large Schools','2011-10-22',2011,'Champaign, IL','Barry Houser','http://bands.illinois.edu/content/IMBC-home','The University of Illinois Bands within the School of Music is proud to present the 2011 Illini Marching Band Championships.  Changes have been made to the competition, and it is hoped that the changes will make this the premier competition in the state of Illinois.','',36,NULL,0,'','1402 South 1st St., Champaign, IL 61820',0,'2014-10-07','dbalash'),(414,'Illinois Marching Band Championships Small Schools','2011-10-22',2011,'Champaign, IL','Barry Houser','http://bands.illinois.edu/content/IMBC-home','The University of Illinois Bands within the School of Music is proud to present the 2011 Illini Marching Band Championships.  Changes have been made to the competition, and it is hoped that the changes will make this the premier competition in the state of Illinois.','',26,NULL,0,'','1402 South 1st St., Champaign, IL 61820',0,'2014-10-07','dbalash'),(415,'Greater St. Louis Marching Band Festival','2011-10-22',2011,'St. Louis, Missouri','GSLMBF','http://www.gslmbf.com','The 40th Annual Greater St. Louis Marching Band Festival provides an opportunity for evaluation of outstanding high school marching bands in a first-class professional venue, the Edward Jones Dome which includes comfortable stadium seating, exhibits and indoor warm-up rooms.','<b>Blue and Silver Division</b><br><br />\r\n<b>Music:</b><br />\r\nGeorge Boulden<br />\r\nBeth Fabrizio<br />\r\nCarl Bly<br><br />\r\n<br />\r\n<b>Visual</b><br />\r\nKeith Baker<br />\r\nEric Sabach<br />\r\nKevin McNulty<br><br />\r\n<br />\r\n<b>Red and Gold Division</b><br><br />\r\n<b>Music:</b><br />\r\nBill Doyle<br />\r\nJoe Allison<br />\r\nRob James<br><br />\r\n<br />\r\n<b>Visual:</b><br />\r\nMarie Czapinski<br />\r\nTom McNally<br />\r\nEd Warren',31,NULL,0,'','701 Convention Plaza, St. Louis, MO 63101',0,'2011-10-17','dbalash'),(416,'Oblong Spooktacular','2011-10-29',2011,'Oblong, IL','Darnell Schalasky, Oblong Music Boosters','http://www.theonlyoblong.com/','Join us for the 16th annual Oblong Spooktacular band fest on October 30th!  There will also be a parade and drumline competition that your band can enter at no cost.',NULL,82,NULL,0,'Parade:\r\nJunior High Class AA:\r\n305 Casey-Westfield\r\n\r\nJunior High Class AAA:\r\n431 Nuttall (Marching/Music/Showmanship, Auxiliary)\r\n426 Mattoon (DM)\r\n420 Jasper County (Percussion)\r\n375 Vandalia\r\n\r\nJunior High Combined:\r\n414 Arcola (Marching/Music/Showmanship, Percussion, DM)\r\n382 Ramsey (Auxiliary)\r\n372 Palestine\r\n357 Hutsonville\r\n274 Martinsville\r\n\r\n<br>\r\nField Crowd Appeal: Charleston\r\nSpirit of Spooktacular (Parade Crowd Appeal Jr. High) Nuttall Middle School\r\nSpirit of Spooktacular (Parade Crowd Appeal High School) Rich Central\r\nParade Grand Champion Jr. High: Nuttall\r\nParade Grand Champion High School: Rich Central','700 S. Range St., Oblong, IL 62449',0,'2011-10-18','dbalash'),(417,'Pinckneyville Mardi Gras Field Show and Parade','2011-10-29',2011,'Pinckneyville, IL','Stephen Cannedy','http://web.mac.com/scannedy1/iWeb/scannedy1/Mardi%20Gras.html','The field show contest begins around 1:30 or 2:00 in the afternoon at the High School Football field.  Our average number of bands runs around 10-12 and we use 2 or 3 classes depending on how many bands we have. The cost for entering the field show is $100.00. The parade is at night beginning at 7:00 pm.  It is a huge crowd of people and with the event being close to Halloween, there are many dressed up people throughout the parade.  Awards are held after the parade at the fairgrounds.  We have a $500 grand champion award to the band with the highest combined score of parade and field.  In addition all parade bands get a check for $100 and we also have a $150 prize for the best parade band regardless of class.  $100 for 2nd and $50 additional for 3rd.',NULL,2,NULL,0,'','',0,'2011-10-20','dbalash'),(418,'Bands of America Regional Championships: Indianapolis, IN','2011-11-05',2011,'Indianapolis, IN','Bands of America','http://www.musicforall.org/what-we-do/marching/regionals/indianapolis-super-regional','Celebrating their 36th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.',NULL,NULL,'Avon, IN',0,'','500 South Capitol Avenue, Indianapolis, IN 46225',1,'2011-10-18','dbalash'),(419,'Limestone Marching Rockets Field Competition','2011-10-01',2011,'Bartonville, IL','Andy Empey','http://limestonebands.com/sub/2011-field-competition/','Limestone High School hosts their first annual field show competition.  They are accepting 20 bands with a BOA style judging format.  Afternoon and evening performances, and classification will be by band size.  Contact Andy Empey at aempey@limestone.k12.il.us for more information.<br />\r\n<br />\r\nHere is the judging panel:<br />\r\nVisual Ind.  Matt Heard  Cavaliers Drum and Bugle Corps<br />\r\nVisual Ens.   Kyle Adelman - Lincoln Way East High School<br />\r\nVisual GE  Ryan Miller  Legends Drum and Bugle Corps<br />\r\nMusic Ind.  Craig Fitzpatrick  Composer/Drill Writer;  Morton High School<br />\r\nMusic Ens.  Mark Ponzo  DCI; Trumpet Instructor  NIU<br />\r\nMusic GE  Dan Dietrich - Retired Director IVC<br />\r\nMusic GE  Andy Tye  - Composer/Drill Writer; Blue Stars Drum and Bugle Corps<br />\r\nColorguard  Dave Fairchild  Ofallon<br />\r\nPercussion  Dave Schmuck  Chicago Bears Drumline',NULL,18,NULL,0,'Best overall Auxiliary: Pekin\r\nBest Percussion: Illinois Valley Central\r\nBest Winds: IVC','4201 South Airport Rd., Bartonville, IL 61607',0,'2011-09-15','dbalash'),(422,'Bands of America Regional Championships: Pontiac, MI','2011-10-08',2011,'Pontiac, MI','Bands of America','http://www.musicforall.org/what-we-do/marching/regionals/pontiac-mi-regional','Celebrating their 36th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','Music:<br />\r\nScott-Lee Atchison<br />\r\nChris Hestin<br />\r\nMonte Mast<br />\r\nMark McGahey<br />\r\n<br />\r\nVisual:<br />\r\nKen Giese<br />\r\nJackie Gilley<br />\r\nTim Landess',NULL,'Harrison, GA',0,'','1200 Featherstone Road, Pontiac, MI 48342',1,'2011-09-19','dbalash'),(423,'Bands of America Regional Championships: Mason, OH','2011-10-01',2011,'Mason, OH','Bands of America','http://www.musicforall.org/what-we-do/marching/regionals/mason-oh-regional','Celebrating their 36th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\n<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.',NULL,NULL,'Centerville, OH',0,'','6100 Mason-Montgomery Rd., Mason, Ohio 45040 ',1,'2011-09-08','dbalash'),(424,'Marching Maroons Band Festival','2011-10-08',2011,'Robinson, IL','Joe Smith','http://www.rhsmarchingmaroons.com/','The Robinson High School Band will be hosting the Marching Maroons Band Festival on October 8, 2011. Judges from the Central State Judging Association will be utilized. <br />\r\n<br />\r\nGates open at 3pm, First Band Performs at 4:00.<br />\r\nAdmission: All Tickets $5, Children under 5 Free.<br />\r\nThere is also a parade that is non-competitive that begins at 1:30 PM at Robinson City Park.',NULL,NULL,'Vincennes Lincoln, IN',0,'Scores out of 1300.','2000 N. Cross, Robinson, IL 62454',0,'2011-09-22','dbalash'),(425,'Olympia Marching Spartans Invitational ','2011-09-10',2011,'Stanford, IL','Olympia Band Boosters','http://olympiamusicparents.org/','Join us as we celebrate 25 years of marching excellence at Olympia High School. This is a great way to get a feel for your competition season. If you would like to attend our competition, please fill out the attached registration form. Also note the Early Bird Discount if you get your registration and money in by June 1st. Hurry and register today to secure a spot for your group.<br />\r\n<br />\r\n If you have any questions please email or call my office and I hope to see you in September.<br />\r\n<br />\r\nFor more information in the coming weeks, please check out our soon to be launched and redesigned website OlympiaMusicParents.org.',NULL,88,NULL,0,'Percussion GC: Limestone','7832 North 100 East Road, Stanford, IL 61774',0,'2011-08-26','dbalash'),(426,'Sage City Invitational','2011-10-08',2011,'Monticello, IL','Alison Allender','http://www.ilmarching.com','This is an afternoon competition that is based on school size.  Trophies will be given for the following captions in each class: Drum Line, Winds, Auxillary and Drum Major.  1st, 2nd, and 3rd place trophies will be awarded for each class.  There will also be an Overall Drumline Trophy and Grand Champion.  We have a quality performance field, terrific concessions, outstanding judges and easy access via I-72.	',NULL,3,NULL,0,'','1 Sage Drive, Monticello, IL 61856',0,'2011-10-03','dbalash'),(427,'Washington Marching Panther Invitational','2011-09-17',2011,'Washington, IL','Jim Tallman','http://www.wchsband.org/','The 2010 Marching Panther Invitational is a high school parade and field marching competition. Bands will be grouped into classes based on band size and school size. This will be an afternoon / evening event! Trophies and plaques will be given for outstanding Drum Majors, Color Guard, Drumlines and Bands in each class for the Parade and Field Competitions.','',88,'',0,'Overall Percussion: Joliet West','115 Bondurant, Washington, IL 61571',0,'2012-03-28','dbalash'),(428,'Sandburg Marching Band Festival','2011-09-24',2011,'Orland Park, IL','Stewart Bailey','http://www.ilmarching.com','Although open to any high school band, the Sandburg Marching Band Festival is set-up primarily for bands that compete on a limited basis, or bands that do not normally compete. Each band receives a 1st, 2nd, or 3rd place rating (similar to IHSA organizational festival for concert band). Bands are evaluated on music and marching only. Directors receive all score and rating information. No scores are publicly announced. All bands receive a participation plaque/ trophy. Special guests will be the Eastern Illinois University Marching Band.',NULL,NULL,NULL,0,NULL,'13300 South LaGrange Road, Orland Park, IL 60462',0,'2011-08-02','dbalash'),(429,'Shelbyville Marching Festival','2011-10-22',2011,'Shelbyville, IL','Emma Burrows','http://www.ilmarching.com','Billed as a \\\\\\\"cheap alternative to University of Illinois.\\\\\\\"  Parade/field format.<br /><br />\r\n<br /><br />\r\nOverall awards are given to all participants in all classes, and \"best in class\" awards are given in each class for each caption, including \"Drum Major,\" \"Auxiliary,\" \"Percussion,\" and \"Music.\" Classes are determined by band size.<br />\r\n<br />\r\nFor more information, email Emma Burrows, director of bands at Shelbyville, at shsramband@gmail.com. ',NULL,79,NULL,0,'','1001 W. North 6th St., Shelbyville, IL 62565',0,'2011-10-19','dbalash'),(430,'Lincoln-Way Invitational','2011-10-22',2011,'Frankfort, IL','Clifton Smith','http://www.lwemusic.org','This year\\\\\\\\\\\\\\\'s event will be held at Lincoln-Way East High School. Schools will be classified according to band size with awards in each class consisting of Outstanding Musical Performance, Outstanding Visual Performance, Outstanding General Effect, Outstanding Percussion and Outstanding Auxiliary.','Music Individual: Huei Pan<br />\r\nMusic Ensemble: Dr. Gregg Gausline<br />\r\nMusic Effect: Ken Snoeck<br />\r\nMusic Effect: Marc Mueller<br />\r\nPercussion: Adam Clay<br />\r\nVisual Individual: Jordan Warfield<br />\r\nVisual Ensemble: Michael Lentz<br />\r\nVisual Effect: James Vitagliano<br />\r\nColor Guard: Alan Spaeth',25,NULL,0,'','201 Colorado Ave., Frankfort, IL 60423',0,'2013-01-29','dbalash'),(431,'SIU Music & Motion','2011-10-01',2011,'Carbondale, IL','Dr. George Brozak','http://marchingsalukis.siuc.edu/motion.html','On behalf of Southern Illinois University Bands and Intercollegiate Athletics, we are pleased to announce the revival of the Music & Motion Marching Band Festival here at SIU!  The event has been on hiatus for a few years during our transition to the new stadium; but our wonderful facilities are complete, and we can\\\'t wait to share them with you, your students and their families.  Music & Motion 2011 will take place on Saturday, October 1 in the new Saluki Stadium.  You will be pleased to know that we have worked cooperatively with Barry Houser at Eastern Illinois to avoid direct scheduling against their contest <br />\r\nallowing those of you wishing to take part in both festivals the opportunity to do so.  To that end, Music & Motion will begin at 10:00 AM. <br />\r\nWe will employ a traditional 9-member judging panel, with awards in each class (including percussion, drum major and color guard).  Each band will also receive a beautiful, custom-made participation award.  Classes will be determined by band size.<br />\r\n<br />\r\nFor those of you who wish to promote a non-competitive philosophy, we are pleased to help.  Our Festival Class will provide feedback on your performance with positive, encouraging comments to the members of your band.',NULL,85,NULL,0,'','1255 Lincoln Drive, Carbondale, IL 62901',0,'2011-09-21','dbalash'),(432,'WIU Marching Band Classic','2011-10-29',2011,'Macomb, IL','Matt Thomas','http://www.wiu.edu/bands/events/athletic/classic/schedule.jsp','The 30th annual Western Illinois University Marching Band Classic will feature some of the finest west-central and central Illinois high school bands in field competition on the WIU-Macomb campus. The classic kicks off with the National Anthem at 4 PM on Hanson Field; the awards ceremony is scheduled for 8:10 PM. In between there will be field competition in a two division championship format: small school (Classes 1A, 2A) and large school (Classes 3A, 4A). Overall champion trophies will be awarded in each division and to the top three bands in each class. The best drum major(s), percussion, winds and auxiliaries in each division also will receive trophies.',NULL,57,NULL,0,'A/AA Grand Champion: Macomb\r\nAAA/AAAA Grand Champion: Dunlap','1 University Circle, Macomb, IL 61455',0,'2011-10-24','dbalash'),(433,'Mahomet-Seymour Marching Bulldog Festival','2011-10-29',2011,'Mahomet, IL','Michael Stevens','http://www.ilmarching.com','This show pits some of the best bands in Illinois in a class format, a winner for each class.',NULL,41,NULL,0,'','302 W. State St., Mahomet, IL 61853',0,'2011-10-20','dbalash'),(435,'Red & Black Fall Classic','2011-10-01',2011,'DeKalb, IL','Rick Valenzuela','http://www.regiment.org/bands','The Phantom Regiment Marching Band Festival will be held at Northern Illinois University in conjunction with the Huskie Marching Band.  Adjudicators and clinicians from across the country will be judging, including past and present BOA judges, utilizing BOA sheets.<br />\r\n<br />\r\nThe competition will start at 1:30 P.M.  Tickets will cost $12 for adults, $7 for students, and $30 for a family pack.','',36,NULL,0,'','1201 North Stadium Drive, DeKalb, IL 60115',0,'2012-03-12','dbalash'),(438,'Geneseo Maple Leaf Classic','2011-09-24',2011,'Geneseo, IL','Steve Scherer','http://www.gcsdblogs.org/scherer/','Educational format. Each band will receive a one hour clinic from an expert adjudicator with cross-caption expertise. After the clinics, the bands will compete in class competition based on band size. The competition is in the evening under the lights. ','Music: Victor Bianchetta, Jerry Robertson, Gregg Neuleib<br />\r\nVisual: John Burns, Chris Chiavola, Keith Baker<br />\r\nPercussion: Dean Adamczyk<br />\r\nColor Guar