ffect, percussion, guard, and drum major will be awarded.<br />\r\n<br />\r\nNew for 2012, Grand Champion and Spirit trophies will be awarded for Small Class (1A and 2A combined) and Large Class (3A and 4A) divisions. <br />\r\n<br />\r\n<b>Please note:</b> Class 1A has been split into 2 separate divisions.  The first 7 bands in 1A are in Division 1, the last 8 bands are Division 2.  Each Division will have separate awards. ','<b>Music Performance</b>: Bob Stiehl<br />\r\n<b>Music Performance</b>: Kyle Weirich <br />\r\n<b>Visual Performance</b>: Ryan Alm     <br />\r\n<b>General Effect Music</b>: Dave Knowlton<br />\r\n<b>General Effect Visual</b>: Jo Smith<br />\r\n<b>Percussion</b>: Ian Shepherd<br />\r\n<b>Guard/Auxiliary</b>: Mark Martin   <br />\r\n<b>Drum Major</b>: Kim Breen',23,NULL,0,'The bands listed in Class 2A on this scoresheet were referred to as \"Class A, Division 2\" at the festival.\r\n<br>\r\nSmall School Division Champion: Mater Dei.','600 Lincoln Ave., Charleston, IL 61920',0,'2012-09-17','dbalash'),(447,'Youth in Music Marching Band Championship','2011-10-22',2011,'Minneapolis, MN','Brent Turner','http://www.youthinmusic.org/','Youth in Music would like to invite you to participate in the Annual Marching Band Championship at the Hubert H. Humphrey Metrodome. This championship event will be adjudicated by a national level judging panal, and is open to any high school marching band. Grouped can participate in one of four classes: A, AA, AAA and Exhibition.<br />\r\n<br />\r\nOur goal is to provide your students with a first-rate performance experience! All bands will receive critique from a qualified panel of national level judges and educators, as well as a videocassette of their performance.','',NULL,'Rosemount, MN',0,'','900 South 5th Street, Minneapolis, Minnesota 55415',1,'2011-10-17','dbalash'),(448,'Lake Park Lancer Joust','2012-09-08',2012,'Roselle, IL','Mike Chiodo','http://www.lancerjoust.com/','The Annual Lancer Joust will feature bands from Indiana, Iowa, Wisconsin and Illinois. The competition is an afternoon/evening event in preliminary and final competition format. Preliminary competition is in Class by band size.','Lake Park judging panel:<br />\r\n<br />\r\n<b>Music:</b><br />\r\nJohn Bell<br />\r\nGary Markham<br />\r\nChuck Naffier<br />\r\nMark Ponzo<br />\r\n<b>Visual:</b><br />\r\nChris Considine<br />\r\nRon Hardin<br />\r\nEric Sabach<br />\r\n<b>Percussion:</b><br />\r\nJoe Roach<br />\r\n<b>Color Guard:</b><br />\r\nJohn Leonard<br />\r\n<b>Timing and Penalties:</b><br />\r\nFrank Bischoff<br />\r\n<b>Announcer:</b><br />\r\nCam Stasa',36,NULL,0,'','500 W. Bryn Mawr, Roselle, IL 60172',1,'2012-09-03','dbalash'),(449,'A.A. Stagg Jamboree','2012-09-08',2012,'Palos Hills, IL','Robert Mecozzi','https://sites.google.com/site/staggmusicboosters2/primary-events/jamboree','The Stagg Marching Band Jamboree is proud to celebrate its 33rd year. Bands are classified in three class sizes, A, AA, and AAA, based on the number of playing musicians. Bands of America scoring sheets are utilized by a panel of 10 caption judges. 1st, 2nd, and 3rd place awards are given to each class and an overall Grand Champion is also awarded to the highest scoring band. Individual awards are given for outstanding percussion, auxiliary, visual effect, and music. <br />\r\n<br />\r\n','<b>Music Performance Indiviudal:</b> Mike Madonia<br />\r\n<b>Music Performance Ensemble:</b> Jeff Waggoner<br />\r\n<b>Visual Performance Individual:</b> Chris Owen<br />\r\n<b>Visual Performance Ensemble:</b> Kevin McNulty<br />\r\n<b>Music General Effect 1</b>: Dan Romano<br />\r\n<b>Music General Effect 2:</b> Jerry Robertson<br />\r\n<b>Visual General Effect:</b> Chad Quamme<br />\r\n<b>Percussion:</b> Mark Eichenberger<br />\r\n<b>Auxiliary:</b> Dan Swallow<br />\r\n<b>Timing/Penalties/Drum Major:</b> Brandon Lewis<br />\r\n<b>Tabulator:</b> Kate Alstadt',91,NULL,0,'Reavis High School performed in exhibition.','8015 West 111th S