fingham Marching Hearts Invitational','2012-10-20',2012,'Effingham, IL','Brad Wallace','http://effinghamband.org/','The Effingham Marching Hearts Invitational is an afternoon competition set to begin at 2:00pm, allowing bands to also attend the Newton Marching Eagles Band Classic which is a morning competition. For more information, email Brad Wallace at wallaceb@effingham.k12.il.us','<b>Music 1:</b> Allan Horney<br />\r\n<b>Music 2:</b> Dan Dietrich<br />\r\n<b>Marching 1:</b> David Boggs<br />\r\n<b>Marching 2:</b> Bernie Potter<br />\r\n<b>General Effect:</b> Jo Smith<br />\r\n<b>Percusion:</b> Peter Hussey<br />\r\n<b>Drum Major:</b><br />\r\n<b>Auxiliary:</b> Dan Swallow<br />\r\n',11,NULL,0,'','1301 W. Grove, Effingham, IL 62401',0,'2012-10-09','dbalash'),(479,'Pinckneyville Mardi Gras Field Show and Parade','2012-10-27',2012,'Pinckneyville, IL','Stephen Cannedy','http://web.mac.com/scannedy1/iWeb/scannedy1/Mardi%20Gras.html','The field show contest begins around 1:30 or 2:00 in the afternoon at the High School Football field.  Our average number of bands runs around 10-12 and we use 2 or 3 classes depending on how many bands we have. The cost for entering the field show is $100.00. The parade is at night beginning at 7:00 pm.  It is a huge crowd of people and with the event being close to Halloween, there are many dressed up people throughout the parade.  Awards are held after the parade at the fairgrounds.  We have a $500 grand champion award to the band with the highest combined score of parade and field.  In addition all parade bands get a check for $100 and we also have a $150 prize for the best parade band regardless of class.  $100 for 2nd and $50 additional for 3rd.<br />\r\n','<b>Parade:</b><br />\r\nMike Hanes-Carbondale, IL<br />\r\nDavid Drillinger-Alton, IL<br />\r\nDarrell Cannedy-Raymond, IL<br />\r\n<br><br />\r\n<b>Field:</b><br />\r\nMike Hanes - Retired Director of Bands at SIUC<br />\r\nDavid Drillinger - Retired Band Director, Alton, IL<br