8',0,'2012-10-04','dbalash'),(500,'Mahomet-Seymour Marching Bulldog Festival','2012-10-20',2012,'Mahomet, IL','Michael Stevens','http://www.msmusicboosters.org','Easy Access to Competition  3 Major Interstates Nearby<br />\r\nLined Warm-up Field with P.A. System<br />\r\nQuality Performance Field and Stadium w/ seating for 2000+<br />\r\nIndoor Facilities in Case of Rain<br />\r\nFantastic Food / Outstanding Judges.','',39,NULL,0,'','302 W. State St., Mahomet, IL 61853',0,'2012-10-11','dbalash'),(501,'Bands of America Regional Championships: Cincinnati, OH','1996-09-20',1996,'Cincinnati, Ohio','Bands of America','http://www.musicforall.org','','',19,NULL,0,'','2600 Clifton Ave., Cincinnati OH 45221',1,'2012-10-21','moverholt'),(502,'Bands of America Regional Championships: Indianapolis, IN','1996-11-02',1996,'Indianapolis, IN','Bands of America','http://www.musicforall.org','','',19,NULL,0,'','500 South Capitol Avenue, Indianapolis, IN 46225',1,'2012-10-21','moverholt'),(503,'Youth in Music Marching Band Championship','2012-10-13',2012,'Minneapolis, MN','Brent Turner','http://www.youthinmusic.org/','Youth in Music would like to invite you to participate in the Annual Marching Band Championship at the Hubert H. Humphrey Metrodome. This championship event will be adjudicated by a national level judging panal, and is open to any high school marching band. Grouped can participate in one of four classes: A, AA, AAA and Exhibition.<br /><br />\r\n<br /><br />\r\nOur goal is to provide your students with a first-rate performance experience! All bands will receive critique from a qualified panel of national level judges and educators, as well as a videocassette of their performance.','',NULL,'Rosemount, MN',0,'','900 South 5th Street, Minneapolis, Minnesota 55415',0,'2012-10-04','dbalash'),(504,'Dwight Harvest Days Parade and Field Show','2012-09-23',2012,'Dwight, IL','Richard Benzik','http://www.dwightharvestdays.org/FieldShow.htm','This annual competition is held in conjunction with the Dwight Harvest Days. There is a parade that begins at 1:00, and the field show begins at approximately 4:30. Trophies are given out for 1st and 2nd place in each class as well as caption awards. The overall Grand Champion will be the band with the highest combined field and parade scores.','',NULL,NULL,0,NULL,'801 S. Franklin, Dwight, IL 60420',0,'2012-09-17','dbalash'),(505,'Oblong Spooktacular','2012-10-27',2012,'Oblong, IL','Lisa Lockhart, Oblong Music Boosters','http://www.theonlyoblong.com/','The Oblong Music Boosters want to invite you to the 17th annual band competition and the largest nighttime parade in the state of Illinois with an average of 10-16 bands for the field competition and about 25-30 for the parade.  After the parade, we invite the bands back to the high school for a big dance on the field with a DJ.  For a registration form or for more info, please contact Lisa Lockhart at LKaiLeiLockhart@gmail.com.','',82,NULL,0,'Parade:\r\n\r\nJunior High Class A:\r\n1) 183.0 - St. Thomas (Music/Marching/Showmanship, Perc, DM)\r\n2) 116.00 - Red Hill\r\n\r\nJunior High Class AA:\r\n1) 242.00 - Mt. Carmel (Perc, Aux, DM)\r\n2) 190.00 - Casey-Westfield (Music/Marching/Showmanship)\r\n\r\nJunior High Class AAA:\r\n1) 274.50 - Mattoon (Perc, Aux)\r\n2) 273.50 - Jasper County (DM)\r\n3) 272.00 - Nuttall Middle (Music/Marching/Showmanship)\r\n','700 S. Range St., Oblong, IL 62449',0,'2012-10-23','dbalash'),(506,'Kingsmen Carnival of Bands','2012-09-22',2012,'Mishawaka, IN','Glenn Northern','http://band.phmschools.org/','This annual early season show pits some of the best Northern Indiana bands head to head.','',NULL,'Homestead, IN',0,'','56100 Bittersweet Rd, Mishawaka, IN 46545',0,'2012-09-13','dbalash'),(507,'Mukwonago Phantom Phest','2012-09-15',2012,'Mukwonago, WI','Tom Gard','https://docs.google.com/document/d/1JzCWg-P58f8pY_PgxAYS-EGEuX3JgaqaId7e9edspPU/edit','More information to come.','',NULL,'Waukesha North, WI',0,'Best Auxiliary: Waukesha North\r\nBest Percussion: Waukesha North','605 West School Road  Mukwonago, WI 53149',0,'2012-09-11','dbalash'),(508,'McHenry High School Marching Festival','2012-09-08',2012,'McHenry, IL','Brian Weidner','http://www.edline.net/pages/McHenry_HS_West_Campus/Activities/MCHS_Bands','The McHenry High School Marching Band Festival is a non-competitive clinic for high school marching bands.  Our panel includes distinguished university, high school, and drum corps directors and creative members.  Each band performs a festival show on the main field receiving tapes and response sheets in open caption areas as well as percussion and auxiliary.  These performances are open the public.  Following the performance, bands move to an auxiliary field for a 25 minute clinic with a member of our adjudication panel.','',NULL,NULL,0,NULL,'4724 W. Crystal Lake Rd., McHenry, IL 60050',0,'2012-08-28','dbalash'),(509,'Sage City Invitational','2012-09-22',2012,'Monticello, IL','Alison Allender','http://sages.us/sagesmusic/','This is an afternoon competition that is based on school size.  Trophies will be given for the following captions in each class: Drum Line, Winds, Auxillary and Drum Major.  1st, 2nd, and 3rd place trophies will be awarded for each class.  There will also be an Overall Drumline Trophy and Grand Champion.  We have a quality performance field, terrific concessions, outstanding judges and easy access via I-72.	','',155,NULL,0,'','1 Sage Drive, Monticello, IL 61856',0,'2012-09-17','dbalash'),(511,'Bands of America Regional Championships: St. Louis, MO','2001-10-13',2001,'St, Louis, MO','Bands of America','http://www.musicforall.org','','',19,'',0,'','901 North Broadway, St. Louis, MO 63101',1,'2012-05-17','dbalash'),(512,'Bands of America Regional Championships: Toledo, Ohio','2001-09-22',2001,'Toledo, Ohio','Bands of America','http://www.musicforall.org','','',36,NULL,0,'','2801 West Bancroft Street Toledo, OH 43606',1,'2012-05-18','dbalash'),(513,'Bands of America Regional Championships: Indianapolis, IN','2001-11-03',2001,'Indianapolis, IN','Bands of America','http://www.musicforall.org','','',NULL,'Carmel, IN',0,'','500 South Capitol Avenue, Indianapolis, IN 46225',1,'2012-05-18','dbalash'),(516,'Bands of America Regional Championships: Toledo, Ohio','2000-09-23',2000,'Toledo, Ohio','Bands of America','http://www.musicforall.org','','',NULL,'Centerville, OH',0,'Finals was rained out.  Centerville, Ohio was named regional champions due to winning prelims.','2801 West Bancroft Street Toledo, OH 43606',0,'2012-06-30','dbalash'),(517,'Bands of America Regional Championships: Indianapolis, IN','2000-11-04',2000,'Indianapolis, IN','Bands of America','http://www.musicforall.org','','',NULL,NULL,0,NULL,'500 South Capitol Avenue, Indianapolis, IN 46225',0,'2012-07-01','dbalash'),(519,'Bands of America Grand National Championships','2002-11-14',2002,'Indianapolis, IN','Bands of America','http://www.musicforall.org','This is the premier marching band event of the season. 90 of the nation\\\'s best marching bands compete in Indianapolis at the Lucas Oil Stadium in a prelims/semifinals/finals event. Bands are arranged by school size in prelims and semifinals, and class champions are awarded in A, AA, AAA, and AAAA. The 12 top bands move on to finals, and they compete head to head for the prestigious Grand Nationals trophy.','',NULL,'Lassiter, GA',0,'<b>Class A Semifinals:</b><br>\r\n1. Norwell, IN<br>\r\n2. Jackson Academy, MS<br>\r\n3. Bassett, VA<br>\r\n\r\n<b>Class AA Semifinals:</b><br>\r\n1. Avon, IN<br>\r\n2. Bellbrook, OH<br>\r\n3. Kings, OH<br>\r\n\r\n<b>Class AAA Semifinals:</b><br>\r\n1. Lassiter, GA<br>\r\n2. Marian Catholic<br>\r\n3. Center Grove, IN<br>','500 South Capitol Avenue, Indianapolis, IN 46225',1,'2012-07-20','dbalash'),(520,'Bands of America Regional Championships: Indianapolis, IN','2002-11-09',2002,'Indianapolis, IN','Bands of America','http://www.musicforall.org','','',NULL,'Lawrence Central, IN',0,'','500 South Capitol Avenue, Indianapolis, IN 46225',1,'2012-07-20','dbalash'),(522,'Olympian Marching Band Festival','2012-10-20',2012,'Olympia Fields, IL','Phillip Crews','http://www.ilmarching.com','The Olympian Marching Band and Drumline Festival is a band sized contest that features both corps and traditional style marching bands.  The festival begins at 3:00pm and can accomodate bands that need evening performance times.','',NULL,NULL,0,NULL,'3600 W. 203rd St., Olympia Fields, IL 60461',0,'2012-10-15','dbalash'),(524,'Warrior Pride Invitational','2012-10-20',2012,'Danville, IN','Adrian Hartsough','http://www.danvillewarriorbands.com/warriorprideinvite.htm','Band directors: Looking for a show on October 20th?  Why not compete at Danville High School in Indiana?  Bands will be judged on ISSMA judging sheets, sorted by school size.  The enrollment fee is $200, <b>with a $50 discount for any bands traveling more than 120 miles!</b> For more information, contact Adrian Hartsough, director of bands at ahartsough@danville.k12.in.us, and to submit your entry, visit http://www.danvillewarriorbands.com/warriorprideinvite.htm','<b>Music Individual:</b>: Doug Fletcher <br />\r\n<b>Music Ensemble</b>: Jon Sutton <br />\r\n<b>Visual Individual</b>: Aaron Pitman<br />\r\n<b>Visual Ensemble</b>: Amy Fletcher <br />\r\n<b>Music General Effect</b>: Gary Wishmeyer <br />\r\n<b>Visual General Effect</b>: Tom Hillenbrand<br />\r\n<b>Color Guard</b>: Randy Rothbauer<br />\r\n',NULL,'Edgewood, IN',0,'Plymouth and Carroll chose to compete in exhibition.<br>\r\nForest Park did not compete due to winning Class A at the Bands of America Indianapolis Super Regional.','100 Warrior Way, Danville, IN 46122',0,'2012-10-15','dbalash'),(525,'Goshen Marching Band Festival','2006-09-09',2006,'Goshen, IN','N/A','N/A','','',22,NULL,0,'','N/A',0,'2012-09-07','dbalash'),(526,'SIU Music & Motion','2013-10-05',2013,'Carbondale, IL','Dr. George Brozak','http://marchingsalukis.siuc.edu/motion.html','Music & Motion 2013 will take place on Saturday, October 5 in the new Saluki Stadium. <br />\r\n<br />\r\nWe will employ a traditional 9-member judging panel, with awards in each class (including percussion, drum major and color guard).  Each band will also receive a beautiful, custom-made participation award.  Classes will be determined by band size.<br />\r\n<br />\r\nFor those of you who wish to promote a non-competitive philosophy, we are pleased to help.  Our Festival Class will provide feedback on your performance with positive, encouraging comments to the members of your band.','',NULL,NULL,0,NULL,'1255 Lincoln Drive, Carbondale, IL 62901',0,'2013-10-01','dbalash'),(527,'WIU Marching Band Classic','2013-10-19',2013,'Macomb, IL','Matt Thomas','http://www.wiu.edu/cofac/bands/ensembles/marching_band/marching_band_classic.php','The 32nd annual Western Illinois University Marching Band Classic will feature some of the finest west-central and central Illinois high school bands in field competition on the WIU-Macomb campus. The classic kicks off with the National Anthem at 4 PM on Hanson Field; the awards ceremony is scheduled for 8:10 PM. In between there will be field competition in a two division championship format: small school (Classes 1A, 2A) and large school (Classes 3A, 4A). Overall champion trophies will be awarded in each division and to the top three bands in each class. The best drum major(s), percussion, winds and auxiliaries in each division also will receive trophies.','Russ Gavin--Baylor University/Corps Director, Blue Stars<br />\r\nLarry Clark--Carl Fischer Music<br />\r\nDaniel Schmidt--Northern Arizona University<br />\r\nGeorge Boulden--University of Kentucky<br />\r\nJim Daughters--University of Kentucky<br />\r\nDan Swallow--(guard) Chiddix Junior High/Illinois Wesleyan University<br />\r\nBrandon Estes--(percussion) Naperville Central High School',9,NULL,0,'','1 University Circle, Macomb, IL 61455',0,'2013-10-15','dbalash'),(528,'Illinois State University Invi