out the area<br />\r\nNewly installed artificial turf on Matt Seffner Field<br />\r\nA well-organized band competition that is \\\"performer friendly\\\"<br />\r\nEsteemed adjudication panel<br />\r\nGreat selection of food at our concession stand<br />\r\n','',22,NULL,0,'','1800 W. Lincoln Hwy., New Lenox, IL 60451',0,'2013-09-27','dbalash'),(532,'Normal West Marching Band Invitational','2013-09-21',2013,'Bloomington, IL','Lisa Preston','https://sites.google.com/site/nwmbinvitational/','Performance times in the afternoon/evening.<br />\r\n<br />\r\nCompetitive classes will be determined by band size, and we are pleased to offer a noncompetitive class which will provide adjudicator feedback for groups who do not wish to be scored.<br />\r\n<br />\r\nThe Invitational will be held at Illinois Wesleyan University\\\\\\\'s Tucci Stadium at Wilder Field, the fifth oldest football stadium in the NCAA.  New artificial turf was installed at Tucci Stadium in 2011.<br />\r\n<br />\r\nFor additional information, contact the Normal West band directors:<br />\r\nLisa Preston (prestols@unit5.org) and Ryan Budzinski (budzinsr@unit5.org)','<b>Announcer:</b> Camilla M. Stasa<br />\r\n<b>Music Individual:</b> Dan Romano<br />\r\n<b>Music Ensemble:</b> John Bixby<br />\r\n<b>Visual Individual:</b> Johnnie Green<br />\r\n<b>Visual Ensemble:</b> Keith Baker<br />\r\n<b>Music General Effect:</b> Kent Baker<br />\r\n<b>Music General Effect:</b> Timothy Yontz<br />\r\n<b>Visual General Effect:</b> Greg Marquis<br />\r\n<b>Percussion:</b> David Knowlton<br />\r\n<b>Auxiliary</b> Dan Swallow',26,NULL,0,'1A/2A Grand Champion: Pontiac','1312 Park Street Bloomington, IL 61701',0,'2013-09-14','dbalash'),(533,'Morton Marching Invitational','2013-09-14',2013,'Morton, IL','Jeff Neavor','http://www.mortonbands.org/marching/pumpkinfest.php','The field show competition, hosted by Morton High School, is held during the City of Morton Pumpkin Festival.','<b>Music Individual:</b> Kyle Adelmann<br />\r\n<b>Music Ensemble:</b> Kevin McNulty<br />\r\n<b>Visual Individual:</b> Pete Weber<br />\r\n<b>Visual Ensemble:</b> Keith Baker<br />\r\n<b>Music GE 1:</b> Mark Ponzo<br />\r\n<b>Music GE 2:</b> Andy Cook<br />\r\n<b>Visual GE:</b> Alan Spaeth<br />\r\n<b>Guard:</b> Tim Coady<br />\r\n<b>Percussion:</b> Phillip Beale ',92,NULL,0,'','350 N. Illinois St., Morton, IL 61550',0,'2014-01-14','dbalash'),(534,'Effingham Marching Hearts Invitational','2013-10-19',2013,'Effingham, IL','Peter Manzi','http://effinghamband.org/','The Effingham Marching Hearts Invitational is an afternoon competition set to begin at 2:00pm, allowing bands to also attend the Newton Marching Eagles Band Classic which is a morning competition. For more information, email Peter Manzi at manzip@u40gw.effingham.k12.il.us','<b>Music 1-</b>Joe Manfredo<br />\r\n<b>Music 2-</b>David Allen<br />\r\n<b>Marching Execution 1-</b> Dan Romano<br />\r\n<b>Marching Execution 2-</b> Keith Baker<br />\r\n<b>General Effect-</b>Jo Smith<br />\r\n<b>Percussion-</b>Peter Hussey<br />\r\n<b>Color Guard-</b> Caryn Vanderbilt<br />\r\n<b>Drum Majors-</b>Kimberly Breen ',11,NULL,0,'','1301 W. Grove, Effingham, IL 62401',0,'2013-10-02','dbalash'),(535,'Chicagoland Marching Band Festival','2013-09-21',2013,'Wheeling, IL','Brian Logan','https://sites.google.com/site/whsbandsil/cmbf','<b></b>The Chicagoland Marching Band Festival (CMBF) hosted by Wheeling High School is Chicago\'s longest running marching band festival and is now celebrating its 46th year.','<b>MUSIC INDIVIDUAL:</b> David Foder<br />\r\n<b>MUSIC ENSEMBLE:</b> Kevin McNulty<br />\r\n<b>VISUAL INDIVIDUAL:</b> Pete Weber<br />\r\n<b>VISUAL ENSEMBLE:</b> Gary Czapinski<br />\r\n<b>GE MUSIC #1:</b> Dallas Niermeyer<br />\r\n<b>GE MUSIC #2:</b> Dave Morrison<br />\r\n<b>GE VISUAL:</b> Tim Guare<br />\r\n<b>PERCUSSION:</b> Dave Dombeck<br />\r\n<b>AUXILIARY:</b> Lorenzo Medrano',106,'',0,'','900 S. Elmhurst Road, Wheeling, IL 60090',0,'2013-09-09','dbalash'),(536,'Pontiac Indian Showdown','2013-09-14',2013,'Pontiac, IL','Keith Schmink','http://libguides.pontiac.k12.il.us/content.php?pid=425813&sid=3485892','Bands will be competing in the 10th Annual Indian Showdown. Clinics begin at 1:00pm and the competition at 5:00pm.','',45,NULL,0,'','1100 Indiana Ave., Pontiac, IL 61764',0,'2013-09-02','dbalash'),(537,'Tiger Ambush Classic','2013-09-21',2013,'Edwardsville, IL','Marvin Battle','http://mbattl8.wix.com/tiger-ambush-classic','The Tiger Ambush Classic is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by band size and compete for awards in Outstanding Winds, Percussion, Auxiliary, Drum Major, and Grand Champion. Judging is based on sheets designed by the Mid-America Marching Consortium.','<b>Music Individual:</b> Dr. John Bell<br />\r\n<b>Music Ensemble:</b> Dr. David Snyder<br />\r\n<b>Music GE:</b> James Haskell<br />\r\n<b>Visual Ensemble:</b> Robert Berry<br />\r\n<b>Visual GE:</b> Jo Smith<br />\r\n<b>Color Guard:</b> Billy Saccomanno<br />\r\n<b>Percussion:</b> Chad Schaedler',31,NULL,0,'','6161 Center Grove Rd, Edwardsville, IL 62025',0,'2013-09-14','dbalash'),(538,'Bands of America Grand National Championships','2014-11-12',2014,'Indianapolis, IN','Bands of America','http://www.musicforall.org','This is the premier marching band event of the season. 90 of the nation\'s best marching bands compete in Indianapolis at the Lucas Oil Stadium in a prelims/semifinals/finals event. Bands are arranged by school size in prelims and semifinals, and class champions are awarded in A, AA, AAA, and AAAA. The 12 top bands move on to finals, and they compete head to head for the prestigious Grand Nationals trophy.','',NULL,'Tarpon Springs, FL',0,'','500 South Capitol Avenue, Indianapolis, IN 46225',1,'2014-11-15','dbalash'),(539,'Marching Vandals Invitational','2013-10-05',2013,'Vandalia, IL','Tony Hicks','https://sites.google.com/site/vandaliahighschoolband/my-forms','This is Parade and Field Competition, classified by band size.  The Parade Competition will take place at 11:00 AM, followed by a Field Competition at 1:00 PM. It is a major fundraiser for the Vandalia Band Boosters. Awards will be given for the captions of Drum Major, Percussion, Color Guard, Crowd Appeal, Overall in class, and Grand Champion Overall. We will have great judges that will help you get ready for your late competition season.<br />\r\n<br />\r\nVandalia is located 55 miles east of St. Louis and 35 miles West of Effingham on I-70.','Music- Clifford Jourdan<br />\r\nMusic- Dr. Kenneth Steinsultz<br />\r\nMarching- Will Fairbanks<br />\r\nGeneral Effect- Greg Allen<br />\r\nDrum Major- Emma Burrows<br />\r\nPercussion- Daniel Smithiger<br />\r\nColor Guard- Angi Black',3,NULL,0,'','1109 N. Eighth St., Vandalia, IL 62471',0,'2013-10-01','dbalash'),(540,'Pinckneyville Mardi Gras Field Show and Parade','2013-10-26',2013,'Pinckneyville, IL','Stephen Cannedy','http://web.mac.com/scannedy1/iWeb/scannedy1/Mardi%20Gras.html','The field show contest begins around 1:30 or 2:00 in the afternoon at the High School Football field.  Our average number of bands runs around 10-12 and we use 2 or 3 classes depending on how many bands we have. The cost for entering the field show is $150.00. The parade is at night beginning at 7:00 pm.  It is a huge crowd of people and with the event being close to Halloween, there are many dressed up people throughout the parade.  Awards are held after the parade at the fairgrounds.  We have a $500 grand champion award to the band with the highest combined score of parade and field.  In addition all parade bands get a check for $100 and we also have a $150 prize for the best parade band regardless of class.  $100 for 2nd and $50 additional for 3rd.<br /><br />\r\n','',2,NULL,0,'','600 E. Water St., Pinckneyville, IL 62274',0,'2013-10-22','dbalash'),(541,'Prospect Knight of Champions','2013-10-05',2013,'Mt. Prospect, IL','Chris Barnum','http://www.prospectband.com/','The Prospect High School Band Boosters will be sponsoring the Knight of Champions marching band competition on Saturday, October 5, 2013 at Prospect High School. Bands will compete in three classes: A (up to 64 members), AA (65 to 96 members), and AAA (97 or more members). Awards presented will include first, second, and third place in Class A, AA, and AAA. Additional awards for Outstanding Percussion, Outstanding Auxiliary, Outstanding Music, Outstanding Visual and outstanding General Effect will be given to each class. Participation awards will be presented to all bands that perform. There will be caption-specific commentary and scoring, and an overall Grand Champion Traveling trophy. We will be utilizing a scoring system similar to Bands of America.  ','<b>Music Individual:</b> David Maccabee<br />\r\n<b>Music Ensemble:</b> Pete Griffin<br />\r\n<b>Visual Individual:</b> Chris Alexander<br />\r\n<b>Visual Ensemble:</b> Marie Czapinski<br />\r\n<b>Music General Effect:</b> Luther Appel<br />\r\n<b>Music General Effect:</b> Dallas Niermeyer<br />\r\n<b>Visual General Effect:</b> Rich Kemp<br />\r\n<b>Percussion:</b> Brian Spicer<br />\r\n<b>Color Guard:</b> Will Frankenburger<br />\r\n<b>Timing & Penalties:</b> Frank Bischoff<br />\r\n',NULL,'No GC Named',0,'Class 2A held inside due to rain, out of 60 points.\r\nNo Grand Champion named.\r\n\r\nTies broken due to higher General Effect scores.','801 W. Kensington Road, Mt. Prospect, IL 60056',0,'2013-09-13','dbalash'),(542,'Marching Maroons Band Festival','2013-10-05',2013,'Robinson, IL','Katie Zdanowski','http://robinsonschools.com/unit2/index.php/rhs/rhs-menu/rhs-finearts/rhs-band/149-rhs/rhs-fine-arts/rhs-band/698-marching-maroons-band-festival','The Robinson High School Band will be hosting the Marching Maroons Band Festival on October 5, 2013. Bands have the option of performing in both field and parade competitions this year.  The parade begins at 1:00.<br />\r\n<br />\r\nA grand champion will be awarded for highest combined score.<br />\r\n','',82,NULL,0,'Standstill-Scores out of 40 points.','2000 N. Cross, Robinson, IL 62454',0,'2013-10-01','dbalash'),(543,'Downers Grove South Marching Mustang Music Bowl','2013-10-26',2013,'Downers Grove, IL','Craig Roselieb','http://dgsbandboosters.weebly.com/music-bowl.html','2013 marks the 11th year of DGS Marching Mustang Music Bowl and the 2nd on our new turf stadium. Bands compete in three categories (A, AA, AAA) based on band size and the Bands of America scoring system will be utilized. First, second and third place awards will be presented in each class. In addition, the following caption awards will be presented in each class: Outstanding Music Performance, Outstanding Visual Performance, Outstanding General Effect, Outstanding Percussion, Outstanding Auxiliary, Outstanding Drum Major. Returing for 2013 after the prelims competition beginning at 10:00 am will be a finals competition beginning at 7:00 pm for the top band in each class plus the next 7 highest scores regardless of class. Please register online at www.dgsmusicbowl.com.','<b>Music General Effect:</b> Dan Fairchild<br />\r\n<b>Music General Effect:</b> Timothy Yontz<br />\r\n<b>Music Performance Ensemble:</b> Mark Ponzo<br />\r\n<b>Music Performance Individual:</b> Terry Redford<br />\r\n<b>Visual General Effect:</b> Brent Turner<br />\r\n<b>Visual Performance Ensemble:</b> Andy Schmidt<br />\r\n<b>Visual Performance Individual:</b> Kevin McNulty<br />\r\n<b>Color Guard/Auxiliary:</b> Don Wiles<br />\r\n<b>Drum Major:</b> Brayer Teague<br />\r\n<b>Percussion:</b> Kevin Lepper<br />\r\n<b>Timing:</b> Frank Bischoff<br />\r\n',123,NULL,0,'','1436 Norfolk, Downers Grove, IL 60516',1,'2013-10-22','dbalash'),(544,'Red & Black Fall Classic','2013-09-28',2013,'DeKalb, IL','Rick Valenzuela','http://www.regiment.org/bands','The Phantom Regiment Marching Band Festival will be held at Northern Illinois University in conjunction with the Huskie Marching Band.  Adjudicators and clinicians from across the country will be judging, including past and present BOA judges, utilizing BOA sheets.<br /><br />\r\n<br /><br />\r\nThe competition will start at 1:30 P.M.  Tickets will cost $12 for adults, $7 for students, and $30 for a family pack.','',36,NULL,0,'','1201 North Stadium Drive, DeKalb, IL 60115',0,'2013-09-24','dbalash'),(545,'Metro East Marching Classic','2013-09-14',2013,'O\'Fallon, IL','Melissa Gustafson-Hinds','http://othsbands.com/index.php?pagekey=metroeast13','The Metro East Marching Classic, presented by the O\\\'Fallon Township High School Band Boosters, is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by school size and compete for awards in Outstanding Winds, Percussion, and Auxiliary, along with the crowning of a Grand Champion.<br />\r\n<br />\r\nNew this year is online registration!  <a href=http://othsband.com/memcsignup>http://othsband.com/memcsignup</a>','<b>Music:</b> David Meador, Randy Greenwell<br />\r\n<b>Visual:</b> Curtis Costanza, Mike Anderson<br />\r\n<b>Percussion:</b> Brett Kuhn<br />\r\n<b>Color Guard:</b> Becca Sullens',11,NULL,0,'','600 S. Smiley St., O\'Fallon, IL',0,'2013-08-26','dbalash'),(546,'Lake Park Lancer Joust','2013-09-14',2013,'Roselle, IL','Mike Chiodo','http://www.lancerjoust.com/','The Annual Lancer Joust will feature bands from Indiana, Iowa, Wisconsin and Illinois. The competition is an afternoon/evening event in preliminary and final competition format. Preliminary competition is in Class by band size.','<b>MUSIC CAPTIONS</b><br />\r\nDr.John Bell<br />\r\nGary Markham<br />\r\nDr. Dave Knowlton<br />\r\nJoel Denton<br />\r\n<br />\r\n<b>VISUAL CAPTIONS</b><br />\r\nGary Czapinski<br />\r\nEric Sabach<br />\r\nMichael Brady Tarr<br />\r\n<br />\r\n<b>PERCUSSION</b><br />\r\nKevin Lepper<br />\r\n<br />\r\n<b>COLOR GUARD</b><br />\r\nMarie Czapinski<br />\r\n<br />\r\n<b>FIELD MANAGER/TIMING and PENALTIES</b><br />\r\nFrank Bischoff<br />\r\n<br />\r\n<b>ANNOUNCER</b><br />\r\nCam Stasa',36,'',0,'','500 W. Bryn Mawr, Roselle, IL 60172',1,'2013-09-05','dbalash'),(547,'A.A. Stagg Jamboree','2013-09-14',2013,'Palos Hills, IL','Robert Mecozzi','https://sites.google.com/site/staggmusicboosters2/primary-events/jamboree','The Stagg Marching Band Jamboree is proud to celebrate its 34th year. Bands are classified in three class sizes, A, AA, and AAA, based on the number of playing musicians. Bands of America scoring sheets are utilized by a panel of 10 caption judges. 1st, 2nd, and 3rd place awards are given to each class and an overall Grand Champion is also awarded to the highest scoring band. Individual awards are given for outstanding percussion, auxiliary, visual effect, and music. <br />\r\n<br />\r\n','<b></b><br />\r\n<b>Music Individual:</b> Mike Madonia<br />\r\n<b>Music Ensemble:</b> Jeff Waggoner<br />\r\n<b>Visual Individual:</b> Jason Maiers<br />\r\n<b>Visual Ensemble:</b> Tom Bough<br />\r\n<b>GE Music #1:</b> Timothy Yontz<br />\r\n<b>GE Music #2:</b> Greg Clemons<br />\r\n<b>GE Visual:</b> Chad Quamme<br />\r\n<b>Percussion:</b> Dave Dombeck<br />\r\n<b>Auxiliary:</b> Dan Swallow<br />\r\n<b>Timing/Penalties/Drum Major:</b> Brandon Lewis<br />\r\n<b>Tabulator:</b> Kate Alstadt<br />\r\n<b>Announcer:</b> Pat Mooney',25,NULL,0,'','8015 West 111th St., Palos Hills, IL 60465',0,'2013-09-10','dbalash'),(548,'McHenry High School Marching Festival','2013-09-07',2013,'McHenry, IL','Brian Weidner','https://sites.google.com/a/dist156.org/mchenryband/home/marching-band','The McHenry High School Marching Band Festival is a non-competitive clinic for high school marching bands.  Our panel includes distinguished university, high school, and drum corps directors and creative members.  Each band performs a festival show on the main field receiving tapes and response sheets in open caption areas as well as percussion and auxiliary.  These performances are open the public.  Following the performance, bands move to an auxiliary field for a 25 minute clinic with a member of our adjudication panel.','Mike Madonia<br />\r\nKevin McNulty<br />\r\nErica Neidlinger<br />\r\nMark Ponzo<br />\r\nMatt Eaton (percussion)<br />\r\nChristopher Rose (auxiliary)',NULL,'Judged Exhibition.',0,'This show is a judged exhibition.','4724 W. Crystal Lake Rd., McHenry, IL 60050',0,'2013-09-07','dbalash'),(549,'Washington Marching Panther Invitational','2013-09-07',2013,'Washington, IL','Jim Tallman','http://www.wchsband.org/','The 2013 Marching Panther Invitational is a high school field marching competition. Bands will be grouped into classes based on band size and school size. This will be an afternoon / evening event! Trophies and plaques will be given for outstanding Drum Majors, Color Guard, Drumlines and Bands in each class for the Parade and Field Competitions.','',26,NULL,0,'Overall Percussion 1A-3A: Eureka\r\n\r\nOverall Percussion 4A-5A: Morton','115 Bondurant, Washington, IL 61571',0,'2013-08-17','moverholt'),(550,'Limestone Marching Rockets Field Competition','2013-10-05',2013,'Bartonville, IL','Andy Empey','http://limestonebands.com/sub/field-competition/','Limestone High School hosts their third annual field show competition.  They are accepting 20 bands with a BOA style judging format.  Afternoon and evening performances, and classification will be by band size.  Contact Andy Empey at aempey@limestone.k12.il.us for more information.<br /><br />\r\n<br /><br />\r\n','',18,NULL,0,'','4201 South Airport Rd., Bartonville, IL 61607',0,'2013-09-14','dbalash'),(563,'Murphysboro Drums at Appletime','2013-09-14',2013,'Murphysboro, IL','Nick Williams','http://www.crimsonexpress.org/','<b></b>Originally begun as a Drum and Bugle Corps show, the Murphysboro Drums at Appletime competition is a premier competition hosting bands from Illinois, Missouri, Indiana, Kentucky, and Iowa consistently drawing around 5,000 spectators. In an effort to be responsive to the needs of bands early in the season the show features a critique and review session for band directors and their staff with the judges immediately following the competition. A Grand Champion is crowned combining the parade and field show scores.<br />\r\n<br />\r\nThe show will begin at 4:30 P.M.','<b>Parade:</b><br />\r\n<b>Music Execution:</b> Mike Hanes<br />\r\n<b>General Effect:</b> Craig Ryterski<br />\r\n<b>Visual Execution</b> Juan Black<br />\r\n<b>Percussion:</b> Chris Cooper<br />\r\n<b>Color Guard:</b> Alan Willingham<br />\r\n<b>Drum Major:</b> Marc Henshaw<br />\r\n<br />\r\n<br><br />\r\n<b>Field:</b><br />\r\n<b>Music Execution:</b> Mike Hanes<br />\r\n<b>Music General Effect:</b> Deb Burris<br />\r\n<b>Visual Execution:</b> Juan Black<br />\r\n<b>Visual General Effect:</b> Craig Ryterski<br />\r\n<b>Percussion:</b> Chris Cooper<br />\r\n<b>Auxiliary:</b> Alan Willingham<br />\r\n<b>Drum Major:</b> Marc Henshaw<br />\r\n<b>Overall Effect Clinician:</b> Dave Boggs:<br />\r\n<b>Overall Effect Clinician:</b> TBA<br />\r\n<br />\r\n',119,NULL,0,'','50 Blackwood Dr., Murphysboro, IL 62966',0,'2013-09-09','dbalash'),(552,'Danville Viking Invitational','2013-09-28',2013,'Danville, IL','Kent Krause','http://www.bandofvikings.org/2013_Viking_Invitational.html','The Viking invitational is one of the longest running events in the region and has a fantastic tradition of excellence with first rate bands and adjudicators.  We would love continue that tradition for the 2013 Viking Invitational! <br />\r\n<br />\r\n <br />\r\n<b>Classification:</b> Once all the bands have been registered, they will be put into classifications according to band size.  First, second, and third place will be awarded in each class as well as the following caption awards:<br />\r\n<br />\r\nOutstanding Music Performance, Outstanding Visual Performance, Outstanding Percussion, and Outstanding Color Guard.  A Grand Champion trophy will also be awarded.<br />\r\n<br />\r\n<b>Judges:</b> We are in the process of securing an outstanding judging panel to give you the best feedback possible to help you reach your full potential throughout the season.  An eight member panel will adjudicate the following categories: Music Individual, Music Ensemble, Visual Individual, Visual Ensemble, Music General Effect, Visual General Effect, Percussion, and Color Guard.<br />\r\n<br />\r\n<br />\r\n<b>Media:</b> Participants in the Viking Invitational will receive a CD with judges comments as well as a reference video recording of their performance.<br />\r\n<br />\r\nQuestions or requests for an online application can be directed to Kent Krause at krausek1@danville.k12.il.us ','<b>Music Individual:</b> Mark Lindvahl<br />\r\n<b>Music Ensemble:</b> Dr. Jon Dugle<br />\r\n<b>Music General Effect:</b> Brett Richardson<br />\r\n<br />\r\n<b>Visual Individual:</b> Dan Romano <br />\r\n<b>Visual Ensemble:</b> George York<br />\r\n<b>Visual General Effect:</b> Justin Johnson <br />\r\n<br />\r\n<b>Percussion:</b> Dr. Ben Stiers<br />\r\n<b>Color Guard:</b> Christine Chiavola<br />\r\n',155,NULL,0,'','202 E. Fairchild, Danville, IL 61832 ',0,'2013-09-27','dbalash'),(553,'Youth in Music Marching Band Championship','2013-10-12',2013,'Minneapolis, MN','Brent Turner','http://www.youthinmusic.org/','Youth in Music would like to invite you to participate in the annual Marching Band Championship at the Hubert H. Humphrey Metrodome. This championship event will be adjudicated by a national level judging panal, and is open to any high school marching band. Grouped can participate in one of four classes: A, AA, AAA and Exhibition.<br /><br /><br />\r\n<br /><br /><br />\r\nOur goal is to provide your students with a first-rate performance experience! All bands will receive critique from a qualified panel of national level judges and educators, as well as a videocassette of their performance.','',NULL,NULL,0,NULL,'900 South 5th Street, Minneapolis, Minnesota 55415',0,'2013-01-10','dbalash'),(554,'Belleville East Marching Invitational','2013-09-14',2013,'Belleville, IL','Mark Tessereau','http://www.lancerbands.org/marching_invitational','The Belleville East High School Marching Lancers invite you to attend the annual Belleville East Marching Invitational. Awards include Outstanding Winds, Visual, Percussion, Auxiliary, People\\\'s Choice, &  Grand Champion. Bands are classified by instrumentation size.  The BEMI is back at Belleville East in 2013, providing bands with a chance to \"double up\" and compete here and at O\'Fallon High School as well.','',NULL,'Rockwood Summit, MO',0,'','2555 West Boulevard, Belleville, IL',0,'2013-09-04','dbalash'),(555,'Bands of America Super Regional Championships: St. Louis, MO','2013-10-18',2013,'St. Louis, MO','Bands of America','http://www.musicforall.org','Celebrating their 38th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\nA 2 day Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','<b>Music:</b><br />\r\nScott-Lee Atchison<br />\r\nAlbert Lo<br />\r\nDavid McGrath<br />\r\nChester Phillips<br />\r\nMike Rubino<br />\r\nMark Waymire<br />\r\nJay Webb<br />\r\nTodd Zimbelman<br />\r\n<br />\r\n<b>Visual:</b><br />\r\nKen Giese<br />\r\nJackie Gilley<br />\r\nMichael Gray<br />\r\nTim Landess<br />\r\nKyle Miller<br />\r\nBob Thomas<br />\r\n<br />\r\n<b>Chief Judge:</b><br />\r\nGary Markham',NULL,'Broken Arrow, OK',0,'','701 Convention Plaza, St. Louis, MO 63101',1,'2013-10-01','dbalash'),(556,'Bands of America Regional Championships: Indianapolis, IN','2013-11-08',2013,'Indianapolis, IN','Bands of America','http://www.musicforall.org','Celebrating their 37th year, Bands of America presents the Regional Championships presented by Yamaha.<br /><br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.<br /><br />\r\n<br /><br />\r\nIn 2013, the Indianapolis Regional Championships will continue as a 2 day Super Regional.','',NULL,'Carmel, IN',0,'','500 South Capitol Avenue, Indianapolis, IN 46225',1,'2013-10-28','dbalash'),(557,'Bands of America Regional Championships: Muncie, IN','2013-10-05',2013,'Muncie, IN','Bands of America','http://www.musicforall.org','<b></b>Celebrating their 38th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\n<br />\r\nClasses are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','<b>Music:</b><br />\r\nJohn Culvahouse<br />\r\nDaniel Galloway<br />\r\nMartin Griffin<br />\r\nKen Turner<br />\r\n<br />\r\n<b>Visual:</b><br />\r\nFrank Miller<br />\r\nFrankie Morris<br />\r\nEd Warren<br />\r\n<br />\r\n<b>Chief Judge:</b><br />\r\nRichard Saucedo',NULL,'Carmel, IN',0,'Finals cancelled due to rain.','3300 North Tillotson Avenue, Muncie, IN',1,'2013-10-01','dbalash'),(558,'Bands of America Regional Championships: Kettering, OH','2013-09-21',2013,'Kettering, OH','Bands of America','http://www.musicforall.org','Celebrating their 38th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.<b></b>','<b>Music:</b><br />\r\nJohn Alstrin<br />\r\nJeff Harper<br />\r\nJeremy Earnhart<br />\r\nMarty Griffin<br />\r\n<br />\r\n<b>Visual:</b><br />\r\nJackie Gilley<br />\r\nBruce Jones<br />\r\nRandy Nelson <br />\r\n<br />\r\n<b>Chief Judge:</b><br />\r\nGary Markham<br />\r\n',NULL,'William Mason,