and size and school size. This will be an afternoon / evening event! Trophies and plaques will be given for outstanding Drum Majors, Color Guard, Drumlines and Bands in each class for the Parade and Field Competitions.','',26,NULL,0,'','115 Bondurant, Washington, IL 61571',0,'2014-08-25','dbalash'),(593,'A.A. Stagg Jamboree','2014-09-13',2014,'Palos Hills, IL','Robert Mecozzi','https://sites.google.com/site/staggmusicboosters2/primary-events/jamboree','The Stagg Marching Band Jamboree is proud to celebrate its 35th year. Bands are classified in three class sizes, A, AA, and AAA, based on the number of playing musicians. Bands of America scoring sheets are utilized by a panel of 10 caption judges. 1st, 2nd, and 3rd place awards are given to each class and an overall Grand Champion is also awarded to the highest scoring band. Individual awards are given for outstanding percussion, auxiliary, visual effect, and music. <br />\r\n<br />\r\n','<b>Music Individual:</b> Pete Griffin<br />\r\n<b>Music Ensemble:</b> Jeff Waggoner<br />\r\n<b>Visual Individual:</b> Chris Owen<br />\r\n<b>Visual Ensemble:</b> Jason Maiers<br />\r\n<b>Music General Effect:</b> Greg Clemons<br />\r\n<b>Music General Effect:</b> John Apple<br />\r\n<b>Visual General Effect:</b> Chad Quamme<br />\r\n<b>Percussion:</b> Joe Roach<br />\r\n<b>Auxiliary:</b> Ryan Klassa<br />\r\n<b>Timing and Penalties/Drum Major:</b><br />\r\n<b>Tabulator:</b> Kate Alstadt<br />\r\n<b>Announcer:</b> Pat Mooney<br />\r\n',25,NULL,0,'','8015 West 111th St., Palos Hills, IL 60465',0,'2014-09-06','dbalash'),(597,'Sullivan Marching Band Competition','2014-09-13',2014,'Sullivan, IL','Ryan Krapf','','This fall on September 13th, 2014 we will be hosting our 1st Annual Marching Band Contest at Sullivan High School. Sullivan is approximately 20 miles southeast of Decatur, Illinois. We are easily accessible from I-57 as well as Route 51/I-39. This contest will use a caption based judging system and will be based on band size. We plan to have a late morning/afternoon start to help avoid sports conflicts that may occur in the morning. Cost will be $125. We will have caption awards as well as awards for 1st, 2nd, and 3rd Place in each class as well as a Grand Champion Trophy. After your group performs, they will also receive a clinic with a marching band clinician that will just be observing your performance to help you focus your efforts for the remainder of the fall. We hope that this extra part of our contest will help offer something unique and benefit your students at this early part of the season. We have great facilities and will offer your students an excellent marching competition atmosphere.<br />\r\n<br />\r\nPlease fill out the attached google form to reserve your bands spot in our contest. We hope to see you on September 13th!<br />\r\n<br />\r\nRyan Krapf<br />\r\nDirector of Bands<br />\r\nSullivan Schools<br />\r\n<br />\r\n<br />\r\nPlease fill out the below form to register for the 2014 Sullivan Marching Redskins Contest on September 13, 2014.<br />\r\nI\'ve invited you to fill out the form 2014 Sullivan Marching Redskins Contest Registration. To fill it out, visit: <br />\r\nhttps://docs.google.com/forms/d/1eW9qP1Q7fS-_PcUtL3S8c6sZk7AgB4QQGyHWJo89RWw/viewform<br />\r\n','',79,NULL,0,'','725 N. Main St., Sullivan, IL 61951',0,'2014-09-06','dbalash'),(598,'Tiger Ambush Classic','2014-09-20',2014,'Edwardsville, IL','Marvin Battle','http://mbattl8.wix.com/tiger-ambush-classic','The Tiger Ambush Classic is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by band size and compete for awards in Outstanding Winds, Percussion, Auxiliary, Drum Major, and Grand Champion. Judging is based on sheets designed by the Mid-America Marching Consortium.','<b>Music Individual:</b> Miles Threlkeld<br />\r\n<b>Music Ensemble:</b> Joe Manfredo<br />\r\n<b>Music GE:</b> James Haskell<br />\r\n<b>Visual Ensemble:</b> Robert Berry<br />\r\n<b>Visual GE:</b> Jo Smith<br />\r\n<b>Color Guard:</b> Duane Williams<br />\r\n<b>Percussion:</b> Josh Williams',31,NULL,0,'','6161 Center Grove Rd, Edwardsville, IL 62025',0,'2014-09-17','dbalash'),(599,'Limestone Marching Rockets Field Competition','2014-09-27',2014,'Bartonville, IL','Andy Empey','http://limestonebands.com/sub/field-competition/','Limestone High School hosts their fourth annual field show competition.  They are accepting 20 bands with a BOA style judging format.  Afternoon and evening performances, and classification will be by band size.  Contact Andy Empey at aempey@limestone.k12.il.us for more information.<br />\r\n<br />\r\n','<b>Music Individual</b> - Jordan Yi<br />\r\n<b>Music Ensemble</b> - Dan Belongia<br />\r\n<b>Music GE 1</b> - Craig Fitzpatrick<br />\r\n<b>Music GE 2</b> - Kevin McNulty Sr.<br />\r\n<b>Visual Individual</b> - Andy Tye<br />\r\n<b>Visual Ensemble</b> - Ted Reicher<br />\r\n<b>Visual GE</b> - Alan Spaeth<br />\r\n<b>Colorguard</b> - Dave Fairchild<br />\r\n<b>Percussion</b> - Kevin Nichols',92,NULL,0,'1A/2A Grand Champion: Macomb','4201 South Airport Rd., Bartonville, IL 61607',0,'2014-09-10','dbalash'),(600,'Wheaton North Falcon Marching Band Festival','2014-09-27',2014,'Wheaton, IL','Jon Noworyta','http://www.wheatonnorthband.com/Falcon%20Fest/index.html','Trophies will be presented for first, second, and third place in Classes A, AA, and AAA. Overall caption awards presented for the event will include: Outstanding Visual Performance, Outstanding Musical Performance, Outstanding General Effect, and Outstanding Percussion. ','<b>Music Performance Individual:</b> John Clemmons<br />\r\n<b>Music Performance Ensemble:</b> Todd Schultz<br />\r\n<b>Visual Performance Individual:</b> Chad Quamme<br />\r\n<b>Visual Performance Ensemble:</b> Mike Madonia<br />\r\n<b>Music General Effect:</b> Greg Clemmons<br />\r\n<b>Music General Effect:</b> John Apple<br />\r\n<b>Visual General Effect:</b> Matt Straton<br />\r\n<b>Percussion:</b> TBA<b