IL 62401',0,'2014-10-08','dbalash'),(603,'Newton Marching Eagles Band Classic','2014-10-11',2014,'Newton, IL','Joyce Reis','http://www.marchingeagles.info/','The Newton Marching Classic is a morning/early afternoon competition, which also allows the opportunity for bands to attend the Effingham Marching Invitational.  We will accommodate your schedule so that your band can compete at both shows. Bands will be classified based on school size.','',73,NULL,0,'Miss D Crowd Appeal Award: Triad','201 W. End Ave. Newton, IL 62448',0,'2014-10-07','dbalash'),(604,'WIU Marching Band Classic','2014-10-11',2014,'Macomb, IL','Matt Thomas','http://www.wiu.edu/cofac/bands/ensembles/marching_band/marching_band_classic.php','The 33rd annual Western Illinois University Marching Band Classic will feature some of the finest west-central and central Illinois high school bands in field competition on the WIU-Macomb campus. The classic kicks off with the National Anthem at 4 PM on Hanson Field; the awards ceremony is scheduled for 8:10 PM. In between there will be field competition in a two division championship format: small school (Classes 1A, 2A) and large school (Classes 3A, 4A). Overall champion trophies will be awarded in each division and to the top three bands in each class. The best drum major(s), percussion, winds and auxiliaries in each division also will receive trophies.','',NULL,'Davenport Central, IA',0,'1A-2A Grand Champion: Macomb','1 University Circle, Macomb, IL 61455',0,'2014-10-10','dbalash'),(605,'Marengo Settlers Days','2014-10-12',2014,'Marengo, IL','Todd Stellmach','http://www.mchs154.org/mchs/depts/activities/org.php?org=32','This annual competition plays host to some of the better bands in Illinois.','<b>Music Individual:</b> Matt Eaton<br />\r\n<b>Music Ensemble:</b> Mark Ponzo<br />\r\n<b>Visual Individual:</b> Chris Owen<br />\r\n<b>Visual Ensemble:</b> Rick Valenzuela<br />\r\n<b>Music General Effect 1:</b> Timothy Yontz<br />\r\n<b>Music General Effect 2:</b> Tom Bough<br />\r\n<b>Visual General Effect:</b> Lori Valenzuela<br />\r\n<b>Color Guard:</b> Jennifer Luby<br />\r\n<b>Percussion:</b> John Haney<br />\r\n<b>Drum Major:</b> Brandon Stansbury<br />\r\n<b>Parade Music 1:</b> Lisa Eaton<br />\r\n<b>Field Manager/Parade Music II:</b> Jeffery Urban<br />\r\n<b>Announcer/Parade Visual:</b> Pat Mooney',66,NULL,0,'','110 Franks Road, Marengo, IL 60152',0,'2014-10-07','dbalash'),(606,'Bands of America Super Regional Championships: St. Louis, MO','2014-10-17',2014,'St. Louis, MO','Bands of America','http://www.musicforall.org','Celebrating their 39th year, Bands of America presents the Regional Championships presented by Yamaha.<br /><br />\r\nA 2 day Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','',NULL,'Broken Arrow, OK',0,'Ties are broken by the general effect score.','701 Convention Plaza, St. Louis, MO 63101',0,'2014-10-15','dbalash'),(607,'Bands of America Regional Championships: Indianapolis, IN','2014-10-24',2014,'Indianapolis, IN','Bands of America','http://www.musicforall.org','Celebrating their 39th year, Bands of America presents the Regional Championships presented by Yamaha.<br /><br /><br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.<br /><br /><br />\r\n<br /><br /><br />\r\nIn 2014, the Indianapolis Regional Championships will continue as a 2 day Super Regional.','',NULL,'Avon, IN',0,'15 bands were accepted into finals due to a tie in prelims scores.\r\n\r\nTies are broken by the general effect score.','500 South Capitol Avenue, Indianapolis, IN 46225',0,'2014-10-06','dbalash'),(608,'Downers Grove South Marching Mustang Music Bowl','2014-10-25',2014,'Downers Grove, IL','Craig Roselieb','http://www.dgsbandboosters.com/music-bowl','2014 marks the 12th year of DGS Marching Mustang Music Bowl.  Bands compete in three categories (A, AA, AAA) based on band size and the Bands of America scoring system will be utilized. First, second and third place awards will be presented in each class. In addition, the following caption awards will be presented in each class: Outstanding Music Performance, Outstanding Visual Performance, Outstanding General Effect, Outstanding Percussion, Outstanding Auxiliary, Outstanding Drum Major. Returning for 2014  will be a finals competition beginning at 7:00 pm for the top band in each class plus the next 7 highest scores regardless of class. Please register online at http://www.dgsbandboosters.com/music-bowl.','<b>Music Individual:</b> Tom Bough<br />\r\n<b>Music Ensemble:</b> Dan Belongia<br />\r\n<b>Visual Individual:</b> Erica Bough<br />\r\n<b>Visual Ensemble:</b> Andy Schmidt<br />\r\n<b>Music General Effect:</b> Mark Ponzo<br />\r\n<b>Music General Effect:</b> Steven Steele<br />\r\n<b>Visual General Effect:</b> Brent Turner<br />\r\n<b>Color Guard:</b> Don Wiles<br />\r\n<b>Drum Major:</b> Brayer Teague<br />\r\n<b>Percussion:</b> Kevin Lepper<br />\r\n<b>Timing and Penalties:</b> George Pierard<br />\r\n<b>Announcer:</b> Jon Hansen',NULL,'Waukesha North, WI',0,'Due to tie of overall GE score between Plainfield North and Waukesha North, best GE music determined the caption award.\r\n\r\nDue to overall score tie, rank determined by rank of preliminary and final score combined','1436 Norfolk, Downers Grove, IL 60516',0,'2014-10-20','dbalash'),(626,'Mt. Zion Marching Music Games','2014-09-27',2014,'Mt. Zion, IL','Brianna Bjerke','http://mtzion.il.schoolwebpages.com/education/club/club.php?sectiondetailid=89831&linkid=nav-menu-container-4-16773','The Mt. Zion Marching Braves present the 10th Annual Marching Music Games. Highlights of the contest include excellent judges and critique, an afternoon parade and evening field competition under the lights, conveniently located warm-up fields, hospitality rooms and free meals for directors and staff, great concessions and competition based on band size. 1st, 2nd, 3rd place trophies in each class in parade and field show. Best in class trophies in each class in parade and field show (Best Drum Major, Best Drum Line, Best Auxiliary), Grand Champion regardless of class.','',79,NULL,0,'','305 S. Henderson, Mt. Zion, IL 62549',0,'2014-09-22','dbalash'),(610,'St. Rita Mustang Stampede','2014-10-05',2014,'Chicago, IL','Cindy Gradek','http://stritahs.com/activities/band/','The Mustang Stampede is a marching band competition that is sponsored by the St. Rita High School Band and its Boosters. Over the years this competition has grown in size to accommodate over 20 of the areas finest bands.','',136,NULL,0,'','7740 S. Western Ave., Chicago, IL 60620',0,'2014-09-24','dbalash'),(611,'Lincoln-Way Invitational ','2014-10-18',2014,'New Lenox, IL','Chris Mroczek','http://www.lwcmb.org/','This year, the Lincoln-Way Invitational will be held at <b>Lincoln-Way Central High School.</b>. <br />\r\n<br />\r\nSchools will be classified according to band size with awards in each class consisting of Outstanding Musical Performance, Outstanding Visual Performance, Outstanding General Effect, Outstanding Percussion and Outstanding Auxiliary.','<b>Music Performance Individual:</b> Greg Jasek<br />\r\n<b>Music Performance Ensemble:</b> Joseph Manfredo<br />\r\n<b>Visual Performance Individual:</b> Kevin McNulty<br />\r\n<b>Visual performance Ensemble:</b> Steve Cross<br />\r\n<b>Music General Effect:</b> Wayne Markworth<br />\r\n<b>Music General Effect:</b> Dan Belongia<br />\r\n<b>Visual General Effect:</b> Jason Miller<br />\r\n<b>Percussion:</b> Kevin Lepper<br />\r\n<b>Auxiliary:</b> Alan Spaeth<br />\r\n<b>Timing & Penalties:</b> Frank Bischoff',25,NULL,0,'','1801 E. Lincoln Hwy., New Lenox, IL 60451',0,'2014-09-25','dbalash'),(612,'Dwight Harvest Days Parade and Field Show','2014-09-21',2014,'Dwight, IL','Justin Gund','http://www.dwightharvestdays.org/FieldShow.htm','This annual competition is held in conjunction with the Dwight Harvest Days. There is a parade that begins at 1:00, and the field show begins at approximately 4:30. Trophies are given out for 1st and 2nd place in each class as well as caption awards. The overall Grand Champion will be the band with the highest combined field and parade scores.','',113,NULL,0,'','801 S. Franklin, Dwight, IL 60420',0,'2014-04-30','dbalash'),(613,'Metamora Band Invitational','2014-10-11',2014,'Metamora, IL','Wally Parks','http://www.metamorabands.org/special-events/2013-invitational','The 34th annual running of this contest features a great stadium for marching bands, and excellent well-rounded panel of adjudicators, and wonderful festival atmosphere throughout the day. The competition is one of the largest and oldest, continuous running, high school-sponsored competition in the state of Illinois. Attendees are usually drawn from Illinois, eastern Iowa, and western Indiana. Bands receive a DVD of their performance along with adjudicator tapes. Judging sheets are similar to BOA.','',45,NULL,0,'1A-2A Grand Champion: Niles West\r\n\r\nLimestone Community did not appear at this show due to making finals at ISU.','101 W. Madison St., Metamora, IL 61548',0,'2014-10-02','dbalash'),(614,'Gateway Marching Classic','2014-09-27',2014,'Collinsville, IL','Robert Wright','https://sites.google.com/a/cusd.kahoks.org/chs-band/Home/gateway-marching-classic','The first annual Gateway Marching Classic, presented by the Collinsville High School Band Parents, is an afternoon/evening contest. It is open to any band that applies, but space will be limited to 12 competing bands for the first year. Bands are divided into three classes by band size and compete for awards in music, visual, percussion and auxiliary and Grand Champion.<br />\r\n<br />\r\nThis year will also feature the Marching Illini in Exhibition!','<b>Music Ensemble:</b> David Meador<br />\r\n<b>Music GE:</b> David Allen <br />\r\n<b>Visual Ensemble:</b> Greg Hamilton<br />\r\n<b>Visual GE:</b> Keith Baker<br />\r\n<b>Percussion:</b> Peter Hussey<br />\r\n<b>Auxiliary:</b> John Sullivan<br />\r\n<br />\r\n',31,NULL,0,'','2201 S. Morrison Ave., Collinsville, IL 62234',0,'2014-09-10','dbalash'),(616,'Marching Maroons Band Festival','2014-09-27',2014,'Robinson, IL','Katie Zdanowski','http://www.rhsbands.net/marching-maroons-band-festival.html','<b></b>The Robinson High School Band will be hosting the Marching Maroons Band Festival on September 27, 2014. This late afternoon/early evening contest will be field only this year.<br />\r\n<br />\r\n','<b>Music Ensemble:</b> Katrina Fitzpatrick<br />\r\n<b>Music GE:</b> Jeff Neavor<br />\r\n<b>Visual Ensemble:</b> William Fairbanks<br />\r\n<b>Visual GE:</b> TBA<br />\r\n<b>Color Guard:</b> Ryan Miller<br />\r\n<b>Percussion:</b> Suzanne Downes',82,NULL,0,'','2000 N. Cross, Robinson, IL 62454',0,'2014-09-21','dbalash'),(617,'Geneseo Maple Leaf Classic','2014-09-20',2014,'Geneseo, IL','Steve Scherer','http://gcsdstaff.org/mapleleafclassic/?p=42','Educational format. Each band will receive a one hour clinic from an expert adjudicator with cross-caption expertise. After the clinics, the bands will compete in class competition based on band size. The competition is in the evening under the lights. ','<b>Music:</b> Jerry Robertson<br />\r\n<b>Music:</b> Dan Moore<br />\r\n<b>Music:</b> Richard Nicola<br />\r\n<b>Visual:</b> Kurt Kinyon<br />\r\n<b>Visual:</b> John Burns<br />\r\n<b>Visual:</b> Dan Swallow<br />\r\n<b>Drum Majors:</b> Victor Bianchetta<br />\r\n<b>Color Guard:</b> Sara Maccabee<br />\r\n<b>Percussion:</b> Genaro Cantu<br />\r\n<b>Winds:</b> Bernie Potter<br />\r\n<b>Critique:</b> John Bell<br />\r\n<b>Critique:</b> Gary Smith<br />\r\n<b>Critique:</b> Peter Griffin',30,NULL,0,'','700 N. State St., Geneseo, IL 61254',0,'2014-09-12','dbalash'),(618,'Belleville East Marching Invitational','2014-09-13',2014,'Belleville, IL','Mark Tessereau','http://www.lancerbands.org/marching_invitational','The Belleville East High School Marching Lancers invite you to attend the annual Belleville East Marching Invitational. Awards include Outstanding Winds, Visual, Percussion, Auxiliary, People\'s Choice, & Grand Champion. Bands are classified by school size.','',NULL,'Rockwood Summit, MO',0,'','2555 West Boulevard, Belleville, IL',0,'2014-09-08','dbalash'),(619,'Metro East Marching Classic','2014-09-13',2014,'OFallon, IL','Melissa Gustafson-Hinds','http://othsbands.com/index.php?pagekey=metroeast14','The Metro East Marching Classic, presented by the O\'Fallon Township High School Band Boosters, is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by school size and compete for awards in Outstanding Winds, Percussion, and Auxiliary, along with the crowning of a Grand Champion.','<b>Music Ensemble:</b> David Meador<br />\r\n<b>Visual Ensemble:</b> Curtis Costanza<br />\r\n<b>Music General Effect:</b> Randy Greenwell<br />\r\n<b>Visual General Effect:</b> Mike Anderson<br />\r\n<b>Percussion:</b> Jim Bailey<br />\r\n<b>Color Guard:</b> Becca Sullens',NULL,'Rockwood Summit, MO',0,'','600 S. Smiley St., O\'Fallon, IL',0,'2014-09-15','dbalash'),(620,'McHenry High School Marching Festival','2014-09-06',2014,'McHenry, IL','Brian Weidner','https://sites.google.com/a/dist156.org/mchenryband/home/marching-band','The McHenry High School Marching Band Festival is a non-competitive clinic for high school marching bands.  Our panel includes distinguished university, high school, and drum corps directors and creative members.  Each band performs a festival show on the main field receiving tapes and response sheets in open caption areas as well as percussion and auxiliary.  These performances are open the public.  Following the performance, bands move to an auxiliary field for a 25 minute clinic with a member of our adjudication panel.','',NULL,NULL,0,NULL,'4724 W. Crystal Lake Rd., McHenry, IL 60050',0,'2014-09-29','clarinetdude124'),(621,'Murphysboro Drums at Appletime','2014-09-13',2014,'Murphysboro, IL','Kirk Caskey','http://www.murphysboro.com/index.php?option=com_k2&view=item&layout=item&id=45&Itemid=318','Originally a Drum and Bugle Corps show, the Murphysboro Drums at Appletime competition is a premier competition hosting bands from Illinois, Missouri, Indiana, Kentucky, and Iowa consistently drawing around 5,000 spectators. In an effort to be responsive to the needs of bands early in the season the show features a critique and review session for band directors and their staff with the judges immediately following the competition. A Grand Champion is crowned combining the parade and field show scores.<br />\r\n<br />\r\nThe show will begin at 4:30 P.M.','',119,NULL,0,'','50 Blackwood Dr., Murphysboro, IL 62966',0,'2014-09-08','dbalash'),(622,'North Knights Marching Festival','2014-09-14',2014,'Grayslake, IL','Candace Edstrand','http://north.d127.org/finearts/music/band/marchingknights/Pages/default.aspx','Grayslake North High School is excited to announce their 4th annual marching festival. Competitive and exhibition field-show performances are welcome. Awards will be given for 1st, 2nd and 3rd place in each class as well as caption awards. Festival begins at noon.','',120,NULL,0,'','1925 North Route 83, Grayslake, IL 60030',0,'2014-09-11','clarinetdude124'),(623,'Chicagoland Marching Band Festival','2014-09-20',2014,'Wheeling, IL','Brian Logan','https://sites.google.com/site/whsbandsil/cmbf','The Chicagoland Marching Band Festival (CMBF) hosted by Wheeling High School is Chicago\'s longest running marching band festival and is now celebrating their 47th year.','',36,NULL,0,'','900 S. Elmhurst Road, Wheeling, IL 60090',0,'2014-09-18','dbalash'),(624,'Sage City Invitational','2014-09-20',2014,'Monticello, IL','Alison Allender','https://sites.google.com/site/monticellomusic/high-school/marching-band','This will be an afternoon contest but we try to work with everyone to best accommodate your schedule. Trophies will be given for the following captions in each class: Drum Line, Winds, Auxiliary and Drum Major.  1st, 2nd, and 3rd place trophies will be awarded for each class.  There will also be an Overall Drumline Trophy and Grand Champion.  We have a quality performance field, terrific concessions, outstanding judges and easy access via I-72.	','',NULL,'No Grand Champion Named',0,'No Grand Champion named due to AA being inside due to weather.','1 Sage Drive, Monticello, IL 61856',0,'2014-09-17','dbalash'),(625,'Normal West Marching Band Invitational','2014-09-20',2014,'Bloomington, IL','Lisa Preston','https://sites.google.com/site/nwmbinvitational/','Performance times in the afternoon/evening.<br />\r\n<br />\r\nCompetitive classes will be determined by band size, and we are pleased to offer a noncompetitive class which will provide adjudicator feedback for groups who do not wish to be scored.<br />\r\n<br />\r\nThe Invitational will be held at Illinois Wesleyan University\'s Tucci Stadium at Wilder Field, the fifth oldest football stadium in the NCAA.  New artificial turf was installed at Tucci Stadium in 2011.<br />\r\n<br />\r\nFor additional information, contact the Normal West band directors:<br />\r\nLisa Preston (prestols@unit5.org) and Ryan Budzinski (budzinsr@unit5.org)','<b>Music Performance Individual:</b> Mike Chiodo<br />\r\n<b>Music Performance Ensemble:</b> Kevin Lepper<br />\r\n<b>Visual Performance Individual:</b> Johnnie Green<br />\r\n<b>Visual Performance Ensemble:</b> Kevin McNulty<br />\r\n<b>Music General Effect:</b> Clifton Smith<br />\r\n<b>Music General Effect:</b> Dave Morrison<br />\r\n<b>Visual General Effect:</b> Tim Newburn<br />\r\n<b>Percussion:</b> Phil Beale<br />\r\n<b>Auxiliary:</b> Pamela Snoeck<br />\r\n<b>Announcer:</b> Cam Stasa',NULL,'No Grand Champion Named',0,'Pontiac Township withdrew due to the weather delay. Morton and Normal Community were inside in exhibition due to weather.\r\nNo Grand Champion named due to weather.','1312 Park Street Bloomington, IL 61701',0,'2014-09-12','dbalash'),(627,'Quincy Octoberfest Parade and Field Show','2014-10-18',2014,'Quincy, IL','Kathleen Dooley','http://www.ilmarching.com','The 18th annual Quincy Senior High Marching Band Parade & Field Competition will be held on Saturday, October 18, 2014 in Quincy, Illinois. The competition features marching bands from Illinois, Iowa and Missouri. The parade begins at 2:00 p.m. and the field competition<br /><br />\r\nbegins at 5:15 p.m. at Flinn Stadium. Bands will perform on the newly installed astroturf surface installed the 2011 summer in the stadium. Bands may perform in either the parade or field competition individually or both. Sweepstakes awards are presented by school size, musicianship levels and by state. More information is available at 217-224-3774.','',NULL,NULL,0,NULL,'3322 Maine St., Quincy, IL 62301',0,'2014-03-01','dbalash'),(628,'Oblong Spooktacular','2014-10-25',2014,'Oblong, IL','Lisa Lockhart, Oblong Music Boosters','http://www.theonlyoblong.com/','The Oblong Music Boosters want to invite you to the 19th annual band competition and the largest nighttime parade in the state of Illinois with an average of 10-16 bands for the field competition and about 25-30 for the parade.  After the parade, we invite the bands back to the high school for a big dance on the field with a DJ.  For a registration form or for more info, please contact Lisa Lockhart at LKaiLeiLockhart@gmail.com.','',NULL,NULL,0,NULL,'700 S. Range St., Oblong, IL 62449',0,'2014-10-21','dbalash'),(629,'Pinckneyville Mardi Gras Field Show and Parade','2014-10-25',2014,'Pinckneyville, IL','Stephen Cannedy','http://web.mac.com/scannedy1/iWeb/scannedy1/Mardi%20Gras.html','The field show contest begins around 1:30 or 2:00 in the afternoon at the High School Football field.  Our average number of bands runs around 10-12 and we use 2 or 3 classes depending on how many bands we have. The cost for entering the field show is $150.00. The parade is at night beginning at 7:00 pm.  It is a huge crowd of people and with the event being close to Halloween, there are many dressed up people throughout the parade.  Awards are held after the parade at the fairgrounds.  We have a $500 grand champion award to the band with the highest combined score of parade and field.  In addition all parade bands get a check for $100 and we also have a $150 prize for the best parade band regardless of class.  $100 for 2nd and $50 additional for 3rd.<br /><br /><br />\r\n','',145,'',0,'','600 E. Water St., Pinckneyville, IL 62274',0,'2014-10-21','dbalash'),(630,'Mahomet-Seymour Marching Bulldog Festival','2014-10-11',2014,'Mahomet, IL','Michael Stevens','http://www.msmusicboosters.org/events/marching-bulldog-festival','Easy Access to Competition  3 Major Interstates Nearby<br /><br />\r\nLined Warm-up Field with P.A. System<br /><br />\r\nQuality Performance Field and Stadium w/ seating for 2000+<br /><br />\r\nIndoor Facilities in Case of Rain<br /><br />\r\nFantastic Food / Outstanding Judges.','',111,NULL,0,'','302 W. State St., Mahomet, IL 61853',0,'2014-10-02','dbalash'),(631,'Dunlap Marching Band Invitational','2014-10-04',2014,'Dunlap, IL','Jill Potts','','Dunlap High School will present their first annual marching band invitational in 2014.  Bands will be split into three classes based both on school and band size.  Top three in each class as well as a Grand Champion will be named.<br />\r\n<br />\r\nTo apply: http://bit.ly/1mnC4Du<br />\r\n<br />\r\nFor more information, contact band directors Jason Shea (jshea@dunlapcusd.net) or Jill Potts (jpotts@dunlapcusd.net).','<b>Music Individual:</b> Dr. David Broman<br />\r\n<b>Music Ensemble:</b> Dr. Joe Manfredo<br />\r\n<b>Visual Individual:</b> Kyle Adelman<br />\r\n<b>Visual Ensemble:</b> Dr. Dan Belongia<br />\r\n<b>Music GE:</b> Mike Bolla<br />\r\n<b>Visual GE:</b> Chris Johnston<br />\r\n<b>Percussion:</b> Adam Nichols<br />\r\n<b>Auxiliary:</b> Dave Fairchild',45,NULL,0,'','5220 W. Legion Hall Rd., Dunlap, IL 61525',0,'2014-10-01','dbalash'),(632,'McKendree Preview of Champions','2014-10-11',2014,'Lebanon, IL','Alex Bigley','http://www.mckendree.edu/poc','Bands will compete on a lighted, Game Day turf field, in classes based on number of instrumentalists. Awards are given for 1st, 2nd, and 3rd place in each class and a Grand Champion Award. Caption awards for Outstanding Percussion, Color Guard, Music, and Visual are also given in each class. After each bands performance there will be a video review and clinician comments.','',86,NULL,0,'Small schools Champion: Murphysboro','701 College Road, Lebanon, IL 62254',0,'2014-10-02','dbalash'),(643,'Bands of America Grand National Championships','2006-11-09',2006,'Indianapolis, IN','Bands of America','http://www.musicforall.org','This is the premier marching band event of the season. 90 of the nation\'s best marching bands compete in Indianapolis at the Lucas Oil Stadium in a prelims/semifinals/finals event. Bands are arranged by school size in prelims and semifinals, and class champions are awarded in A, AA, AAA, and AAAA. The 12 top bands move on to finals, and they compete head to head for the prestigious Grand Nationals trophy.','',NULL,'Broken Arrow, OK',0,'','500 South Capitol Avenue, Indianapolis, IN 46225',0,'2014-10-31','clarinetdude124'),(633,'Bands of America Regional Championships: Dayton, OH','2014-09-27',2014,'Dayton, OH','Bands of America','http://www.musicforall.org/what-we-do/boa-marching-championships/regionals/dayton-oh-regional','Celebrating their 39th year, Bands of America presents the Regional Championships presented by Yamaha.','',NULL,'William Mason, OH',0,'','1601 S Edwin C Moses Blvd, Dayton, OH 45417',0,'2014-09-10','dbalash'),(634,'SIU Music & Motion','2014-10-18',2014,'Carbondale, IL','Dr. George Brozak','http://marchingsalukis.siuc.edu/motion.html','Music & Motion 2013 will take place on Saturday, October 18 in the new Saluki Stadium. <br /><br />\r\n<br /><br />\r\nWe will employ a traditional 9-member judging panel, with awards in each class (including percussion, drum major and color guard).  Each band will also receive a beautiful, custom-made participation award.  Classes will be determined by band size.<br /><br />\r\n<br /><br />\r\nFor those of you who wish to promote a non-competitive philosophy, we are pleased to help.  Our Festival Class will provide feedback on your performance with positive, encouraging comments to the members of your band.','',9,NULL,0,'','1255 Lincoln Drive, Carbondale, IL 62901',0,'2014-10-14','dbalash'),(635,'Bands of America Regional Championships: Louisville, KY','2014-09-20',2014,'Louisville, KY','Bands of America','http://www.musicforall.org','Celebrating their 39th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','<b>Music:</b><br />\r\nJohn Astrin<br />\r\nDavid Carbone<br />\r\nLevi Chavis<br />\r\nGlen Fugett<br />\r\n<br />\r\n<b>Visual:</b><br />\r\nMarie Czapinski<br />\r\nBruce Jones<br />\r\nKevin Nix<br />\r\n<br />\r\n<b>Chief Judge:</b><br />\r\nGary Markham',NULL,'Castle, IN',0,'','2800 S. Floyd St., Louisville, KY 40209',0,'2014-09-02','dbalash'),(636,'Danville Viking Invitational','2014-09-27',2014,'Danville, IL','Kent Krause','http://www.bandofvikings.org/Viking_Invitational.html','The Viking invitational is one of the longest running events in the region and has a fantastic tradition of excellence with first rate bands and adjudicators.  We would love continue that tradition for the 2014 Viking Invitational! <br /><br />\r\n<br /><br />\r\n <br /><br />\r\n<b>Classification:</b> Once all the bands have been registered, they will be put into classifications according to band size.  First, second, and third place will be awarded in each class as well as the following caption awards:<br /><br />\r\n<br /><br />\r\nOutstanding Music Performance, Outstanding Visual Performance, Outstanding Percussion, and Outstanding Color Guard.  A Grand Champion trophy will also be awarded.<br /><br />\r\n<br /><br />\r\n<b>Judges:</b> We are in the process of securing an outstanding judging panel to give you the best feedback possible to help you reach your full potential throughout the season.  An eight member panel will adjudicate the following categories: Music Individual, Music Ensemble, Visual Individual, Visual Ensemble, Music General Effect, Visual General Effect, Percussion, and Color Guard.<br /><br />\r\n<br /><br />\r\n<br /><br />\r\n<b>Media:</b> Participants in the Viking Invitational will receive a CD with judges comments as well as a reference video recording of their performance.<br /><br />\r\n<br /><br />\r\nQuestions or requests for an online application can be directed to Kent Krause at krausek1@danville.k12.il.us ','',155,NULL,0,'','202 E. Fairchild, Danville, IL 61832 ',0,'2014-09-30','dbalash'),(637,'Panther Marching Band Festival','2015-10-03',2015,'Charleston, IL','J. Corey Francis','http://www.eiu.edu/~marching_band/Panther%20Marching%20Band%20Festival.php','The Eastern Illinois University Panther Marching Band invites YOU to join us for the 39th Annual Panther Marching Band Festival on Saturday, October 3, 2015 in O\'Brien Stadium on the campus of Eastern Illinois University, Charleston, Illinois.<br /><br />\r\n<br /><br />\r\n<br /><br />\r\nIn the competition division, placement and caption awards in each class in the areas of music, visual, general effect, percussion, guard, and drum major will be awarded.','',NULL,NULL,0,NULL,'600 Lincoln Ave., Charleston, IL 61920',0,'2014-10-07','dbalash'),(638,'Illinois State University Invitational Marching Championships','2015-10-17',2015,'Normal, IL','ISU Bands','http://bands.illinoisstate.edu/events/contests/index.shtml','ISU hosts the annual State of Illinois Marching Band Invitational, which pits the best bands in Illinois in a prelims/finals format.','',NULL,NULL,0,NULL,'702 West College Ave., Normal, IL 61790',0,'2014-10-11','dbalash'),(639,'Prospect Knight of Champions','2015-10-03',2015,'Mt. Prospect, IL','Al Moreno','http://www.prospectband.com/KOC_-_Festival.html','The Prospect High School Band Boosters will be sponsoring the Knight of Champions marching band competition on Saturday, October 3, 2015 at Prospect High School, 801 W. Kensington, Mount Prospect, IL. Bands will compete in three classes: A (up to 64 members), AA (65 to 96 members), and AAA (97 or more members). Awards presented will include first, second, and third place in Class A, AA, and AAA. Additional awards for Outstanding Percussion, Outstanding Auxiliary, Outstanding Music, Outstanding Visual and outstanding General Effect will be given to each class. Participation awards will be presented to all bands that perform. There will be caption-specific commentary and scoring, and an overall Grand Champion Traveling trophy. We will be utilizing a scoring system similar to Bands of America. We hope to make our 19th contest a pleasant and memorable event for everyone. Hope to see you there!','',NULL,NULL,0,NULL,'801 W. Kensington Road, Mt. Prospect, IL 60056',0,'2014-10-15','dbalash'),(640,'Danville Viking Invitational','2015-09-26',2015,'Danville, IL','Kent Krause','http://www.bandofvikings.org/Viking_Invitational.html','The Viking invitational is one of the longest running events in the region and has a fantastic tradition of excellence with first rate bands and adjudicators.  We would love continue that tradition for the 2014 Viking Invitational! <br /><br /><br />\r\n<br /><br /><br />\r\n <br /><br /><br />\r\n<b>Classification:</b> Once all the bands have been registered, they will be put into classifications according to band size.  First, second, and third place will be awarded in each class as well as the following caption awards:<br /><br /><br />\r\n<br /><br /><br />\r\nOutstanding Music Performance, Outstanding Visual Performance, Outstanding Percussion, and Outstanding Color Guard.  A Grand Champion trophy will also be awarded.<br /><br /><br />\r\n<br /><br /><br />\r\n<b>Judges:</b> We are in the process of securing an outstanding judging panel to give you the best feedback possible to help you reach your full potential throughout the season.  An eight member panel will adjudicate the following categories: Music Individual, Music Ensemble, Visual Individual, Visual Ensemble, Music General Effect, Visual General Effect, Percussion, and Color Guard.<br /><br /><br />\r\n<br /><br /><br />\r\n<br /><br /><br />\r\n<b>Media:</b> Participants in the Viking Invitational will receive a CD with judges comments as well as a reference video recording of their performance.<br /><br /><br />\r\n<br /><br /><br />\r\nQuestions or requests for an online application can be directed to Kent Krause at krausek1@danville.k12.il.us ','',NULL,NULL,0,NULL,'202 E. Fairchild, Danville, IL 61832 ',0,'2014-10-21','dbalash'),(641,'Bands of America Grand National Championships','2008-11-13',2008,'Indianapolis, IN','Bands of America','http://www.musicforall.org','This is the premier marching band event of the season. 90 of the nation\'s best marching bands compete in Indianapolis at the Lucas Oil Stadium in a prelims/semifinals/finals event. Bands are arranged by school size in prelims and semifinals, and class champions are awarded in A, AA, AAA, and AAAA. The 12 top bands move on to finals, and they compete head to head for the prestigious Grand Nationals trophy.','',NULL,'Avon, IN',0,'','500 South Capitol Avenue, Indianapolis, IN 46225',0,'2014-10-30',