 and Outstanding General Effect.','',NULL,'Center Grove, IN',0,'','2800 S. Floyd St., Louisville, KY 40209',0,'2014-12-02','clarinetdude124'),(685,'Bands of America Regional Championships: Toledo, Ohio','2002-09-28',2002,'Toledo, OH','Bands of America','http://www.musicforall.org','','',NULL,'Centerville, OH',0,'','2801 West Bancroft Street Toledo, OH 43606',0,'2014-12-03','clarinetdude124'),(686,'Bands of America Super Regional Championships: St. Louis, MO','2002-10-12',2002,'St. Louis, MO','Bands of America','http://www.musicforall.org','A Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','',NULL,'Northmont, OH',0,'','701 Convention Plaza, St. Louis, MO 63101',0,'2014-12-04','clarinetdude124'),(688,'A.A. Stagg Jamboree','2015-09-12',2015,'Palos Hills, IL','Robert Mecozzi','https://sites.google.com/site/staggmusicboosters2/primary-events/jamboree','The Stagg Marching Band Jamboree is proud to celebrate its 36th year. Bands are classified in three class sizes, A, AA, and AAA, based on the number of playing musicians. Bands of America scoring sheets are utilized by a panel of 10 caption judges. 1st, 2nd, and 3rd place awards are given to each class and an overall Grand Champion is also awarded to the highest scoring band. Individual awards are given for outstanding percussion, auxiliary, visual effect, and music. <br /><br />\r\n<br /><br />\r\n','',NULL,NULL,0,NULL,'8015 West 111th St., Palos Hills, IL 60465',0,'2014-12-05','dbalash'),(689,'Metro East Marching Classic','2015-09-12',2015,'OFallon, IL','Melissa Gustafson-Hinds','http://othsbands.com/index.php?pagekey=metroeast14','The Metro East Marching Classic, presented by the O\'Fallon Township High School Band Boosters, is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by school size and compete for awards in Outstanding Winds, Percussion, and Auxiliary, along with the crowning of a Grand Champion.','',NULL,NULL,0,NULL,'600 S. Smiley St., O\'Fallon, IL',0,'2014-12-05','dbalash'),(690,'Washington Marching Panther Invitational','2015-09-12',2015,'Washington, IL','Jim Tallman','','The 2015 Marching Panther Invitational is a high school field marching competition. Bands will be grouped into classes based on band size and school size. This will be an afternoon / evening event! Trophies and plaques will be given for outstanding Drum Majors, Color Guard, Drumlines and Bands in each class for the Parade and Field Competitions.','',NULL,NULL,0,NULL,'115 Bondurant, Washington, IL 61571',0,'2014-12-05','dbalash'),(691,'Lake Park Lancer Joust','2015-09-12',2015,'Roselle, IL','Steve Pyter','http://www.lancerjoust.com/','The Annual Lancer Joust will feature bands from Indiana, Iowa, Wisconsin and Illinois. The competition is a great way to start the season with an afternoon/evening event in preliminary and final competition format. Preliminary competition is classified by band size.','',NULL,NULL,0,NULL,'500 W. Bryn Mawr, Roselle, IL 60172',0,'2014-12-05','dbalash'),(692,'Naperville Central Marching Classic','2015-09-19',2015,'Lisle, IL','DJ Alstadt','http://www.nchsbands.info','The annual Naperville Central Marching Classic is held on the beautiful campus of Benedictine University.  The stadium is a wonderful experience for students to perform in, the judges are all highly respected and experienced adjudicators, and the crowd is always at capacity.  Directors have the option to enter as exhibition.  We also offer feedback and performance opportunities from the Midwest Percussion Cooperative.  Finally, our volunteers and the staff from Benedictine truly make a remarkable team giving spectators, students, and directors an exceptional experience.','',NULL,NULL,0,NULL,'5700 College Road, Lisle, IL 60532',0,'2014-12-05','dbalash'),(693,'Pontiac Indian Showdown','2015-09-19',2015,'Pontiac, IL','Keith Schmink','http://libguides.pontiac.k12.il.us/content.php?pid=425813&sid=3485892','Bands will be competing in the 12th Annual Indian Showdown. Clinics begin at 1:00 P.M. and the competition at 5:00 P.M.','',NULL,NULL,0,NULL,'1100 Indiana Ave., Pontiac, IL 61764',0,'2014-12-05','dbalash'),(694,'Chicagoland Marching Band Festival','2015-09-19',2015,'Wheeling, IL','Brian Logan','https://sites.google.com/site/whsbandsil/cmbf','The Chicagoland Marching Band Festival (CMBF) hosted by Wheeling High School is Chicago\'s longest running marching band festival and is now celebrating their 48th year.','',NULL,NULL,0,NULL,'900 S. Elmhurst Road, Wheeling, IL 60090',0,'2014-12-05','dbalash'),(695,'Wheaton North Falcon Marching Band Festival','2015-09-26',2015,'Wheaton, IL','Jon Noworyta','http://www.wheatonnorthband.com/Falcon%20Fest/index.html','Trophies will be presented for first, second, and third place in Classes A, AA, and AAA. Overall caption awards presented for the event will include: Outstanding Visual Performance, Outstanding Musical Performance, Outstanding General Effect, and Outstanding Percussion. ','',NULL,NULL,0,NULL,'1 Falcon Way, Wheaton, IL 60187',0,'2014-12-05','dbalash'),(702,'Morton Marching Invitational','2015-09-19',2015,'Morton, IL','Jeff Neavor','http://www.mortonbands.org/marching/pumpkinfest.php','The field show competition, hosted by Morton High School, is held during the City of Morton Pumpkin Festival.','',NULL,NULL,0,NULL,'350 N. Illinois St., Morton, IL 61550',0,'2015-02-15','dbalash'),(703,'Bands of America Super Regional Championships: Atlanta, GA','2015-10-30',2015,'Atlanta, GA','Bands of America','http://www.musicforall.org','Celebrating their 40th year, Bands of America presents the Regional Championships presented by Yamaha.<br/><br />\r\nA 2 day Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','',NULL,NULL,0,NULL,'1 Georgia Dome Drive Northwest, Atlanta, GA 30313',0,'2015-02-15','dbalash'),(697,'Lincoln-Way Invitational ','2015-10-10',2015,'Frankfort, IL','Bert Johnson','http://www.lwemusic.org','This year, the Lincoln-Way Invitational will be held at <b>Lincoln-Way East High School.</b>. <br /><br />\r\n<br /><br />\r\nSchools will be classified according to band size with awards in each class consisting of Outstanding Musical Performance, Outstanding Visual Performance, Outstanding General Effect, Outstanding Percussion and Outstanding Auxiliary.','',NULL,NULL,0,NULL,'201 Colorado Ave., Frankfort, IL 60423',0,'2014-12-05','dbalash'),(698,'Marengo Settlers Days','2015-10-11',2015,'Marengo, IL','Todd Stellmach','http://www.mchs154.org/mchs/depts/activities/org.php?org=32','This annual competition plays host to some of the better bands in Illinois.','',NULL,NULL,0,NULL,'110 Franks Road, Marengo, IL 60152',0,'2014-12-05','dbalash'),(699,'Downers Grove South Marching Mustang Music Bowl','2015-10-24',2015,'Downers Grove, IL','Craig Roselieb','http://www.dgsbandboosters.com/music-bowl','2015 marks the 13th year of DGS Marching Mustang Music Bowl.  Bands compete in three categories (A, AA, AAA) based on band size and the Bands of America scoring system will be utilized. First, second and third place awards will be presented in each class. In addition, the following caption awards will be presented in each class: Outstanding Music Performance, Outstanding Visual Performance, Outstanding General Effect, Outstanding Percussion, Outstanding Auxiliary, Outstanding Drum Major. Returning for 2015 will be a finals competition beginning at 7:00 pm for the top band in each class plus the next 7 highest scores regardless of class. Please register online at http://www.dgsbandboosters.com/music-bowl.','',NULL,NULL,0,NULL,'1436 Norfolk, Downers Grove, IL 60516',0,'2014-12-06','dbalash'),(700,'Normal West Marching Band Invitational','2015-09-26',2015,'Bloomington, IL','Lisa Preston','https://sites.google.com/site/nwmbinvitational/','Performance times in the afternoon/evening.<br /><br />\r\n<br /><br />\r\nCompetitive classes will be determined by band size, and we are pleased to offer a noncompetitive class which will provide adjudicator feedback for groups who do not wish to be scored.<br /><br />\r\n<br /><br />\r\nThe Invitational will be held at Illinois Wesleyan University\'s Tucci Stadium at Wilder Field, the fifth oldest football stadium in the NCAA.  New artificial turf was installed at Tucci Stadium in 2011.<br /><br />\r\n<br /><br />\r\nFor additional information, contact the Normal West band directors:<br /><br />\r\nLisa Preston (prestols@unit5.org) and Ryan Budzinski (budzinsr@unit5.org)','',NULL,NULL,0,NULL,'1312 Park Street Bloomington, IL 61701',0,'2014-12-08','dbalash'),(701,'Limestone Marching Rockets Field Competition','2015-10-10',2015,'Bartonville, IL','Andy Empey','http://limestonebands.com/sub/field-competition/','Limestone High School hosts their fifth annual field show competition.  They are accepting 20 bands with a BOA style judging format.  Afternoon and evening performances, and classification will be by band size.  Contact Andy Empey at aempey@limestone.k12.il.us for more information.<br /><br />\r\n<br /><br />\r\n','',NULL,NULL,0,NULL,'4201 South Airport Rd., Bartonville, IL 61607',0,'2014-12-10','dbalash'),(704,'Red & Black Fall Classic','2015-09-26',2015,'DeKalb, IL','Rick Valenzuela','http://www.regiment.org/bands','The Phantom Regiment Marching Band Festival will be held at Northern Illinois University in conjunction with the Huskie Marching Band.  Adjudicators and clinicians from across the country will be judging, including past and present BOA judges, utilizing BOA sheets.<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\nThe competition will start at 1:30 P.M.  Tickets will cost $12 for adults, $7 for students, and $30 for a family pack.','',NULL,NULL,0,NULL,'1201 North Stadium Drive, DeKalb, IL 60115',0,'2015-02-15','dbalash'),(705,'Sullivan Marching Band Competition','2015-09-12',2015,'Sullivan, IL','Ryan Krapf','','This fall on September 12th, 2015, we will be hosting our 2nd Annual Marching Band Contest at Sullivan High School. Sullivan is approximately 20 miles southeast of Decatur, Illinois. We are easily accessible from I-57 as well as Route 51/I-39. This contest will use a caption based judging system and will be based on band size. We plan to have a late morning/afternoon start to help avoid sports conflicts that may occur in the morning. Cost will be $125. We will have caption awards as well as awards for 1st, 2nd, and 3rd Place in each class as well as a Grand Champion Trophy. After your group performs, they will also receive a clinic with a marching band clinician that will just be observing your performance to help you focus your efforts for the remainder of the fall. We hope that this extra part of our contest will help offer something unique and benefit your students at this early part of the season. We have great facilities and will offer your students an excellent marching competition atmosphere.<br /><br />\r\n<br /><br />\r\nPlease fill out the attached google form to reserve your bands spot in our contest. We hope to see you on September 13th!<br /><br />\r\n<br /><br />\r\nRyan Krapf<br /><br />\r\nDirector of Bands<br /><br />\r\nSullivan Schools<br /><br />\r\n<br /><br />\r\n<br /><br />\r\n<br />\r\n','',NULL,NULL,0,NULL,'725 N. Main St., Sullivan, IL 61951',0,'2015-02-15','dbalash'),(706,'Geneseo Maple Leaf Classic','2015-09-19',2015,'Geneseo, IL','Steve Scherer','http://gcsdstaff.org/mapleleafclassic/?p=42','Educational format. Each band will receive a one hour clinic from an expert adjudicator with cross-caption expertise. After the clinics, the bands will compete in class competition based on band size. The competition is in the evening under the lights. ','',NULL,NULL,0,NULL,'700 N. State St., Geneseo, IL 61254',0,'2015-02-15','dbalash'),(707,'Gateway Marching Classic','2015-10-10',2015,'Collinsville, IL','Robert Wright','https://sites.google.com/a/cusd.kahoks.org/chs-band/Home/gateway-marching-classic','The second annual Gateway Marching Classic, presented by the Collinsville High School Band Parents, is an afternoon/evening contest. It is open to any band that applies.  Bands are divided into three classes by band size and compete for awards in music, visual, percussion and auxiliary and Grand Champion.<br /><br />\r\n<br /><br />\r\n','',NULL,NULL,0,NULL,'2201 S. Morrison Ave., Collinsville, IL 62234',0,'2015-02-15','dbalash'),(708,'Pinckneyville Mardi Gras Field Show and Parade','2015-10-31',2015,'Pinckneyville, IL','Stephen Cannedy','http://web.mac.com/scannedy1/iWeb/scannedy1/Mardi%20Gras.html','The field show contest begins around 1:30 or 2:00 in the afternoon at the High School Football field.  Our average number of bands runs around 10-12 and we use 2 or 3 classes depending on how many bands we have. The cost for entering the field show is $150.00. The parade is at night beginning at 7:00 pm.  It is a huge crowd of people and with the event being close to Halloween, there are many dressed up people throughout the parade.  Awards are held after the parade at the fairgrounds.  We have a $500 grand champion award to the band with the highest combined score of parade and field.  In addition all parade bands get a check for $100 and we also have a $150 prize for the best parade band regardless of class.  $100 for 2nd and $50 additional for 3rd.<br /><br /><br /><br />\r\n','',NULL,NULL,0,NULL,'600 E. Water St., Pinckneyville, IL 62274',0,'2015-02-15','dbalash'),(709,'Sage City Invitational','2015-09-19',2015,'Monticello, IL','Alison Allender','https://sites.google.com/site/monticellomusic/high-school/marching-band','This will be an afternoon contest but we try to work with everyone to best accommodate your schedule. Trophies will be given for the following captions in each class: Drum Line, Winds, Auxiliary and Drum Major.  1st, 2nd, and 3rd place trophies will be awarded for each class.  There will also be an Overall Drumline Trophy and Grand Champion.  We have a quality performance field, terrific concessions, outstanding judges and easy access via I-72.	','',NULL,NULL,0,NULL,'1 Sage Drive, Monticello, IL 61856',0,'2015-02-15','dbalash'),(710,'Bands of America Regional Championships: Clarksville, TN','2015-09-19',2015,'Clarksville, TN','Bands of America','http://www.musicforall.org/','Celebrating their 40th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\n<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','',NULL,NULL,0,NULL,'601 College Street, Clarksville, TN 37044',0,'2015-02-15','dbalash'),(711,'Bands of America Regional Championships: Bowling Green, Ohio','2015-09-26',2015,'Bowling Green, Ohio','Bands of America','http://www.musicforall.org','Celebrating their 40th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\n<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','',NULL,NULL,0,NULL,'1600 Stadium Drive, Bowling Green, OH 43403',0,'2015-02-15','dbalash'),(712,'Bands of America Regional Championships: Dayton, OH','2015-10-03',2015,'Dayton, OH','Bands of America','http://www.musicforall.org/what-we-do/boa-marching-championships/regionals/dayton-oh-regional','Celebrating their 40th year, Bands of America presents the Regional Championships presented by Yamaha.<br />\r\n<br />\r\nA Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','',NULL,NULL,0,NULL,'1601 S Edwin C Moses Blvd, Dayton, OH 45417',0,'2015-02-15','dbalash'),(713,'Bands of America Super Regional Championships: St. Louis, MO','2015-10-16',2015,'St. Louis, MO','Bands of America','http://www.musicforall.org','Celebrating their 40th year, Bands of America presents the Regional Championships presented by Yamaha.<br /><br /><br />\r\nA 2 day Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.','',NULL,NULL,0,NULL,'701 Convention Plaza, St. Louis, MO 63101',0,'2015-02-15','dbalash'),(714,'Bands of America Regional Championships: Indianapolis, IN','2015-10-23',2015,'Indianapolis, IN','Bands of America','http://www.musicforall.org','Celebrating their 40th year, Bands of America presents the Regional Championships presented by Yamaha.<br /><br /><br /><br />\r\nA 2 day Prelims/Finals event that routinely brings out the best bands in the nation to compete. Classes are determined by school size. Trophies are given for Placement, Outstanding Music, Outstanding Visual, and Outstanding General Effect.<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\n','',NULL,NULL,0,NULL,'500 South Capitol Avenue, Indianapolis, IN 46225',0,'2015-02-15','dbalash'),(715,'Mahomet-Seymour Marching Bulldog Festival','2015-10-17',2015,'Mahomet, IL','Michael Stevens','http://www.msmusicboosters.org/events/marching-bulldog-festival','Easy Access to Competition  3 Major Interstates Nearby<br /><br /><br />\r\nLined Warm-up Field with P.A. System<br /><br /><br />\r\nQuality Performance Field and Stadium w/ seating for 2000+<br /><br /><br />\r\nIndoor Facilities in Case of Rain<br /><br /><br />\r\nFantastic Food / Outstanding Judges.','',NULL,NULL,0,NULL,'302 W. State St., Mahomet, IL 61853',0,'2015-02-15','dbalash'),(716,'St. Rita Mustang Stampede','2015-09-27',2015,'Chicago, IL','Cindy Gradek','http://stritahs.com/activities/band/','The Mustang Stampede is a marching band competition that is sponsored by the St. Rita High School Band and its Boosters. Over the years this competition has grown in size to accommodate over 20 of the areas finest bands.','',NULL,NULL,0,NULL,'7740 S. Western Ave., Chicago, IL 60620',0,'2015-02-15','dbalash'),(717,'Dunlap Marching Band Invitational','2015-10-03',2015,'Dunlap, IL','Jill Potts','','Dunlap High School will present their second annual marching band invitational in 2015.  Bands will be split into three classes based both on school and band size.  Top three in each class as well as a Grand Champion will be named.<br /><br />\r\n<br /><br />\r\n<br />\r\n<br /><br />\r\nFor more information, contact band directors Jason Shea (jshea@dunlapcusd.net) or Jill Potts (jpotts@dunlapcusd.net).','',NULL,NULL,0,NULL,'5220 W. Legion Hall Rd., Dunlap, IL 61525',0,'2015-02-15','dbalash'),(718,'Mt. Zion Marching Music Games','2015-09-26',2015,'Mt. Zion, IL','Brianna Bjerke','http://mtzion.il.schoolwebpages.com/education/club/club.php?sectiondetailid=89831&linkid=nav-menu-container-4-16773','The Mt. Zion Marching Braves present the 11th Annual Marching Music Games. Highlights of the contest include excellent judges and critique, an afternoon parade and evening field competition under the lights, conveniently located warm-up fields, hospitality rooms and free meals for directors and staff, great concessions and competition based on band size. 1st, 2nd, 3rd place trophies in each class in parade and field show. Best in class trophies in each class in parade and field show (Best Drum Major, Best Drum Line, Best Auxiliary), Grand Champion regardless of class.','',NULL,NULL,0,NULL,'305 S. Henderson, Mt. Zion, IL 62549',0,'2015-02-15','dbalash'),(719,'Belleville East Marching Invitational','2015-09-12',2015,'Belleville, IL','Mark Tessereau','http://www.lancerbands.org/marching_invitational','The Belleville East High School Marching Lancers invite you to attend the annual Belleville East Marching Invitational. Awards include Outstanding Winds, Visual, Percussion, Auxiliary, People\'s Choice, & Grand Champion. Bands are classified by school size.','',NULL,NULL,0,NULL,'2555 West Boulevard, Belleville, IL',0,'2015-02-15','dbalash'),(720,'Tiger Ambush Classic','2015-09-19',2015,'Edwardsville, IL','Marvin Battle','http://mbattl8.wix.com/tiger-ambush-classic','The Tiger Ambush Classic is an afternoon/evening contest open to any band that applies. Bands are divided into three classes by band size and compete for awards in Outstanding Winds, Percussion, Auxiliary, Drum Major, and Grand Champion. Judging is based on sheets designed by the Mid-America Marching Consortium.','',NULL,NULL,0,NULL,'6161 Center Grove Rd, Edwardsville, IL 62025',0,'2015-02-15','dbalash'),(721,'Metamora Band Invitational','2015-10-10',2015,'Metamora, IL','Wally Parks','http://www.metamorabands.org/special-events/2013-invitational','The 35th annual running of this contest features a great stadium for marching bands, and excellent well-rounded panel of adjudicators, and wonderful festival atmosphere throughout the day. The competition is one of the largest and oldest, continuous running, high school-sponsored competition in the state of Illinois. Attendees are usually drawn from Illinois, eastern Iowa, and western Indiana. Bands receive a DVD of their performance along with adjudicator tapes. Judging sheets are similar to BOA.','',NULL,NULL,0,NULL,'101 W. Madison St., Metamora, IL 61548',0,'2015-02-15','dbalash'),(722,'WIU Marching Band Classic','2015-10-24',2015,'Macomb, IL','Matt Thomas','http://www.wiu.edu/cofac/bands/ensembles/marching_band/marching_band_classic.php','The 34th annual Western Illinois University Marching Band Classic will feature some of the finest west-central and central Illinois high school bands in field competition on the WIU-Macomb campus. The classic kicks off with the National Anthem at 4 PM on Hanson Field; the awards ceremony is scheduled for 8:10 PM. In between there will be field competition in a two division championship format: small school (Classes 1A, 2A) and large school (Classes 3A, 4A). Overall champion trophies will be awarded in each division and to the top three bands in each class. The best drum major(s), percussion, winds and auxiliaries in each division also will receive trophies.','',NULL,NULL,0,NULL,'1 University Circle, Macomb, IL 61455',0,'2015-02-15','dbalash'),(723,'Quincy Octoberfest Marching Invitational','2015-10-17',2015,'Quincy, IL','Chris Beason','http://www.ilmarching.com','The Quincy Senior High Octoberfest Invitational Parade & Field Competition will be held on Saturday, October 17th. The parade begins at 2:00 p.m. and the field competition begins at 5:15 p.m.','',NULL,NULL,0,NULL,'',0,'2015-02-15','dbalash'),(724,'Sandwich Musicfest','2015-10-18',2015,'Sandwich, IL','Justin Heinekamp','http://www.sandwich430.org/schools/shs/Band.htm','This show has a field and parade format.','',NULL,NULL,0,NULL,'515 E. Lions Rd., Sandwich, IL 60548',0,'2015-02-15','dbalash'),(725,'Oblong Spooktacular','2015-10-31',2015,'Oblong, IL','Lisa Lockhart, Oblong Music Boosters','http://www.theonlyoblong.com/','The Oblong Music Boosters want to invite you to the 20th annual band competition and the largest nighttime parade in the state of Illinois with an average of 10-16 bands for the field competition and about 25-30 for the parade.  After the parade, we invite the bands back to the high school for a big dance on the field with a DJ.  For a registration form or for more info, please contact Lisa Lockhart at LKaiLeiLockhart@gmail.com.','',NULL,NULL,0,NULL,'700 S. Range St., Oblong, IL 62449',0,'2015-02-15','dbalash');
