INSERT INTO `Users` VALUES (1,'moverholt','Mark Overholt','419f883cf06b190964e43f3509d158d2522161b8','admin','Mark has been a member of ILMarching since 2004. He became a contributor in 2006 and the lead developer in 2008. He attended Eureka High School from 2002 - 2006, where he played Trumpet in Marching Band, Concert Band, and Basketball Band. After graduation, he went on to Bradley University in Peoria, IL where he majored in Computer Science. He continued to play his trumpet in both the Symphonic Band as well as the Basketball Band. After taking over the development of ILMarching in 2008, he put some of his Computer Science skills to work improving the functionality of the site. He graduated Bradley in 2009 Summa Cum Laude with a Bachelors of Science in Computer Science. He is currently attending the University of Illinois, perusing his Masters in CS. <br />\r\n<br />\r\nYou can contact Mark at moverholt@ilmarching.com'),(2,'dbalash','Dan Balash','17335176de9555cdb64b747fe68239090e1c56f4','admin','Dan Balash has been the owner of Illinois Marching Online since December 2008.  He joined the ILmarching community in the fall of 2005, becoming a contributor in 2006.  <br />\r\n<br />\r\nDan is a 2005 graduate of Marian Catholic High School, where he was a proud member of the marching band, playing bass clarinet all 4 years.  He is a 2012 graduate of Governors State University, with a degree in accounting.<br />\r\n<br />\r\nDan is an avid drum corps and marching band follower, and has over 3,000 mp3s of drum corps and marching band.  He follows the Bands of America season a little too closely.<br />\r\n<br />\r\nWhen not following marching band/drum corps, he works at Flossmoor Country Club in the south suburbs of Chicago as a caddy, a job he\'s held since April of 2005.  He also enjoys reading and watching movies, and hanging out with friends.  <br />\r\n<br />\r\nYou can reach Dan at balash@ilmarching.com, or find him on AIM at davidpalmerlives.<br />\r\n'),(3,'TechGuy','Paul Strain','8a887006b6bfdcf1f691d35810422d9adf84fa74','moderator',NULL),(4,'Drummer79','John Donovan','9ff25d5186e7756f335368419f88d6f7e991610f','moderator',NULL),(6,'clarinetdude124','Andrew Beckwith','7f8eecccfdbd52844fc8c7c3bfa301d328752db1','contributor','<br />\r\n'),(14,'w0nk','Mark Overholt','88b23d7214eb5b8c6ab2be9a278cb4f048b7f5a6','admin',NULL),(8,'saxyman','Chris Klaus','8ea93dbc1aa95540df9e7822d6b6693b7b85be21','contributor',NULL),(10,'rkreml','Robert Kreml','e5f74edd0ef6d01b18b355388adcedc3397b1efa','volunteer',NULL),(11,'arusek','Adam Rusek','a322db1eb626dc2747b28fd5be86d5e14b309f3f','volunteer',NULL),(12,'kboggs','Katy Boggs','b3e5bb0ff61aa4e014069464a99edbef9044205e','contributor',NULL),(13,'drillwriter','Bill Jindrich','8586902cfb9f06afedced483a747ee032aa1a79c','contributor','');
